INSERT INTO `news` (`news_id`, `news_name_ru`, `news_text_ru`, `news_name_kz`, `news_text_kz`, `news_name_en`, `news_text_en`, `news_date`, `news_image`, `user_id`, `news_icon`, `is_show`, `news_desc_ru`, `news_desc_en`, `news_desc_kz`, `created_at`, `updated_at`, `deleted_at`, `tag_ru`, `view_count`, `news_meta_description_kz`, `news_meta_description_ru`, `news_meta_description_en`, `news_meta_keywords_kz`, `news_meta_keywords_ru`, `news_meta_keywords_en`, `tag_kz`, `tag_en`, `author_kz`, `author_ru`, `author_en`, `is_audio`, `news_name_qz`, `news_text_qz`, `news_desc_qz`, `tag_qz`, `author_qz`, `news_meta_description_qz`, `news_meta_keywords_qz`, `is_watermark`) VALUES
(1, '\"Астана\" разгромила израильтян в матче Лиги Европы (фото)', '<p>\r\n	Эта встреча была одна из важнейших на групповом этапе для \r\nказахстанского клуба, ведь в случае, если чемпион Казахстана терял очки,\r\n было трудно надеяться на то, что он пройдет дальше.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<span style=\"vertical-align:bottom;\"></span> \r\n</div>\r\n<p>\r\n	В стартовом составе чемпиона Казахстана на поле вышел залечивший \r\nтравму защитник Марин Аничич, место в воротах занял Ненад Эрич, место \r\nМарина Томасова слева в нападении занял Роман Муртазаев. Команды не \r\nпошли вперед с первых минут, действовали очень осторожно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652767 size-full\" src=\"https://i.onthe.io/pogudx46hn65vdv29.cea074b4.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	На 16-й минуте хозяевам дали пробить штрафной прямо напротив ворот, \r\nно Патрик Твумаси ударил прямо в руки Предрагу Райковичу. Навес Дмитрия \r\nШомко «ударом скорпиона» пытался замкнуть Жуниор Кабананга, однако \r\nполучилось неудачно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652771 size-full\" src=\"https://i.onthe.io/pogudx28ptn0t4dj8.fb634cd6.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	Позже Шомко уже сам с линии штрафной в падении пробил в руки \r\nРайковичу. Далее штрафной в исполнении Шомко, мяч попал в руку Дору \r\nПерецу и <strong>был назначен пенальти, который реализовал Твумаси — 1:0</strong>.\r\n</p>', '\"Астана\" разгромила израильтян в матче Лиги Европы (фото)', '<p>\r\n	Эта встреча была одна из важнейших на групповом этапе для \r\nказахстанского клуба, ведь в случае, если чемпион Казахстана терял очки,\r\n было трудно надеяться на то, что он пройдет дальше.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<span style=\"vertical-align:bottom;\"></span> \r\n</div>\r\n<p>\r\n	В стартовом составе чемпиона Казахстана на поле вышел залечивший \r\nтравму защитник Марин Аничич, место в воротах занял Ненад Эрич, место \r\nМарина Томасова слева в нападении занял Роман Муртазаев. Команды не \r\nпошли вперед с первых минут, действовали очень осторожно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652767 size-full\" src=\"https://i.onthe.io/pogudx46hn65vdv29.cea074b4.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	На 16-й минуте хозяевам дали пробить штрафной прямо напротив ворот, \r\nно Патрик Твумаси ударил прямо в руки Предрагу Райковичу. Навес Дмитрия \r\nШомко «ударом скорпиона» пытался замкнуть Жуниор Кабананга, однако \r\nполучилось неудачно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652771 size-full\" src=\"https://i.onthe.io/pogudx28ptn0t4dj8.fb634cd6.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	Позже Шомко уже сам с линии штрафной в падении пробил в руки \r\nРайковичу. Далее штрафной в исполнении Шомко, мяч попал в руку Дору \r\nПерецу и <strong>был назначен пенальти, который реализовал Твумаси — 1:0</strong>.\r\n</p>', '\"Астана\" разгромила израильтян в матче Лиги Европы (фото)', '<p>\r\n	Эта встреча была одна из важнейших на групповом этапе для \r\nказахстанского клуба, ведь в случае, если чемпион Казахстана терял очки,\r\n было трудно надеяться на то, что он пройдет дальше.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<span style=\"vertical-align:bottom;\"></span> \r\n</div>\r\n<p>\r\n	В стартовом составе чемпиона Казахстана на поле вышел залечивший \r\nтравму защитник Марин Аничич, место в воротах занял Ненад Эрич, место \r\nМарина Томасова слева в нападении занял Роман Муртазаев. Команды не \r\nпошли вперед с первых минут, действовали очень осторожно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D2\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652767 size-full\" src=\"https://i.onthe.io/pogudx46hn65vdv29.cea074b4.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	На 16-й минуте хозяевам дали пробить штрафной прямо напротив ворот, \r\nно Патрик Твумаси ударил прямо в руки Предрагу Райковичу. Навес Дмитрия \r\nШомко «ударом скорпиона» пытался замкнуть Жуниор Кабананга, однако \r\nполучилось неудачно.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\">Поделиться в Facebook</a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1652762-astana-razgromila-izrailtyan-v-matche.html%3Fimage%3D3\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\">Рассказать Вконтакте</a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1652771 size-full\" src=\"https://i.onthe.io/pogudx28ptn0t4dj8.fb634cd6.jpg\" alt=\"\" Астана\"=\"\" разгромила=\"\" израильтян=\"\" в=\"\" матче=\"\" Лиги=\"\" Европы=\"\" (фото)\"=\"\" width=\"800\" height=\"534\">\r\n</div>\r\n<p>\r\n	Позже Шомко уже сам с линии штрафной в падении пробил в руки \r\nРайковичу. Далее штрафной в исполнении Шомко, мяч попал в руку Дору \r\nПерецу и <strong>был назначен пенальти, который реализовал Твумаси — 1:0</strong>.\r\n</p>', '2017-10-19 19:56:00', '/media/2017/10/20/195901753500.jpeg', 1, '2', '1', NULL, NULL, NULL, '2017-10-19 19:58:52', '2017-10-30 08:23:25', '2017-10-30 08:23:25', '', 8, '', '', '', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', '', '', 'Администратор', 'Администратор', 'Администратор', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(173, '20 человек, которые поняли все чересчур буквально', '<div class=\"in-news\">\r\n	<img src=\"file://C:/Users/Home/Music/taima_kz.kz/img/news/img6.png\" /> \r\n	<p>\r\n		<img src=\"/custom/wysiwyg/image/image/20171025/20171025124346_90025.png\" alt=\"\" width=\"625\" height=\"326\" />Президент Казахстана Нурсултан Назарбаев на \r\nторжественном собрании в Астане поручил рассмотреть вопрос \r\nперераспределения полномочий между президентом, правительством и \r\nпарламентом, передает «Радио Азаттык».\r\n	</p>\r\n	<p>\r\n		Поделиться в FacebookРассказать Вконтакте\r\n	</p>\r\n	<p>\r\n		Президент пояснил, что данная мера необходима для \r\nусиления «ответственности парламента и правительства за состояние дел в \r\nстране».\r\n	</p>\r\n	<p>\r\n		По словам Назарбаева, «Казахстан был, есть и будет \r\nгосударством с президентской формой правления», но сегодняшний день \r\nставит вопрос возможного расширения полномочий парламента и \r\nправительства.\r\n	</p>\r\n	<p>\r\n		«Настало время рассмотреть вопрос перераспределения \r\nполномочий между президентом, правительством и парламентом. Специальная \r\nкомиссия должна изучить эти вопросы и внести предложения по изменению \r\nсоответствующих законов, а возможно и Конституции», — сказал президент, \r\nпередает Tengrinews.kz.\r\n	</p>\r\n	<p>\r\n		Ранее Назарбаев в интервью агентству Bloomberg \r\nзаявил, что сейчас стоит задача передачи больше власти от президента \r\nправительству. Он отметил, что «слишком много с президентом связывать не\r\n надо».\r\n	</p>\r\n	<p>\r\n		Напомним, что сегодня в Астане проходит торжественное\r\n собрание по случаю 25-летия независимости Казахстана. На нем \r\nприсутствуют депутаты парламента РК, обладатели государственных наград, \r\nпредставители Ассамблеи народа Казахстана, науки, образования медицины, \r\nтворческой интеллигенции и спорта, лидеры религиозных объединений, \r\nрегиональные делегаты из 6 областей страны.\r\n	</p>\r\n</div>', '20 человек, которые поняли все чересчур буквально', '<div class=\"in-news\">\r\n	<img src=\"file://C:/Users/Home/Music/taima_kz.kz/img/news/img6.png\" /> \r\n	<p>\r\n		<img src=\"/custom/wysiwyg/image/image/20171025/20171025124346_90025.png\" alt=\"\" width=\"625\" height=\"326\" />Президент Казахстана Нурсултан Назарбаев на \r\nторжественном собрании в Астане поручил рассмотреть вопрос \r\nперераспределения полномочий между президентом, правительством и \r\nпарламентом, передает «Радио Азаттык».\r\n	</p>\r\n	<p>\r\n		Поделиться в FacebookРассказать Вконтакте\r\n	</p>\r\n	<p>\r\n		Президент пояснил, что данная мера необходима для \r\nусиления «ответственности парламента и правительства за состояние дел в \r\nстране».\r\n	</p>\r\n	<p>\r\n		По словам Назарбаева, «Казахстан был, есть и будет \r\nгосударством с президентской формой правления», но сегодняшний день \r\nставит вопрос возможного расширения полномочий парламента и \r\nправительства.\r\n	</p>\r\n	<p>\r\n		«Настало время рассмотреть вопрос перераспределения \r\nполномочий между президентом, правительством и парламентом. Специальная \r\nкомиссия должна изучить эти вопросы и внести предложения по изменению \r\nсоответствующих законов, а возможно и Конституции», — сказал президент, \r\nпередает Tengrinews.kz.\r\n	</p>\r\n	<p>\r\n		Ранее Назарбаев в интервью агентству Bloomberg \r\nзаявил, что сейчас стоит задача передачи больше власти от президента \r\nправительству. Он отметил, что «слишком много с президентом связывать не\r\n надо».\r\n	</p>\r\n	<p>\r\n		Напомним, что сегодня в Астане проходит торжественное\r\n собрание по случаю 25-летия независимости Казахстана. На нем \r\nприсутствуют депутаты парламента РК, обладатели государственных наград, \r\nпредставители Ассамблеи народа Казахстана, науки, образования медицины, \r\nтворческой интеллигенции и спорта, лидеры религиозных объединений, \r\nрегиональные делегаты из 6 областей страны.\r\n	</p>\r\n</div>', '20 человек, которые поняли все чересчур буквально', '<div class=\"in-news\">\r\n	<img src=\"file://