(176, '12 хитрых приемов из психологии, которые полезно знать каждому', '<p>\r\n	Президент Казахстана Нурсултан Назарбаев на \r\nторжественном собрании в Астане поручил рассмотреть вопрос \r\nперераспределения полномочий между президентом, правительством и \r\nпарламентом, передает «Радио Азаттык».\r\n</p>\r\n<p>\r\n	Президент пояснил, что данная мера необходима для \r\nусиления «ответственности парламента и правительства за состояние дел в \r\nстране».\r\n</p>\r\n<p>\r\n	По словам Назарбаева, «Казахстан был, есть и будет \r\nгосударством с президентской формой правления», но сегодняшний день \r\nставит вопрос возможного расширения полномочий парламента и \r\nправительства.\r\n</p>\r\n<p>\r\n	«Настало время рассмотреть вопрос перераспределения \r\nполномочий между президентом, правительством и парламентом. Специальная \r\nкомиссия должна изучить эти вопросы и внести предложения по изменению \r\nсоответствующих законов, а возможно и Конституции», — сказал президент, \r\nпередает Tengrinews.kz.\r\n</p>\r\n<p>\r\n	Ранее Назарбаев в интервью агентству Bloomberg \r\nзаявил, что сейчас стоит задача передачи больше власти от президента \r\nправительству. Он отметил, что «слишком много с президентом связывать не\r\n надо».\r\n</p>\r\n<p>\r\n	Напомним, что сегодня в Астане проходит торжественное\r\n собрание по случаю 25-летия независимости Казахстана. На нем \r\nприсутствуют депутаты парламента РК, обладатели государственных наград, \r\nпредставители Ассамблеи народа Казахстана, науки, образования медицины, \r\nтворческой интеллигенции и спорта, лидеры религиозных объединений, \r\nрегиональные делегаты из 6 областей страны.\r\n</p>', '12 хитрых приемов из психологии, которые полезно знать каждому', '<p class=\"time-news\">\r\n	<span>3 қыркүйек, 2017</span><span>345</span><span>345</span><span><a class=\"blue-text\">Жұмабай ШАШТАЙҰЛЫ</a></span> \r\n</p>\r\n<div class=\"in-news\">\r\n	<img src=\"file://C:/Users/Home/Music/taima_kz.kz/img/news/img6.png\" /> \r\n	<p>\r\n		Прези