(191, 'Арестован фигурант кровавой драки возле торгового дома в Астане', '<p align=\"justify\">\r\n	Районный суд № 2 Алматинского района Астаны арестовал главного фигуранта драки возле торгового дома \"Гульжан\", сообщает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> со ссылкой на пресс-службу ведомства.\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p align=\"justify\">\r\n	<img width=\"640\" height=\"405\" alt=\"\" src=\"/public/custom/wysiwyg/image/image/20171030/20171030084736_74374.jpg\" />\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>&nbsp;</em><em>\"Суд санкционировал меру пресечения в виде содержания под стражей в отношении мужчины, подозреваемого по делу об избиении мужчины у торгового дома \"Гульжан</em> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<em>\" – сообщили в пресс-службе суда Астаны.</em> \r\n<p>\r\n	<em><strong>Мужчину арестовали на два месяца.</strong></em><em> Другие подробности не разглашаются в интересах следствия.</em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<em>Напомним, </em><a href=\"https://www.nur.kz/1659391-krovavyy-incident-proizoshel-u-torgov.html\"><span><em>истекающего кровью мужчину</em></span></a><em> обнаружили у торгового дома «Гульжан» в Астане.</em> \r\n</p>\r\n<p>\r\n	<em>Позднее был задержан подозреваемый, который признался в содеянном. Он&nbsp;сообщил, что нетрезвый мужчина нецензурно оскорблял его, за что он его и ударил.</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Арестован фигурант кровавой драки возле торгового дома в Астане', '<p align=\"justify\">\r\n	Районный суд № 2 Алматинского района Астаны арестовал главного фигуранта драки возле торгового дома \"Гульжан\", сообщает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> со ссылкой на пресс-службу ведомства.\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>&nbsp;</em><em>\"Суд санкционировал меру пресечения в виде содержания под стражей в отношении мужчины, подозреваемого по делу об избиении мужчины у торгового дома \"Гульжан</em> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<iframe width=\"1000px\" height=\"1000px\" src=\"https://www.facebook.com/v2.6/plugins/quote.php?app_id=1407652382866683&channel=https%3A%2F%2Fstaticxx.facebook.com%2Fconnect%2Fxd_arbiter%2Fr%2FhsBwMj6iLmk.js%3Fversion%3D42%23cb%3Df3c7c73ef211ec4%26domain%3Dwww.nur.kz%26origin%3Dhttps%253A%252F%252Fwww.nur.kz%252Ff1afa08605a0624%26relation%3Dparent.parent&container_width=693&href=https%3A%2F%2Fwww.nur.kz%2F1661333-arestovan-figurant-krovavoy-draki-vo.html&locale=en_US&sdk=joey\" frameborder=\"0\" style=\"width:169px;height:47px;\">\r\n	</iframe>\r\n</div>\r\n<em>\" – сообщили в пресс-службе суда Астаны.</em> \r\n<p>\r\n	<em><strong>Мужчину арестовали на два месяца.</strong></em><em> Другие подробности не разглашаются в интересах следствия.</em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<em>Напомним, </em><a href=\"https://www.nur.kz/1659391-krovavyy-incident-proizoshel-u-torgov.html\"><span><em>истекающего кровью мужчину</em></span></a><em> обнаружили у торгового дома «Гульжан» в Астане.</em> \r\n</p>\r\n<p>\r\n	<em>Позднее был задержан подозреваемый, который признался в содеянном. Он&nbsp;сообщил, что нетрезвый мужчина нецензурно оскорблял его, за что он его и ударил.</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Арестован фигурант кровавой драки возле торгового дома в Астане', '<p align=\"justify\">\r\n	Районный суд № 2 Алматинского района Астаны арестовал главного фигуранта драки возле торгового дома \"Гульжан\", сообщает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> со ссылкой на пресс-службу ведомства.\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>&nbsp;</em><em>\"Суд санкционировал меру пресечения в виде содержания под стражей в отношении мужчины, подозреваемого по делу об избиении мужчины у торгового дома \"Гульжан</em> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<iframe width=\"1000px\" height=\"1000px\" src=\"https://www.facebook.com/v2.6/plugins/quote.php?app_id=1407652382866683&channel=https%3A%2F%2Fstaticxx.facebook.com%2Fconnect%2Fxd_arbiter%2Fr%2FhsBwMj6iLmk.js%3Fversion%3D42%23cb%3Df3c7c73ef211ec4%26domain%3Dwww.nur.kz%26origin%3Dhttps%253A%252F%252Fwww.nur.kz%252Ff1afa08605a0624%26relation%3Dparent.parent&container_width=693&href=https%3A%2F%2Fwww.nur.kz%2F1661333-arestovan-figurant-krovavoy-draki-vo.html&locale=en_US&sdk=joey\" frameborder=\"0\" style=\"width:169px;height:47px;\">\r\n	</iframe>\r\n</div>\r\n<em>\" – сообщили в пресс-службе суда Астаны.</em> \r\n<p>\r\n	<em><strong>Мужчину арестовали на два месяца.</strong></em><em> Другие подробности не разглашаются в интересах следствия.</em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<em>Напомним, </em><a href=\"https://www.nur.kz/1659391-krovavyy-incident-proizoshel-u-torgov.html\"><span><em>истекающего кровью мужчину</em></span></a><em> обнаружили у торгового дома «Гульжан» в Астане.</em> \r\n</p>\r\n<p>\r\n	<em>Позднее был задержан подозреваемый, который признался в содеянном. Он&nbsp;сообщил, что нетрезвый мужчина нецензурно оскорблял его, за что он его и ударил.</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 08:35:00', '/media/2017/10/30/pogudx1t52gc96jn18.5509f052.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 08:45:41', '2017-11-29 18:45:41', NULL, 'Новости Астаны,  Арест Подозреваемого, Драка У Торгового Дома ', 31, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Новости Астаны,  Арест Подозреваемого, Драка У Торгового Дома ', 'Новости Астаны,  Арест Подозреваемого, Драка У Торгового Дома ', 'Администратор', 'Администратор', 'Администратор', '0', 'Arestovan fi\'gy\'rant krovavoi\' draki\' vozle torgovogo doma v Astane', '<p align=\"justify\">\r\n	Rai\'onnyi\' sy\'d № 2 Almati\'nskogo rai\'ona Astany arestoval glavnogo fi\'gy\'ranta draki\' vozle torgovogo doma \"Gy\'ljan\", soobs\'aet <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> so ssylkoi\' na press-sly\'jby\' vedomstva.\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p align=\"justify\">\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>&nbsp;</em><em>\"Sy\'d sanktsi\'oni\'roval mery\' presec\'eni\'ya v vi\'de soderjani\'ya pod strajei\' v otnos\'eni\'i\' my\'jc\'i\'ny, podozrevaemogo po dely\' ob i\'zbi\'eni\'i\' my\'jc\'i\'ny y\' torgovogo doma \"Gy\'ljan</em> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<iframe width=\"1000px\" height=\"1000px\" src=\"https://www.facebook.com/v2.6/plugins/quote.php?app_id=1407652382866683&channel=https%3A%2F%2Fstaticxx.facebook.com%2Fconnect%2Fxd_arbiter%2Fr%2FhsBwMj6iLmk.js%3Fversion%3D42%23cb%3Df3c7c73ef211ec4%26domain%3Dwww.nur.kz%26origin%3Dhttps%253A%252F%252Fwww.nur.kz%252Ff1afa08605a0624%26relation%3Dparent.parent&container_width=693&href=https%3A%2F%2Fwww.nur.kz%2F1661333-arestovan-figurant-krovavoy-draki-vo.html&locale=en_US&sdk=joey\" frameborder=\"0\" style=\"width:169px;height:47px;\">\r\n	</iframe>\r\n</div>\r\n<em>\" – soobs\'i\'li\' v press-sly\'jbe sy\'da Astany.</em> \r\n<p>\r\n	<em><strong>My\'jc\'i\'ny\' arestovali\' na dva mesyatsa.</strong></em><em> Dry\'gi\'e podrobnosti\' ne razglas\'ayutsya v i\'nteresah sledstvi\'ya.</em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<em>Napomni\'m, </em><a href=\"https://www.nur.kz/1659391-krovavyy-incident-proizoshel-u-torgov.html\"><span><em>i\'stekayus\'ego krovyu my\'jc\'i\'ny\'</em></span></a><em> obnary\'ji\'li\' y\' torgovogo doma «Gy\'ljan» v Astane.</em> \r\n</p>\r\n<p>\r\n	<em>Pozdnee byl zaderjan podozrevaemyi\', kotoryi\' pri\'znalsya v sodeyannom. On&nbsp;soobs\'i\'l, c\'to netrezvyi\' my\'jc\'i\'na netsenzy\'rno oskorblyal ego, za c\'to on ego i\' y\'dari\'l.</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'Novosti\' Astany,  Arest Podozrevaemogo, Draka Y\' Torgovogo Doma ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0),
(192, 'ДГД: Продажа новых iPhone в Казахстане пока является незаконной', '<p>\r\n	Управление таможенного контроля ДГД Костанайской области предупредило, что&nbsp;продажа новых смартфонов от Apple -&nbsp;iPhone 8, iPhone 8S и iPhone X на территории Казахстана в течение первой волны продаж будет считаться нарушением прав интеллектуальной собственности, передает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<img width=\"640\" height=\"352\" alt=\"\" src=\"/public/custom/wysiwyg/image/image/20171030/20171030085418_40504.jpg\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	По информации представителя компании «Apple, Inc», Казахстан не включен в список стран, где iPhone 8, iPhone 8S и iPhone X будут официально продаваться в течение первого периода продаж после даты официального объявления.\r\n</p>\r\n<p>\r\n	На основании изложенного, все действия по ввозу, продаже и другому распространению новых продуктов в Республике Казахстан будут считаться нарушением прав интеллектуальной собственности компании «Apple, Inc».\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Обращаем внимание, что главой 53 кодекса РК «О таможенном деле в Республике Казахстан» определены меры и порядок защиты прав на объекты интеллектуальной собственности, условия приостановления выпуска товаров, содержащих объекты интеллектуальной собственности, а также ответственность за имущественный вред (ущерб).\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'ДГД: Продажа новых iPhone в Казахстане пока является незаконной', '<p>\r\n	Управление таможенного контроля ДГД Костанайской области предупредило, что&nbsp;продажа новых смартфонов от Apple -&nbsp;iPhone 8, iPhone 8S и iPhone X на территории Казахстана в течение первой волны продаж будет считаться нарушением прав интеллектуальной собственности, передает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	По информации представителя компании «Apple, Inc», Казахстан не включен в список стран, где iPhone 8, iPhone 8S и iPhone X будут официально продаваться в течение первого периода продаж после даты официального объявления.\r\n</p>\r\n<p>\r\n	На основании изложенного, все действия по ввозу, продаже и другому распространению новых продуктов в Республике Казахстан будут считаться нарушением прав интеллектуальной собственности компании «Apple, Inc».\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Обращаем внимание, что главой 53 кодекса РК «О таможенном деле в Республике Казахстан» определены меры и порядок защиты прав на объекты интеллектуальной собственности, условия приостановления выпуска товаров, содержащих объекты интеллектуальной собственности, а также ответственность за имущественный вред (ущерб).\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'ДГД: Продажа новых iPhone в Казахстане пока является незаконной', '<p>\r\n	Управление таможенного контроля ДГД Костанайской области предупредило, что&nbsp;продажа новых смартфонов от Apple -&nbsp;iPhone 8, iPhone 8S и iPhone X на территории Казахстана в течение первой волны продаж будет считаться нарушением прав интеллектуальной собственности, передает <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	По информации представителя компании «Apple, Inc», Казахстан не включен в список стран, где iPhone 8, iPhone 8S и iPhone X будут официально продаваться в течение первого периода продаж после даты официального объявления.\r\n</p>\r\n<p>\r\n	На основании изложенного, все действия по ввозу, продаже и другому распространению новых продуктов в Республике Казахстан будут считаться нарушением прав интеллектуальной собственности компании «Apple, Inc».\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Обращаем внимание, что главой 53 кодекса РК «О таможенном деле в Республике Казахстан» определены меры и порядок защиты прав на объекты интеллектуальной собственности, условия приостановления выпуска товаров, содержащих объекты интеллектуальной собственности, а также ответственность за имущественный вред (ущерб).\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 08:49:00', '/media/2017/10/30/pogudx557nm6d4qdn.b35c721a.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 08:53:57', '2017-11-28 15:48:35', NULL, 'Интеллектуальная, Собственность, Продажа Iphone ', 35, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Интеллектуальная, Собственность, Продажа Iphone ', 'Интеллектуальная, Собственность, Продажа Iphone ', 'Администратор', 'Администратор', 'Администратор', '0', 'DGD: Prodaja novyh iPhone v Kazahstane poka yavlyaetsya nezakonnoi\'', '<p>\r\n	Y\'pravleni\'e tamojennogo kontrolya DGD Kostanai\'skoi\' oblasti\' predy\'predi\'lo, c\'to&nbsp;prodaja novyh smartfonov ot Apple -&nbsp;iPhone 8, iPhone 8S i\' iPhone X na terri\'tori\'i\' Kazahstana v tec\'eni\'e pervoi\' volny prodaj by\'det sc\'i\'tatsya nary\'s\'eni\'em prav i\'ntellekty\'alnoi\' sobstvennosti\', peredaet <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Po i\'nformatsi\'i\' predstavi\'telya kompani\'i\' «Apple, Inc», Kazahstan ne vklyuc\'en v spi\'sok stran, gde iPhone 8, iPhone 8S i\' iPhone X by\'dy\'t ofi\'tsi\'alno prodavatsya v tec\'eni\'e pervogo peri\'oda prodaj posle daty ofi\'tsi\'alnogo obyavleni\'ya.\r\n</p>\r\n<p>\r\n	Na osnovani\'i\' i\'zlojennogo, vse dei\'stvi\'ya po vvozy\', prodaje i\' dry\'gomy\' rasprostraneni\'yu novyh prody\'ktov v Respy\'bli\'ke Kazahstan by\'dy\'t sc\'i\'tatsya nary\'s\'eni\'em prav i\'ntellekty\'alnoi\' sobstvennosti\' kompani\'i\' «Apple, Inc».\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Obras\'aem vni\'mani\'e, c\'to glavoi\' 53 kodeksa RK «O tamojennom dele v Respy\'bli\'ke Kazahstan» opredeleny mery i\' poryadok zas\'i\'ty prav na obekty i\'ntellekty\'alnoi\' sobstvennosti\', y\'slovi\'ya pri\'ostanovleni\'ya vypy\'ska tovarov, soderjas\'i\'h obekty i\'ntellekty\'alnoi\' sobstvennosti\', a takje otvetstvennost za i\'my\'s\'estvennyi\' vred (y\'s\'erb).\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'I\'ntellekty\'alnaya, Sobstvennost, Prodaja Iphone ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0),
(193, 'Название аэропорта Nursultan Nazarbayev будет на авиабилетах', '<p>\r\n	На официальном сайте Международной ассоциации воздушного транспорта (ИАТА) отображено новое название аэропорта города Астана – «Nursultan Nazarbayev», передает <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a> со ссылкой на <a href=\"https://www.facebook.com/caakaz/?hc_ref=ARQJt-yqBXrVr0dn63lAfX5x9UATSb5a6LLxDHgJ3G7hp-_JHzGK3-gPaBCjxiROTsA&amp;fref=nf\" target=\"_blank\"><span>страницу</span></a> комитета гражданской авиации в Facebook.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<p>\r\n		Новое название аэропорта будет опубликовано в официальном ежемесячном бюллетене ИАТА 1 ноября 2017 года, после чего провайдеры глобальных систем бронирования авиабилетов (Amadeus, SITA) должны внести соответствующие изменения для последующего отображения данной информации, как в сетях продаж, так и билетах.\r\n	</p>\r\n	<p>\r\n		Таким образом, в последующем на авиабилетах по направлению в/из Астаны будет отображено новое наименование аэропорта – «Nursultan Nazarbayev».\r\n	</p>\r\n	<div id=\"inpage_VI-188418-0-410804834\">\r\n	</div>\r\n	<p>\r\n		Также, прорабатывается вопрос изменения трехбуквенного кода «TSE».\r\n	</p>\r\n	<p>\r\n		20 июня 2017 года постановлением правительства международный аэропорт Астана был переименован в «Международный аэропорт Нурсултан Назарбаев».\r\n	</p>\r\n</p>', 'Название аэропорта Nursultan Nazarbayev будет на авиабилетах', '<p>\r\n	На официальном сайте Международной ассоциации воздушного транспорта (ИАТА) отображено новое название аэропорта города Астана – «Nursultan Nazarbayev», передает <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a> со ссылкой на <a href=\"https://www.facebook.com/caakaz/?hc_ref=ARQJt-yqBXrVr0dn63lAfX5x9UATSb5a6LLxDHgJ3G7hp-_JHzGK3-gPaBCjxiROTsA&amp;fref=nf\" target=\"_blank\"><span>страницу</span></a> комитета гражданской авиации в Facebook.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<p>\r\n		Новое название аэропорта будет опубликовано в официальном ежемесячном бюллетене ИАТА 1 ноября 2017 года, после чего провайдеры глобальных систем бронирования авиабилетов (Amadeus, SITA) должны внести соответствующие изменения для последующего отображения данной информации, как в сетях продаж, так и билетах.\r\n	</p>\r\n	<p>\r\n		Таким образом, в последующем на авиабилетах по направлению в/из Астаны будет отображено новое наименование аэропорта – «Nursultan Nazarbayev».\r\n	</p>\r\n	<div id=\"inpage_VI-188418-0-410804834\">\r\n	</div>\r\n	<p>\r\n		Также, прорабатывается вопрос изменения трехбуквенного кода «TSE».\r\n	</p>\r\n	<p>\r\n		20 июня 2017 года постановлением правительства международный аэропорт Астана был переименован в «Международный аэропорт Нурсултан Назарбаев».\r\n	</p>\r\n</p>', 'Название аэропорта Nursultan Nazarbayev будет на авиабилетах', '<p>\r\n	На официальном сайте Международной ассоциации воздушного транспорта (ИАТА) отображено новое название аэропорта города Астана – «Nursultan Nazarbayev», передает <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a> со ссылкой на <a href=\"https://www.facebook.com/caakaz/?hc_ref=ARQJt-yqBXrVr0dn63lAfX5x9UATSb5a6LLxDHgJ3G7hp-_JHzGK3-gPaBCjxiROTsA&amp;fref=nf\" target=\"_blank\"><span>страницу</span></a> комитета гражданской авиации в Facebook.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<p>\r\n		Новое название аэропорта будет опубликовано в официальном ежемесячном бюллетене ИАТА 1 ноября 2017 года, после чего провайдеры глобальных систем бронирования авиабилетов (Amadeus, SITA) должны внести соответствующие изменения для последующего отображения данной информации, как в сетях продаж, так и билетах.\r\n	</p>\r\n	<p>\r\n		Таким образом, в последующем на авиабилетах по направлению в/из Астаны будет отображено новое наименование аэропорта – «Nursultan Nazarbayev».\r\n	</p>\r\n	<div id=\"inpage_VI-188418-0-410804834\">\r\n	</div>\r\n	<p>\r\n		Также, прорабатывается вопрос изменения трехбуквенного кода «TSE».\r\n	</p>\r\n	<p>\r\n		20 июня 2017 года постановлением правительства международный аэропорт Астана был переименован в «Международный аэропорт Нурсултан Назарбаев».\r\n	</p>\r\n</p>', '2017-10-30 08:55:00', '/media/2017/10/30/pogudx32u9q8bnvif.f6353b11.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 08:58:19', '2017-11-29 09:59:18', NULL, 'Переименование Аэропорта Астаны, Аэропорт Нурсултан Назарбаев ', 29, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Переименование Аэропорта Астаны, Аэропорт Нурсултан Назарбаев ', 'Переименование Аэропорта Астаны, Аэропорт Нурсултан Назарбаев ', 'Администратор', 'Администратор', 'Администратор', '0', 'Nazvani\'e aeroporta Nursultan Nazarbayev by\'det na avi\'abi\'letah', '<p>\r\n	Na ofi\'tsi\'alnom sai\'te Mejdy\'narodnoi\' assotsi\'atsi\'i\' vozdy\'s\'nogo transporta (I\'ATA) otobrajeno novoe nazvani\'e aeroporta goroda Astana – «Nursultan Nazarbayev», peredaet <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a> so ssylkoi\' na <a href=\"https://www.facebook.com/caakaz/?hc_ref=ARQJt-yqBXrVr0dn63lAfX5x9UATSb5a6LLxDHgJ3G7hp-_JHzGK3-gPaBCjxiROTsA&amp;fref=nf\" target=\"_blank\"><span>strani\'tsy\'</span></a> komi\'teta grajdanskoi\' avi\'atsi\'i\' v Facebook.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<p>\r\n		Novoe nazvani\'e aeroporta by\'det opy\'bli\'kovano v ofi\'tsi\'alnom ejemesyac\'nom byulletene I\'ATA 1 noyabrya 2017 goda, posle c\'ego provai\'dery globalnyh si\'stem broni\'rovani\'ya avi\'abi\'letov (Amadeus, SITA) doljny vnesti\' sootvetstvy\'yus\'i\'e i\'zmeneni\'ya dlya posledy\'yus\'ego otobrajeni\'ya dannoi\' i\'nformatsi\'i\', kak v setyah prodaj, tak i\' bi\'letah.\r\n	</p>\r\n	<p>\r\n		Taki\'m obrazom, v posledy\'yus\'em na avi\'abi\'letah po napravleni\'yu v/i\'z Astany by\'det otobrajeno novoe nai\'menovani\'e aeroporta – «Nursultan Nazarbayev».\r\n	</p>\r\n	<div id=\"inpage_VI-188418-0-410804834\">\r\n	</div>\r\n	<p>\r\n		Takje, prorabatyvaetsya vopros i\'zmeneni\'ya trehby\'kvennogo koda «TSE».\r\n	</p>\r\n	<p>\r\n		20 i\'yunya 2017 goda postanovleni\'em pravi\'telstva mejdy\'narodnyi\' aeroport Astana byl perei\'menovan v «Mejdy\'narodnyi\' aeroport Ny\'rsy\'ltan Nazarbaev».\r\n	</p>\r\n</p>', '', 'Perei\'menovani\'e Aeroporta Astany, Aeroport Ny\'rsy\'ltan Nazarbaev ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0),
(194, 'Самый молодой мажилисмен сыграл свадьбу', '<p>\r\n	28-летний депутат мажилиса Геннадий Шиповских сыграл свадьбу, передает МИА <a href=\"http://www.inform.kz/kz/mazhilis-deputaty-gennadiy-shipovskih-moldir-esimdi-kyzylordalyk-kyzben-otau-kurdy_a3079677\" target=\"_blank\"><span>\"Казинформ\"</span></a>.\r\n</p>\r\n<p>\r\n	<img width=\"640\" height=\"481\" alt=\"\" src=\"/public/custom/wysiwyg/image/image/20171030/20171030091809_81381.jpg\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Избранницу Геннадия зовут Молдир. Торжество состоялось в одном из ресторанов Кызылорды.\r\n</p>\r\n<p>\r\n	Родился в 1989 году в Саксаульске Аральского района Кызылординской области.\r\n</p>\r\n<p>\r\n	После кончины отца Шиповских Геннадия Павловича и матери Куликовой Лидии Николаевны в 2004 году был определен в Кызылординский детский дом имени Макаренко.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	В том же году был усыновлен казахской семьей - фермером Муратом Насыровым и его супругой Баян Бимаганбетовой, которые уже имели пятерых своих детей). Геннадий <span>называет себя русским с казахской душой</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>\"Я даже думаю на казахском языке, настолько он стал мне родным. На станции Саксаульская, где я родился, ходил в казахский садик и казахскую школу. Все друзья детства – казахи. И себя ощущаю казахом\",</em> \r\n</p>\r\n– подчеркивал Шиповских.\r\n<p>\r\n	С 24 марта 2016 года – депутат мажилиса парламента Республики Казахстан шестого созыва, член фракции «Нур Отан».\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Самый молодой мажилисмен сыграл свадьбу', '<p>\r\n	28-летний депутат мажилиса Геннадий Шиповских сыграл свадьбу, передает МИА <a href=\"http://www.inform.kz/kz/mazhilis-deputaty-gennadiy-shipovskih-moldir-esimdi-kyzylordalyk-kyzben-otau-kurdy_a3079677\" target=\"_blank\"><span>\"Казинформ\"</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Избранницу Геннадия зовут Молдир. Торжество состоялось в одном из ресторанов Кызылорды.\r\n</p>\r\n<p>\r\n	Родился в 1989 году в Саксаульске Аральского района Кызылординской области.\r\n</p>\r\n<p>\r\n	После кончины отца Шиповских Геннадия Павловича и матери Куликовой Лидии Николаевны в 2004 году был определен в Кызылординский детский дом имени Макаренко.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	В том же году был усыновлен казахской семьей - фермером Муратом Насыровым и его супругой Баян Бимаганбетовой, которые уже имели пятерых своих детей). Геннадий <span>называет себя русским с казахской душой</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>\"Я даже думаю на казахском языке, настолько он стал мне родным. На станции Саксаульская, где я родился, ходил в казахский садик и казахскую школу. Все друзья детства – казахи. И себя ощущаю казахом\",</em> \r\n</p>\r\n– подчеркивал Шиповских.\r\n<p>\r\n	С 24 марта 2016 года – депутат мажилиса парламента Республики Казахстан шестого созыва, член фракции «Нур Отан».\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Самый молодой мажилисмен сыграл свадьбу', '<p>\r\n	28-летний депутат мажилиса Геннадий Шиповских сыграл свадьбу, передает МИА <a href=\"http://www.inform.kz/kz/mazhilis-deputaty-gennadiy-shipovskih-moldir-esimdi-kyzylordalyk-kyzben-otau-kurdy_a3079677\" target=\"_blank\"><span>\"Казинформ\"</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Избранницу Геннадия зовут Молдир. Торжество состоялось в одном из ресторанов Кызылорды.\r\n</p>\r\n<p>\r\n	Родился в 1989 году в Саксаульске Аральского района Кызылординской области.\r\n</p>\r\n<p>\r\n	После кончины отца Шиповских Геннадия Павловича и матери Куликовой Лидии Николаевны в 2004 году был определен в Кызылординский детский дом имени Макаренко.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	В том же году был усыновлен казахской семьей - фермером Муратом Насыровым и его супругой Баян Бимаганбетовой, которые уже имели пятерых своих детей). Геннадий <span>называет себя русским с казахской душой</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>\"Я даже думаю на казахском языке, настолько он стал мне родным. На станции Саксаульская, где я родился, ходил в казахский садик и казахскую школу. Все друзья детства – казахи. И себя ощущаю казахом\",</em> \r\n</p>\r\n– подчеркивал Шиповских.\r\n<p>\r\n	С 24 марта 2016 года – депутат мажилиса парламента Республики Казахстан шестого созыва, член фракции «Нур Отан».\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 09:01:00', '/media/2017/10/30/pogudx3mdndo61anag.8047c9d7.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 09:17:30', '2017-11-29 07:30:49', NULL, 'Депутат Мажилиса, Геннадий Шиповских ', 28, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Депутат Мажилиса, Геннадий Шиповских ', 'Депутат Мажилиса, Геннадий Шиповских ', 'Администратор', 'Администратор', 'Администратор', '0', 'Samyi\' molodoi\' maji\'li\'smen sygral svadby\'', '<p>\r\n	28-letni\'i\' depy\'tat maji\'li\'sa Gennadi\'i\' S\'i\'povski\'h sygral svadby\', peredaet MI\'A <a href=\"http://www.inform.kz/kz/mazhilis-deputaty-gennadiy-shipovskih-moldir-esimdi-kyzylordalyk-kyzben-otau-kurdy_a3079677\" target=\"_blank\"><span>\"Kazi\'nform\"</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	I\'zbranni\'tsy\' Gennadi\'ya zovy\'t Moldi\'r. Torjestvo sostoyalos v odnom i\'z restoranov Kyzylordy.\r\n</p>\r\n<p>\r\n	Rodi\'lsya v 1989 gody\' v Saksay\'lske Aralskogo rai\'ona Kyzylordi\'nskoi\' oblasti\'.\r\n</p>\r\n<p>\r\n	Posle konc\'i\'ny ottsa S\'i\'povski\'h Gennadi\'ya Pavlovi\'c\'a i\' materi\' Ky\'li\'kovoi\' Li\'di\'i\' Ni\'kolaevny v 2004 gody\' byl opredelen v Kyzylordi\'nski\'i\' detski\'i\' dom i\'meni\' Makarenko.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	V tom je gody\' byl y\'synovlen kazahskoi\' semei\' - fermerom My\'ratom Nasyrovym i\' ego sy\'pry\'goi\' Bayan Bi\'maganbetovoi\', kotorye y\'je i\'meli\' pyateryh svoi\'h detei\'). Gennadi\'i\' <span>nazyvaet sebya ry\'sski\'m s kazahskoi\' dy\'s\'oi\'</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<em>\"Ya daje dy\'mayu na kazahskom yazyke, nastolko on stal mne rodnym. Na stantsi\'i\' Saksay\'lskaya, gde ya rodi\'lsya, hodi\'l v kazahski\'i\' sadi\'k i\' kazahsky\'yu s\'koly\'. Vse dry\'zya detstva – kazahi\'. I\' sebya os\'y\'s\'ayu kazahom\",</em> \r\n</p>\r\n– podc\'erki\'val S\'i\'povski\'h.\r\n<p>\r\n	S 24 marta 2016 goda – depy\'tat maji\'li\'sa parlamenta Respy\'bli\'ki\' Kazahstan s\'estogo sozyva, c\'len fraktsi\'i\' «Ny\'r Otan».\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'Depy\'tat Maji\'li\'sa, Gennadi\'i\' S\'i\'povski\'h ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0);
