(195, 'Раскрыты неожиданные детали загадочного исчезновения алматинки', '<p>\r\n	Поиски пропавшей месяц назад жительницы Алматы Ольги Городецкой прекращены волонтерами. Им удалось определить предположительное местонахождение женщины, а также выяснить неожиданные подробности исчезновения, передает <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<img width=\"640\" height=\"318\" alt=\"\" src=\"/public/custom/wysiwyg/image/image/20171030/20171030092715_17776.jpg\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4 октября 28-летняя Ольга Городецкая вышла из ТЦ Mega Park на пересечении улиц Макатаева и Сейфуллина, с тех пор о ней никто ничего не знает.\r\n</p>\r\n<p>\r\n	К поискам матери двух детей были подключены полицейские и волонтеры.\r\n</p>\r\n<p>\r\n	Недавно волонтеры предположили, что женщина могла покинуть территорию страны и отправиться в Россию. Им удалось <a href=\"https://www.nur.kz/1652421-volontery-obnaruzhili-sim-karty-propa.html\"><span>определить местонахождение</span></a>&nbsp;SIM-карт пропавшей. Однако, официальных подтверждений на этот счет нет.\r\n</p>\r\n<p>\r\n	28 октября волонтеры официально заявили о прекращении поисков женщины, опубликовав на странице в <a href=\"https://www.facebook.com/permalink.php?story_fbid=1455857947869039&id=100003345443913\" target=\"_blank\"><span>Facebook</span></a> отчет о проделанной работе. В нем представлены неожиданные подробности.\r\n</p>\r\n<p>\r\n	«<em>В последнем отчете мы остановились на том, что 2 сим карты с личными номерами Ольги, при помощи \" Сим-локатора\" были зафиксированы включенными на территории Российской Федерации. Исходя из этого, поисковой группой С.О.Б. был сделан вывод, что вполне возможно, Ольга Городецкая, может находиться на территории РФ. Но данное предположение, до последних дней, не было достоверным. </em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<strong><em>Однако сегодня, поисковая группа С.О.Б. С 70% точностью, может предположить, где и по какой причине находится Ольга Городецкая.&nbsp;</em><em>Предупреждаем сразу, данный отчет и выводы в нем, строятся на всей добытой информации и подтвержденным фактам.</em></strong> \r\n</p>\r\n<p>\r\n	<em>Относительно недавно в руки поисковой группы С.О.Б. попали записки, сделанные Ольгой Городецкой перед самой пропажей. Там указан ряд номеров, которые напрямую связаны с судебными исполнителями и юристами, фамилии и имена которых мы не имеем право распространять. </em> \r\n</p>\r\n<p>\r\n	<em>Но все эти лица, являются первоклассными экспертами в вопросе по защите от проблем с финансовыми махинациями. И тут выясняется еще один довольно интересный факт, на имя Ольги Городецкой, имеется ряд кредитов в различных банках и на различную сумму денег от 500.000 тенге, до 2.000.000 тенге. </em> \r\n</p>\r\n<p>\r\n	<em>Плюс ко всему, в оставшихся записках, мы обнаружили еще ряд номеров, которые принадлежат конторам, где якобы дают \"Деньги в Долг до Зарплаты\" и где Ольга Городецкая тоже имеет задолженность. Для каких целей и почему так много денег понадобилось Ольге Городецкой, так и остается тайной</em>» - написали волонтеры.\r\n</p>\r\n<p>\r\n	Они также отметили, что большая часть друзей из Facebook Ольги Городецкой проживает в различных городах России. Благодаря администрации Facebook, удалось получить график активности в котором четко указано, кому, когда, во сколько и как часто, писала Ольга Городецкая. И большая часть активной переписки, была направлена на пользователей из России.\r\n</p>\r\n<p>\r\n	«<em>Конечно можно предположить что Ольга Городецкая, взяла большое количество денег в кредит, в различных банках, конторах по займу денег и решив их не возвращать, могла скрыться на территории РФ. Но опять же, разве мать, могла бросить своих двух дочек, которым 3 годика и 5 лет и просто исчезнуть? </em> \r\n</p>\r\n<p>\r\n	<em>И так же нет подтверждения от сотрудников погранконтроля о пересечении границ Республики Казахстан и Российской Федерации. Хотя сотрудниками С.О.Б. был отправлен официальный запрос в погранслужбу РК и РФ (ответа наверняка не будет так как С.О.Б. не является правоохранительным органом).</em> \r\n</p>\r\n<p>\r\n	<em><strong>Так же можно предположить, что Ольга Городецкая была втянута в очень опасную аферу с крупной суммой денег, после чего ей потребовалась помощь частных судебных исполнителей и юристов в решении данной проблемы.</strong> <strong>Если только проблема не оказалась настолько серьезной, что Ольге пришлось податься в бега, вынужденно бросив детей зная, что их заберут под свое крыло родственники или их отец.</strong></em> \r\n</p>\r\n<p>\r\n	<em>Ну и последним предположением может быть то, что Ольга Городецкая, после того как вышла из ТРЦ MegaPark Алматы, села в такси и направилась домой, но по какой-то причине так до дома и не доехала.</em> \r\n</p>\r\n<p>\r\n	<em>«Инициативная группа поиска Совет Общественной Безопасности, приостанавливает поиски Ольги Городецкой, в связи со всеми вышеизложенными обстоятельствами.</em> \r\n</p>\r\n<p>\r\n	<em>За 24 дня поисков, поисковая группа сделала все возможное и невозможное чтобы найти и вернуть Ольгу Городецкую к ее детям, родным и близким</em>», - сообщили волонтеры.\r\n</p>\r\n<p>\r\n	Отмечается, что в полиции дело о пропаже еще не закрыто.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Раскрыты неожиданные детали загадочного исчезновения алматинки', '<p>\r\n	Поиски пропавшей месяц назад жительницы Алматы Ольги Городецкой прекращены волонтерами. Им удалось определить предположительное местонахождение женщины, а также выяснить неожиданные подробности исчезновения, передает <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4 октября 28-летняя Ольга Городецкая вышла из ТЦ Mega Park на пересечении улиц Макатаева и Сейфуллина, с тех пор о ней никто ничего не знает.\r\n</p>\r\n<p>\r\n	К поискам матери двух детей были подключены полицейские и волонтеры.\r\n</p>\r\n<p>\r\n	Недавно волонтеры предположили, что женщина могла покинуть территорию страны и отправиться в Россию. Им удалось <a href=\"https://www.nur.kz/1652421-volontery-obnaruzhili-sim-karty-propa.html\"><span>определить местонахождение</span></a>&nbsp;SIM-карт пропавшей. Однако, официальных подтверждений на этот счет нет.\r\n</p>\r\n<p>\r\n	28 октября волонтеры официально заявили о прекращении поисков женщины, опубликовав на странице в <a href=\"https://www.facebook.com/permalink.php?story_fbid=1455857947869039&id=100003345443913\" target=\"_blank\"><span>Facebook</span></a> отчет о проделанной работе. В нем представлены неожиданные подробности.\r\n</p>\r\n<p>\r\n	«<em>В последнем отчете мы остановились на том, что 2 сим карты с личными номерами Ольги, при помощи \" Сим-локатора\" были зафиксированы включенными на территории Российской Федерации. Исходя из этого, поисковой группой С.О.Б. был сделан вывод, что вполне возможно, Ольга Городецкая, может находиться на территории РФ. Но данное предположение, до последних дней, не было достоверным. </em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<strong><em>Однако сегодня, поисковая группа С.О.Б. С 70% точностью, может предположить, где и по какой причине находится Ольга Городецкая.&nbsp;</em><em>Предупреждаем сразу, данный отчет и выводы в нем, строятся на всей добытой информации и подтвержденным фактам.</em></strong> \r\n</p>\r\n<p>\r\n	<em>Относительно недавно в руки поисковой группы С.О.Б. попали записки, сделанные Ольгой Городецкой перед самой пропажей. Там указан ряд номеров, которые напрямую связаны с судебными исполнителями и юристами, фамилии и имена которых мы не имеем право распространять. </em> \r\n</p>\r\n<p>\r\n	<em>Но все эти лица, являются первоклассными экспертами в вопросе по защите от проблем с финансовыми махинациями. И тут выясняется еще один довольно интересный факт, на имя Ольги Городецкой, имеется ряд кредитов в различных банках и на различную сумму денег от