Сим-локатора\" были зафиксированы включенными на территории Российской Федерации. Исходя из этого, поисковой группой С.О.Б. был сделан вывод, что вполне возможно, Ольга Городецкая, может находиться на территории РФ. Но данное предположение, до последних дней, не было достоверным. </em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<strong><em>Однако сегодня, поисковая группа С.О.Б. С 70% точностью, может предположить, где и по какой причине находится Ольга Городецкая.&nbsp;</em><em>Предупреждаем сразу, данный отчет и выводы в нем, строятся на всей добытой информации и подтвержденным фактам.</em></strong> \r\n</p>\r\n<p>\r\n	<em>Относительно недавно в руки поисковой группы С.О.Б. попали записки, сделанные Ольгой Городецкой перед самой пропажей. Там указан ряд номеров, которые напрямую связаны с судебными исполнителями и юристами, фамилии и имена которых мы не имеем право распространять. </em> \r\n</p>\r\n<p>\r\n	<em>Но все эти лица, являются первоклассными экспертами в вопросе по защите от проблем с финансовыми махинациями. И тут выясняется еще один довольно интересный факт, на имя Ольги Городецкой, имеется ряд кредитов в различных банках и на различную сумму денег от 500.000 тенге, до 2.000.000 тенге. </em> \r\n</p>\r\n<p>\r\n	<em>Плюс ко всему, в оставшихся записках, мы обнаружили еще ряд номеров, которые принадлежат конторам, где якобы дают \"Деньги в Долг до Зарплаты\" и где Ольга Городецкая тоже имеет задолженность. Для каких целей и почему так много денег понадобилось Ольге Городецкой, так и остается тайной</em>» - написали волонтеры.\r\n</p>\r\n<p>\r\n	Они также отметили, что большая часть друзей из Facebook Ольги Городецкой проживает в различных городах России. Благодаря администрации Facebook, удалось получить график активности в котором четко указано, кому, когда, во сколько и как часто, писала Ольга Городецкая. И большая часть активной переписки, была направлена на пользователей из России.\r\n</p>\r\n<p>\r\n	«<em>Конечно можно предположить что Ольга Городецкая, взяла большое количество денег в кредит, в различных банках, конторах по займу денег и решив их не возвращать, могла скрыться на территории РФ. Но опять же, разве мать, могла бросить своих двух дочек, которым 3 годика и 5 лет и просто исчезнуть? </em> \r\n</p>\r\n<p>\r\n	<em>И так же нет подтверждения от сотрудников погранконтроля о пересечении границ Республики Казахстан и Российской Федерации. Хотя сотрудниками С.О.Б. был отправлен официальный запрос в погранслужбу РК и РФ (ответа наверняка не будет так как С.О.Б. не является правоохранительным органом).</em> \r\n</p>\r\n<p>\r\n	<em><strong>Так же можно предположить, что Ольга Городецкая была втянута в очень опасную аферу с крупной суммой денег, после чего ей потребовалась помощь частных судебных исполнителей и юристов в решении данной проблемы.</strong> <strong>Если только проблема не оказалась настолько серьезной, что Ольге пришлось податься в бега, вынужденно бросив детей зная, что их заберут под свое крыло родственники или их отец.</strong></em> \r\n</p>\r\n<p>\r\n	<em>Ну и последним предположением может быть то, что Ольга Городецкая, после того как вышла из ТРЦ MegaPark Алматы, села в такси и направилась домой, но по какой-то причине так до дома и не доехала.</em> \r\n</p>\r\n<p>\r\n	<em>«Инициативная группа поиска Совет Общественной Безопасности, приостанавливает поиски Ольги Городецкой, в связи со всеми вышеизложенными обстоятельствами.</em> \r\n</p>\r\n<p>\r\n	<em>За 24 дня поисков, поисковая группа сделала все возможное и невозможное чтобы найти и вернуть Ольгу Городецкую к ее детям, родным и близким</em>», - сообщили волонтеры.\r\n</p>\r\n<p>\r\n	Отмечается, что в полиции дело о пропаже еще не закрыто.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 09:19:00', '/media/2017/10/30/pogudx2cenof4anpsg.d9aeaab1.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 09:23:04', '2017-11-29 19:47:21', NULL, 'Новости Алматы, Волонтеры, Пропавшая Женщина ', 35, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Новости Алматы, Волонтеры, Пропавшая Женщина ', 'Новости Алматы, Волонтеры, Пропавшая Женщина ', 'Администратор', 'Администратор', 'Администратор', '0', 'Raskryty neoji\'dannye detali\' zagadoc\'nogo i\'sc\'eznoveni\'ya almati\'nki\'', '<p>\r\n	Poi\'ski\' propavs\'ei\' mesyats nazad ji\'telni\'tsy Almaty Olgi\' Gorodetskoi\' prekras\'eny volonterami\'. I\'m y\'dalos opredeli\'t predpoloji\'telnoe mestonahojdeni\'e jens\'i\'ny, a takje vyyasni\'t neoji\'dannye podrobnosti\' i\'sc\'eznoveni\'ya, peredaet <a href=\"http://nur.kz/\" target=\"_blank\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	4 oktyabrya 28-letnyaya Olga Gorodetskaya vys\'la i\'z TTs Mega Park na peresec\'eni\'i\' y\'li\'ts Makataeva i\' Sei\'fy\'lli\'na, s teh por o nei\' ni\'kto ni\'c\'ego ne znaet.\r\n</p>\r\n<p>\r\n	K poi\'skam materi\' dvy\'h detei\' byli\' podklyuc\'eny poli\'tsei\'ski\'e i\' volontery.\r\n</p>\r\n<p>\r\n	Nedavno volontery predpoloji\'li\', c\'to jens\'i\'na mogla poki\'ny\'t terri\'tori\'yu strany i\' otpravi\'tsya v Rossi\'yu. I\'m y\'dalos <a href=\"https://www.nur.kz/1652421-volontery-obnaruzhili-sim-karty-propa.html\"><span>opredeli\'t mestonahojdeni\'e</span></a>&nbsp;SIM-kart propavs\'ei\'. Odnako, ofi\'tsi\'alnyh podtverjdeni\'i\' na etot sc\'et net.\r\n</p>\r\n<p>\r\n	28 oktyabrya volontery ofi\'tsi\'alno zayavi\'li\' o prekras\'eni\'i\' poi\'skov jens\'i\'ny, opy\'bli\'kovav na strani\'tse v <a href=\"https://www.facebook.com/permalink.php?story_fbid=1455857947869039&id=100003345443913\" target=\"_blank\"><span>Facebook</span></a> otc\'et o prodelannoi\' rabote. V nem predstavleny neoji\'dannye podrobnosti\'.\r\n</p>\r\n<p>\r\n	«<em>V poslednem otc\'ete my ostanovi\'li\'s na tom, c\'to 2 si\'m karty s li\'c\'nymi\' nomerami\' Olgi\', pri\' pomos\'i\' \" Si\'m-lokatora\" byli\' zafi\'ksi\'rovany vklyuc\'ennymi\' na terri\'tori\'i\' Rossi\'i\'skoi\' Federatsi\'i\'. I\'shodya i\'z etogo, poi\'skovoi\' gry\'ppoi\' S.O.B. byl sdelan vyvod, c\'to vpolne vozmojno, Olga Gorodetskaya, mojet nahodi\'tsya na terri\'tori\'i\' RF. No dannoe predpolojeni\'e, do posledni\'h dnei\', ne bylo dostovernym. </em> \r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<strong><em>Odnako segodnya, poi\'skovaya gry\'ppa S.O.B. S 70% toc\'nostyu, mojet predpoloji\'t, gde i\' po kakoi\' pri\'c\'i\'ne nahodi\'tsya Olga Gorodetskaya.&nbsp;</em><em>Predy\'prejdaem srazy\', dannyi\' otc\'et i\' vyvody v nem, stroyatsya na vsei\' dobytoi\' i\'nformatsi\'i\' i\' podtverjdennym faktam.</em></strong> \r\n</p>\r\n<p>\r\n	<em>Otnosi\'telno nedavno v ry\'ki\' poi\'skovoi\' gry\'ppy S.O.B. popali\' zapi\'ski\', sdelannye Olgoi\' Gorodetskoi\' pered samoi\' propajei\'. Tam y\'kazan ryad nomerov, kotorye napryamy\'yu svyazany s sy\'debnymi\' i\'spolni\'telyami\' i\' yuri\'stami\', fami\'li\'i\' i\' i\'mena kotoryh my ne i\'meem pravo rasprostranyat. </em> \r\n</p>\r\n<p>\r\n	<em>No vse eti\' li\'tsa, yavlyayutsya pervoklassnymi\' ekspertami\' v voprose po zas\'i\'te ot problem s fi\'nansovymi\' mahi\'natsi\'yami\'. I\' ty\'t vyyasnyaetsya es\'e odi\'n dovolno i\'nteresnyi\' fakt, na i\'mya Olgi\' Gorodetskoi\', i\'meetsya ryad kredi\'tov v razli\'c\'nyh bankah i\' na razli\'c\'ny\'yu sy\'mmy\' deneg ot 500.000 tenge, do 2.000.000 tenge. </em> \r\n</p>\r\n<p>\r\n	<em>Plyus ko vsemy\', v ostavs\'i\'hsya zapi\'skah, my obnary\'ji\'li\' es\'e ryad nomerov, kotorye pri\'nadlejat kontoram, gde yakoby dayut \"Dengi\' v Dolg do Zarplaty\" i\' gde Olga Gorodetskaya toje i\'meet zadoljennost. Dlya kaki\'h tselei\' i\' poc\'emy\' tak mnogo deneg ponadobi\'los Olge Gorodetskoi\', tak i\' ostaetsya tai\'noi\'</em>» - napi\'sali\' volontery.\r\n</p>\r\n<p>\r\n	Oni\' takje otmeti\'li\', c\'to bols\'aya c\'ast dry\'zei\' i\'z Facebook Olgi\' Gorodetskoi\' proji\'vaet v razli\'c\'nyh gorodah Rossi\'i\'. Blagodarya admi\'ni\'stratsi\'i\' Facebook, y\'dalos poly\'c\'i\'t grafi\'k akti\'vnosti\' v kotorom c\'etko y\'kazano, komy\', kogda, vo skolko i\' kak c\'asto, pi\'sala Olga Gorodetskaya. I\' bols\'aya c\'ast akti\'vnoi\' perepi\'ski\', byla napravlena na polzovatelei\' i\'z Rossi\'i\'.\r\n</p>\r\n<p>\r\n	«<em>Konec\'no mojno predpoloji\'t c\'to Olga Gorodetskaya, vzyala bols\'oe koli\'c\'estvo deneg v kredi\'t, v razli\'c\'nyh bankah, kontorah po zai\'my\' deneg i\' res\'i\'v i\'h ne vozvras\'at, mogla skrytsya na terri\'tori\'i\' RF. No opyat je, razve mat, mogla brosi\'t svoi\'h dvy\'h doc\'ek, kotorym 3 godi\'ka i\' 5 let i\' prosto i\'sc\'ezny\'t? </em> \r\n</p>\r\n<p>\r\n	<em>I\' tak je net podtverjdeni\'ya ot sotry\'dni\'kov pogrankontrolya o peresec\'eni\'i\' grani\'ts Respy\'bli\'ki\' Kazahstan i\' Rossi\'i\'skoi\' Federatsi\'i\'. Hotya sotry\'dni\'kami\' S.O.B. byl otpravlen ofi\'tsi\'alnyi\' zapros v pogransly\'jby\' RK i\' RF (otveta navernyaka ne by\'det tak kak S.O.B. ne yavlyaetsya pravoohrani\'telnym organom).</em> \r\n</p>\r\n<p>\r\n	<em><strong>Tak je mojno predpoloji\'t, c\'to Olga Gorodetskaya byla vtyany\'ta v oc\'en opasny\'yu afery\' s kry\'pnoi\' sy\'mmoi\' deneg, posle c\'ego ei\' potrebovalas pomos\' c\'astnyh sy\'debnyh i\'spolni\'telei\' i\' yuri\'stov v res\'eni\'i\' dannoi\' problemy.</strong> <strong>Esli\' tolko problema ne okazalas nastolko sereznoi\', c\'to Olge pri\'s\'los podatsya v bega, vyny\'jdenno brosi\'v detei\' znaya, c\'to i\'h zabery\'t pod svoe krylo rodstvenni\'ki\' i\'li\' i\'h otets.</strong></em> \r\n</p>\r\n<p>\r\n	<em>Ny\' i\' posledni\'m predpolojeni\'em mojet byt to, c\'to Olga Gorodetskaya, posle togo kak vys\'la i\'z TRTs MegaPark Almaty, sela v taksi\' i\' napravi\'las domoi\', no po kakoi\'-to pri\'c\'i\'ne tak do doma i\' ne doehala.</em> \r\n</p>\r\n<p>\r\n	<em>«I\'ni\'tsi\'ati\'vnaya gry\'ppa poi\'ska Sovet Obs\'estvennoi\' Bezopasnosti\', pri\'ostanavli\'vaet poi\'ski\' Olgi\' Gorodetskoi\', v svyazi\' so vsemi\' vys\'ei\'zlojennymi\' obstoyatelstvami\'.</em> \r\n</p>\r\n<p>\r\n	<em>Za 24 dnya poi\'skov, poi\'skovaya gry\'ppa sdelala vse vozmojnoe i\' nevozmojnoe c\'toby nai\'ti\' i\' verny\'t Olgy\' Gorodetsky\'yu k ee detyam, rodnym i\' bli\'zki\'m</em>», - soobs\'i\'li\' volontery.\r\n</p>\r\n<p>\r\n	Otmec\'aetsya, c\'to v poli\'tsi\'i\' delo o propaje es\'e ne zakryto.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'Novosti\' Almaty, Volontery, Propavs\'aya Jens\'i\'na ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0),
(196, 'Светлаков: Я приехал в Астану купить квартиру после ЭКСПО (видео)', '<p>\r\n	Сергей Светлаков прилетел в Астану на день рождения своего ресторана в столице. Астанчанам он рассказал, что прибыл за день до праздника, чтобы купить дешевую квартиру после ЭКСПО, пишет <a href=\"http://nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<img width=\"640\" height=\"334\" alt=\"\" src=\"/public/custom/wysiwyg/image/image/20171030/20171030092743_78453.jpg\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	«<em>Я специально приехал на день пораньше – хотел успеть купить после ЭКСПО квартиру. Как я знаю, цены хорошо припали. Ты взял себе, Саш, квартиру? Они с трещинами, но очень дешевые</em>», - пошутил Светлаков.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em>Две квартиры купил. За них еще сверху приплачивают</em>», - ответил ресторатор Александр Орлов.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<iframe src=\"http://videos.nur.kz/embed=e28vd9pz\" style=\"width:640;height:360;\">\r\n</iframe>\r\n<p>\r\n	Шоумен вспомнил и про аврал, который <span>царил в Астане за несколько дней до ЭКСПО</span>.\r\n</p>\r\n<p>\r\n	«<em>Я помню, утром прилетел – раздолбанный аэропорт прям вообще в хлам. Вечером улетаю – асфальт лежит. И деревья уже! Не просто деревья, а с гнездами. Как это в течение дня? Это астанинское чудо какое-то</em>», - говорит бывший КВН-щик.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	К слову, специально ко дню рождения&nbsp;в ресторан артиста принесли крокодила - <span>животному крепко замотали пасть</span>, чтобы гости могли делать с ним \"веселые\" фотографии.\r\n</p>\r\n<p>\r\n	В этот вечер астанчан также шокировали цены в ресторане Светлакова - в его меню был очень дорогой алкоголь. К примеру, <span>коньяк за 2 млн тенге за бутылку</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Светлаков: Я приехал в Астану купить дешевую квартиру после ЭКСПО (видео)', '<p>\r\n	Сергей Светлаков прилетел в Астану на день рождения своего ресторана в столице. Астанчанам он рассказал, что прибыл за день до праздника, чтобы купить дешевую квартиру после ЭКСПО, пишет <a href=\"http://nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	«<em>Я специально приехал на день пораньше – хотел успеть купить после ЭКСПО квартиру. Как я знаю, цены хорошо припали. Ты взял себе, Саш, квартиру? Они с трещинами, но очень дешевые</em>», - пошутил Светлаков.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em>Две квартиры купил. За них еще сверху приплачивают</em>», - ответил ресторатор Александр Орлов.\r\n</p>\r\n<p>\r\n	Шоумен вспомнил и про аврал, который <span>царил в Астане за несколько дней до ЭКСПО</span>.\r\n</p>\r\n<p>\r\n	«<em>Я помню, утром прилетел – раздолбанный аэропорт прям вообще в хлам. Вечером улетаю – асфальт лежит. И деревья уже! Не просто деревья, а с гнездами. Как это в течение дня? Это астанинское чудо какое-то</em>», - говорит бывший КВН-щик.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	К слову, специально ко дню рождения&nbsp;в ресторан артиста принесли крокодила - <span>животному крепко замотали пасть</span>, чтобы гости могли делать с ним \"веселые\" фотографии.\r\n</p>\r\n<p>\r\n	В этот вечер астанчан также шокировали цены в ресторане Светлакова - в его меню был очень дорогой алкоголь. К примеру, <span>коньяк за 2 млн тенге за бутылку</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Светлаков: Я приехал в Астану купить дешевую квартиру после ЭКСПО (видео)', '<p>\r\n	Сергей Светлаков прилетел в Астану на день рождения своего ресторана в столице. Астанчанам он рассказал, что прибыл за день до праздника, чтобы купить дешевую квартиру после ЭКСПО, пишет <a href=\"http://nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	«<em>Я специально приехал на день пораньше – хотел успеть купить после ЭКСПО квартиру. Как я знаю, цены хорошо припали. Ты взял себе, Саш, квартиру? Они с трещинами, но очень дешевые</em>», - пошутил Светлаков.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em>Две квартиры купил. За них еще сверху приплачивают</em>», - ответил ресторатор Александр Орлов.\r\n</p>\r\n<p>\r\n	Шоумен вспомнил и про аврал, который <span>царил в Астане за несколько дней до ЭКСПО</span>.\r\n</p>\r\n<p>\r\n	«<em>Я помню, утром прилетел – раздолбанный аэропорт прям вообще в хлам. Вечером улетаю – асфальт лежит. И деревья уже! Не просто деревья, а с гнездами. Как это в течение дня? Это астанинское чудо какое-то</em>», - говорит бывший КВН-щик.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	К слову, специально ко дню рождения&nbsp;в ресторан артиста принесли крокодила - <span>животному крепко замотали пасть</span>, чтобы гости могли делать с ним \"веселые\" фотографии.\r\n</p>\r\n<p>\r\n	В этот вечер астанчан также шокировали цены в ресторане Светлакова - в его меню был очень дорогой алкоголь. К примеру, <span>коньяк за 2 млн тенге за бутылку</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 09:24:00', '/media/2017/10/30/pogudx68q9djsussa.f34539c9.jpg', 1, '2', '1', NULL, NULL, NULL, '2017-10-30 09:26:56', '2017-11-29 08:44:42', NULL, 'Новости Астаны, Сергей Светлаков ', 63, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Новости Астаны, Сергей Светлаков ', 'Новости Астаны, Сергей Светлаков ', 'Администратор', 'Администратор', 'Администратор', '0', 'Svetlakov: Ya pri\'ehal v Astany\' ky\'pi\'t des\'evy\'yu kvarti\'ry\' posle EKSPO (vi\'deo)', '<p>\r\n	Sergei\' Svetlakov pri\'letel v Astany\' na den rojdeni\'ya svoego restorana v stoli\'tse. Astanc\'anam on rasskazal, c\'to pri\'byl za den do prazdni\'ka, c\'toby ky\'pi\'t des\'evy\'yu kvarti\'ry\' posle EKSPO, pi\'s\'et <a href=\"http://nur.kz/\"><span>NUR.KZ</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	«<em>Ya spetsi\'alno pri\'ehal na den porans\'e – hotel y\'spet ky\'pi\'t posle EKSPO kvarti\'ry\'. Kak ya znayu, tseny horos\'o pri\'pali\'. Ty vzyal sebe, Sas\', kvarti\'ry\'? Oni\' s tres\'i\'nami\', no oc\'en des\'evye</em>», - pos\'y\'ti\'l Svetlakov.\r\n</p>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em>Dve kvarti\'ry ky\'pi\'l. Za ni\'h es\'e sverhy\' pri\'plac\'i\'vayut</em>», - otveti\'l restorator Aleksandr Orlov.\r\n</p>\r\n<p>\r\n	S\'oy\'men vspomni\'l i\' pro avral, kotoryi\' <span>tsari\'l v Astane za neskolko dnei\' do EKSPO</span>.\r\n</p>\r\n<p>\r\n	«<em>Ya pomnyu, y\'trom pri\'letel – razdolbannyi\' aeroport pryam voobs\'e v hlam. Vec\'erom y\'letayu – asfalt leji\'t. I\' derevya y\'je! Ne prosto derevya, a s gnezdami\'. Kak eto v tec\'eni\'e dnya? Eto astani\'nskoe c\'y\'do kakoe-to</em>», - govori\'t byvs\'i\'i\' KVN-s\'i\'k.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	K slovy\', spetsi\'alno ko dnyu rojdeni\'ya&nbsp;v restoran arti\'sta pri\'nesli\' krokodi\'la - <span>ji\'votnomy\' krepko zamotali\' past</span>, c\'toby gosti\' mogli\' delat s ni\'m \"veselye\" fotografi\'i\'.\r\n</p>\r\n<p>\r\n	V etot vec\'er astanc\'an takje s\'oki\'rovali\' tseny v restorane Svetlakova - v ego menyu byl oc\'en dorogoi\' alkogol. K pri\'mery\', <span>konyak za 2 mln tenge za by\'tylky\'</span>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'Novosti\' Astany, Sergei\' Svetlakov ', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0),
(197, 'СМИ: Гульнара Каримова на днях предстанет перед судом', '<p>\r\n	Суд над \"узбекской принцессой\" Гульнарой Каримовой намечен на ближайшие дни в Ташкенте, сообщает <a href=\"https://rus.ozodlik.org/a/28820168.html\" target=\"_blank\"><span>«Радио&nbsp;Озодлик»</span></a>.\r\n</p>\r\n<p>\r\n	<img width=\"640\" height=\"384\" alt=\"\" src=\"http://taima.bugingroup.kz/public/custom/wysiwyg/image/image/20171030/20171030100946_20111.jpg\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Швейцарские следователи планировали прилететь в Узбекистан на следующей неделе, чтобы встретиться&nbsp;с фигурантами дела о коррупции в особо крупном размере и отмывании денег, в частности, лично пообщаться с Гульнарой Каримовой.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	Однако, как сообщил швейцарский чиновник, имеющий непосредственное отношение к данному процессу, визит отложен на неопределенное время.\r\n</p>\r\n<p>\r\n	<strong>В ответе узбекской стороны говорится о том, что в ближайшие дни в Ташкенте намечено судебное заседание по делу Гульнары Каримовой и поэтому швейцарским следователям не удастся с ней встретиться.</strong> \r\n</p>\r\n<p>\r\n	Другие подробности в письме не приводятся. В каком суде будет рассматриваться дело Каримовой, и где она сейчас содержится – об этом в письме ничего не сказано.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'СМИ: Гульнара Каримова на днях предстанет перед судом', '<p>\r\n	Суд над \"узбекской принцессой\" Гульнарой Каримовой намечен на ближайшие дни в Ташкенте, сообщает <a href=\"https://rus.ozodlik.org/a/28820168.html\" target=\"_blank\"><span>«Радио&nbsp;Озодлик»</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Швейцарские следователи планировали прилететь в Узбекистан на следующей неделе, чтобы встретиться&nbsp;с фигурантами дела о коррупции в особо крупном размере и отмывании денег, в частности, лично пообщаться с Гульнарой Каримовой.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	Однако, как сообщил швейцарский чиновник, имеющий непосредственное отношение к данному процессу, визит отложен на неопределенное время.\r\n</p>\r\n<p>\r\n	<strong>В ответе узбекской стороны говорится о том, что в ближайшие дни в Ташкенте намечено судебное заседание по делу Гульнары Каримовой и поэтому швейцарским следователям не удастся с ней встретиться.</strong> \r\n</p>\r\n<p>\r\n	Другие подробности в письме не приводятся. В каком суде будет рассматриваться дело Каримовой, и где она сейчас содержится – об этом в письме ничего не сказано.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'СМИ: Гульнара Каримова на днях предстанет перед судом', '<p>\r\n	Суд над \"узбекской принцессой\" Гульнарой Каримовой намечен на ближайшие дни в Ташкенте, сообщает <a href=\"https://rus.ozodlik.org/a/28820168.html\" target=\"_blank\"><span>«Радио&nbsp;Озодлик»</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	Швейцарские следователи планировали прилететь в Узбекистан на следующей неделе, чтобы встретиться&nbsp;с фигурантами дела о коррупции в особо крупном размере и отмывании денег, в частности, лично пообщаться с Гульнарой Каримовой.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	Однако, как сообщил швейцарский чиновник, имеющий непосредственное отношение к данному процессу, визит отложен на неопределенное время.\r\n</p>\r\n<p>\r\n	<strong>В ответе узбекской стороны говорится о том, что в ближайшие дни в Ташкенте намечено судебное заседание по делу Гульнары Каримовой и поэтому швейцарским следователям не удастся с ней встретиться.</strong> \r\n</p>\r\n<p>\r\n	Другие подробности в письме не приводятся. В каком суде будет рассматриваться дело Каримовой, и где она сейчас содержится – об этом в письме ничего не сказано.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 09:47:00', '/media/2017/10/30/pogudx222i43mjb6b.5c4887e2.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 09:49:37', '2017-11-29 17:17:16', NULL, '', 48, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', '', '', 'Администратор', 'Администратор', 'Администратор', '0', 'SMI\': Gy\'lnara Kari\'mova na dnyah predstanet pered sy\'dom', '<p>\r\n	Sy\'d nad \"y\'zbekskoi\' pri\'ntsessoi\'\" Gy\'lnaroi\' Kari\'movoi\' namec\'en na bli\'jai\'s\'i\'e dni\' v Tas\'kente, soobs\'aet <a href=\"https://rus.ozodlik.org/a/28820168.html\" target=\"_blank\"><span>«Radi\'o&nbsp;Ozodli\'k»</span></a>.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	S\'vei\'tsarski\'e sledovateli\' plani\'rovali\' pri\'letet v Y\'zbeki\'stan na sledy\'yus\'ei\' nedele, c\'toby vstreti\'tsya&nbsp;s fi\'gy\'rantami\' dela o korry\'ptsi\'i\' v osobo kry\'pnom razmere i\' otmyvani\'i\' deneg, v c\'astnosti\', li\'c\'no poobs\'atsya s Gy\'lnaroi\' Kari\'movoi\'.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	Odnako, kak soobs\'i\'l s\'vei\'tsarski\'i\' c\'i\'novni\'k, i\'meyus\'i\'i\' neposredstvennoe otnos\'eni\'e k dannomy\' protsessy\', vi\'zi\'t otlojen na neopredelennoe vremya.\r\n</p>\r\n<p>\r\n	<strong>V otvete y\'zbekskoi\' storony govori\'tsya o tom, c\'to v bli\'jai\'s\'i\'e dni\' v Tas\'kente namec\'eno sy\'debnoe zasedani\'e po dely\' Gy\'lnary Kari\'movoi\' i\' poetomy\' s\'vei\'tsarski\'m sledovatelyam ne y\'dastsya s nei\' vstreti\'tsya.</strong> \r\n</p>\r\n<p>\r\n	Dry\'gi\'e podrobnosti\' v pi\'sme ne pri\'vodyatsya. V kakom sy\'de by\'det rassmatri\'vatsya delo Kari\'movoi\', i\' gde ona sei\'c\'as soderji\'tsya – ob etom v pi\'sme ni\'c\'ego ne skazano.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', '', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0);
