(198, 'Привычки казахстанцев: три с половиной часа перед телевизором ежедневно', '<p class=\"h2\">\r\n	<span style=\"font-size:12px;\">Несмотря на не так давно приобретенную привычку сидеть в соцсетях, обсуждая насущные вопросы бытия, казахстанцы хранят верность телевидению, так что телевизор – в широком смысле: и как lcd-панель, и как экран планшета – никуда из наших домов и досуга исчезать не собирается.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Не гурманы и не спортсмены мы</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Этот вывод можно сделать из данных проекта MMI компании TNS Central Asia, ежегодно проводящей замеры, влияющие на значения медиамаркетинговых индексов, которые отражают потребительское поведение и медиапредпочтения казахстанцев. В 2016 году граждане в среднем ежедневно проводили перед телевизором на 13 минут больше, чем в 2015 (213 минут против 200). Стоит отметить, что в 2014 году это время составляло 208 минут.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"800\" height=\"365\" class=\"a__center size-large wp-image-1653281\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx5lesh808ckf.f4b5c718.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Любопытно, что за три года временной показатель потребления интернета почти никак не изменился: в среднем, чуть более двух с половиной часов в сутки.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"769\" height=\"600\" class=\"a__center size-large wp-image-1653280\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx23pc4sagl33g.54b70b51.jpg\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">По мнению </span><b><span style=\"font-size:12px;\">Олега Бородулина</span></b><span style=\"font-size:12px;\">, заместителя директора TV MEDIA Advertising Agency и одного из ведущих экспертов в области медиа, ТВ как медийный ресурс по-прежнему актуален.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">И результаты различных исследований, как казахстанских, так и международных, подтверждают это. Более того, в периоды экономического спада уровень телесмотрения возрастает за счет сокращения времени на активный досуг «за пределами дома» - спорт, прогулки, подвижные игры, посещение кафе и ресторанов. Верно также и обратное: чем больше времени мы отдыхаем вне дома, тем ниже телесмотрение.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">По наблюдениям эксперта, уклад жизни в наших мегаполисах все же не такой, как в регионах, где проживает значительная – чуть более восьмидесяти процентов – часть казахстанцев: «Подобные контексты характерны, наверное, для всех стран и, говоря о предпочтениях граждан в плане досуга, необходимо учитывать поведенческие различия».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Резюмируя, Олег отмечает, что «по сути, исследование MMI говорит нам о том, что потребление ТВ никаким образом не связано с потреблением других медиаканалов. Ну и нам как участникам рекламного рынка важно, что телевизор был и остается самым эффективным способом максимального достижения контактов с аудиторией».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"601\" height=\"600\" class=\"a__center size-full wp-image-1653284\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudxll9a48ujk8o.d5294801.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Татьяна Старцева</span></b><span style=\"font-size:12px;\">, генеральный директор упомянутой исследовательской компании TNS Central Asia, выводы которой учитывает весь казахстанский медиарынок, описывает телепросмотр как «характерный атрибут спокойного домашнего времяпрепровождения». Объемы просмотра ТВ, считает Татьяна, подвержены незначительным колебаниям: «Я бы хотела обратить внимание на положительную корреляцию телесмотрения со спокойным отдыхом, в том числе, посвященным уходу за собой и общению с друзьями. (В 2014 - 2016 гг., казахстанцы, в среднем, за «спокойным отдыхом дома» проводили около 222 минут ежедневно. – Прим. авт.). Просмотр телепередач снижается, когда мы начинаем больше времени проводить вне дома, например, ездить куда-то, развлекаться с детьми».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">«Если говорить об интернете, - продолжает эксперт, - то очевидно, что при росте ежедневного охвата, на всем промежутке исследования среднесуточное время, которое проводят в сети пользователи, практически не подвергается колебаниям. Интернет в большей степени является атрибутом активного времяпрепровождения: им пользуются не только дома, но и на улице, в общественных местах. Заметна зависимость интернетизации от повышения интереса к общению по мобильным средствам связи, ростом посещаемости культурно-зрелищных мероприятий, которые традиционно рекламируются через сеть».</span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">И никакой бумаги</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Исследования TNS Central Asia подтверждают ощущение, что люди стали меньше читать газет и журналов в их привычном – бумажном - виде.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<u><img width=\"800\" height=\"466\" class=\"a__center size-large wp-image-1653282\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx75f2o1c2qr5.6bd13746.jpg\" /></u> \r\n	</div>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Выбор большинства - использовать интернет через смартфоны эксперты объясняют тем, что в Казахстане активно развился именно мобильный интернет, в отличие, скажем, от России, которая стремится опутать себя оптоволоконными сетями. В РФ, по информации ресурса «Эксперт-Казахстан», темпы роста сетей FTTH (fiber to the home – оптическое волокно до дома) выше, чем во всех странах Европы вместе взятых.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"782\" height=\"509\" class=\"a__center size-full wp-image-1653283\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx1a20v4i2g1o.9deb6dc2.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Из иллюстрации понятно, что именно молодежь от 15 до 24 лет – основные потребители интернета. Одновременно радует тенденция повышения возраста пользователей сети. Можно сказать, казахстанцы активно осваивают возможности интернета, но не в ущерб традиционной привычке смотреть ТВ.</span> \r\n</p>\r\n<div id=\"videoadv\">\r\n</div>\r\n<div class=\"revive-holder revive-holder--article cf\">\r\n	<div class=\"revive-zone revive-id-4\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-7\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-19\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-20\">\r\n	</div>\r\n</div>\r\n<div id=\"parimatch-place\">\r\n</div>\r\n<div class=\"ima__container\">\r\n	<a class=\"ima__close adv__close\" href=\"https://finance.nur.kz/1653276-privychki-kazakhstancev-tri-s-polovino.html#\"></a> \r\n	<div class=\"ima__holder\">\r\n	</div>\r\n</div>\r\n<div class=\"source\">\r\n	<span style=\"font-size:12px;\">Источник: </span><a class=\"source__link\" href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\"><span style=\"font-size:12px;\">Nur.kz</span></span></a> \r\n</div>', 'Привычки казахстанцев: три с поло