span><b><span style=\"font-size:12px;\">Олега Бородулина</span></b><span style=\"font-size:12px;\">, заместителя директора TV MEDIA Advertising Agency и одного из ведущих экспертов в области медиа, ТВ как медийный ресурс по-прежнему актуален.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">И результаты различных исследований, как казахстанских, так и международных, подтверждают это. Более того, в периоды экономического спада уровень телесмотрения возрастает за счет сокращения времени на активный досуг «за пределами дома» - спорт, прогулки, подвижные игры, посещение кафе и ресторанов. Верно также и обратное: чем больше времени мы отдыхаем вне дома, тем ниже телесмотрение.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">По наблюдениям эксперта, уклад жизни в наших мегаполисах все же не такой, как в регионах, где проживает значительная – чуть более восьмидесяти процентов – часть казахстанцев: «Подобные контексты характерны, наверное, для всех стран и, говоря о предпочтениях граждан в плане досуга, необходимо учитывать поведенческие различия».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Резюмируя, Олег отмечает, что «по сути, исследование MMI говорит нам о том, что потребление ТВ никаким образом не связано с потреблением других медиаканалов. Ну и нам как участникам рекламного рынка важно, что телевизор был и остается самым эффективным способом максимального достижения контактов с аудиторией».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"601\" height=\"600\" class=\"a__center size-full wp-image-1653284\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudxll9a48ujk8o.d5294801.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Татьяна Старцева</span></b><span style=\"font-size:12px;\">, генеральный директор упомянутой исследовательской компании TNS Central Asia, выводы которой учитывает весь казахстанский медиарынок, описывает телепросмотр как «характерный атрибут спокойного домашнего времяпрепровождения». Объемы просмотра ТВ, считает Татьяна, подвержены незначительным колебаниям: «Я бы хотела обратить внимание на положительную корреляцию телесмотрения со спокойным отдыхом, в том числе, посвященным уходу за собой и общению с друзьями. (В 2014 - 2016 гг., казахстанцы, в среднем, за «спокойным отдыхом дома» проводили около 222 минут ежедневно. – Прим. авт.). Просмотр телепередач снижается, когда мы начинаем больше времени проводить вне дома, например, ездить куда-то, развлекаться с детьми».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">«Если говорить об интернете, - продолжает эксперт, - то очевидно, что при росте ежедневного охвата, на всем промежутке исследования среднесуточное время, которое проводят в сети пользователи, практически не подвергается колебаниям. Интернет в большей степени является атрибутом активного времяпрепровождения: им пользуются не только дома, но и на улице, в общественных местах. Заметна зависимость интернетизации от повышения интереса к общению по мобильным средствам связи, ростом посещаемости культурно-зрелищных мероприятий, которые традиционно рекламируются через сеть».</span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">И никакой бумаги</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Исследования TNS Central Asia подтверждают ощущение, что люди стали меньше читать газет и журналов в их привычном – бумажном - виде.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<u><img width=\"800\" height=\"466\" class=\"a__center size-large wp-image-1653282\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx75f2o1c2qr5.6bd13746.jpg\" /></u> \r\n	</div>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Выбор большинства - использовать интернет через смартфоны эксперты объясняют тем, что в Казахстане активно развился именно мобильный интернет, в отличие, скажем, от России, которая стремится опутать себя оптоволоконными сетями. В РФ, по информации ресурса «Эксперт-Казахстан», темпы роста сетей FTTH (fiber to the home – оптическое волокно до дома) выше, чем во всех странах Европы вместе взятых.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"782\" height=\"509\" class=\"a__center size-full wp-image-1653283\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx1a20v4i2g1o.9deb6dc2.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Из иллюстрации понятно, что именно молодежь от 15 до 24 лет – основные потребители интернета. Одновременно радует тенденция повышения возраста пользователей сети. Можно сказать, казахстанцы активно осваивают возможности интернета, но не в ущерб традиционной привычке смотреть ТВ.</span> \r\n</p>\r\n<div id=\"videoadv\">\r\n</div>\r\n<div class=\"revive-holder revive-holder--article cf\">\r\n	<div class=\"revive-zone revive-id-4\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-7\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-19\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-20\">\r\n	</div>\r\n</div>\r\n<div id=\"parimatch-place\">\r\n</div>\r\n<div class=\"ima__container\">\r\n	<a class=\"ima__close adv__close\" href=\"https://finance.nur.kz/1653276-privychki-kazakhstancev-tri-s-polovino.html#\"></a> \r\n	<div class=\"ima__holder\">\r\n	</div>\r\n</div>\r\n<div class=\"source\">\r\n	<span style=\"font-size:12px;\">Источник: </span><a class=\"source__link\" href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\"><span style=\"font-size:12px;\">Nur.kz</span></span></a> \r\n</div>', 'Привычки казахстанцев: три с половиной часа перед телевизором ежедневно', '<p class=\"h2\">\r\n	<span style=\"font-size:12px;\">Несмотря на не так давно приобретенную привычку сидеть в соцсетях, обсуждая насущные вопросы бытия, казахстанцы хранят верность телевидению, так что телевизор – в широком смысле: и как lcd-панель, и как экран планшета – никуда из наших домов и досуга исчезать не собирается.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Не гурманы и не спортсмены мы</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Этот вывод можно сделать из данных проекта MMI компании TNS Central Asia, ежегодно проводящей замеры, влияющие на значения медиамаркетинговых индексов, которые отражают потребительское поведение и медиапредпочтения казахстанцев. В 2016 году граждане в среднем ежедневно проводили перед телевизором на 13 минут больше, чем в 2015 (213 минут против 200). Стоит отметить, что в 2014 году это время составляло 208 минут.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"800\" height=\"365\" class=\"a__center size-large wp-image-1653281\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx5lesh808ckf.f4b5c718.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Любопытно, что за три года временной показатель потребления интернета почти никак не изменился: в среднем, чуть более двух с половиной часов в сутки.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"769\" height=\"600\" class=\"a__center size-large wp-image-1653280\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx23pc4sagl33g.54b70b51.jpg\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">По мнению </span><b><span style=\"font-size:12px;\">Олега Бородулина</span></b><span style=\"font-size:12px;\">, заместителя директора TV MEDIA Advertising Agency и одного из ведущих экспертов в области медиа, ТВ как медийный ресурс по-прежнему актуален.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">И результаты различных исследований, как казахстанских, так и международных, подтверждают это. Более того, в периоды экономического спада уровень телесмотрения возрастает за счет сокращения времени на активный досуг «за пределами дома» - спорт, прогулки, подвижные игры, посещение кафе и ресторанов. Верно также и обратное: чем больше времени мы отдыхаем вне дома, тем ниже телесмотрение.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">По наблюдениям эксперта, уклад жизни в наших мегаполисах все же не такой, как в регионах, где проживает значительная – чуть более восьмидесяти процентов – часть казахстанцев: «Подобные контексты характерны, наверное, для всех стран и, говоря о предпочтениях граждан в плане досуга, необходимо учитывать поведенческие различия».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Резюмируя, Олег отмечает, что «по сути, исследование MMI говорит нам о том, что потребление ТВ никаким образом не связано с потреблением других медиаканалов. Ну и нам как участникам рекламного рынка важно, что телевизор был и остается самым эффективным способом максимального достижения контактов с аудиторией».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"601\" height=\"600\" class=\"a__center size-full wp-image-1653284\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudxll9a48ujk8o.d5294801.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Татьяна Старцева</span></b><span style=\"font-size:12px;\">, генеральный директор упомянутой исследовательской компании TNS Central Asia, выводы которой учитывает весь казахстанский медиарынок, описывает телепросмотр как «характерный атрибут спокойного домашнего времяпрепровождения». Объемы просмотра ТВ, считает Татьяна, подвержены незначительным колебаниям: «Я бы хотела обратить внимание на положительную корреляцию телесмотрения со спокойным отдыхом, в том числе, посвященным уходу за собой и общению с друзьями. (В 2014 - 2016 гг., казахстанцы, в среднем, за «спокойным отдыхом дома» проводили около 222 минут ежедневно. – Прим. авт.). Просмотр телепередач снижается, когда мы начинаем больше времени проводить вне дома, например, ездить куда-то, развлекаться с детьми».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">«Если говорить об интернете, - продолжает эксперт, - то очевидно, что при росте ежедневного охвата, на всем промежутке исследования среднесуточное время, которое проводят в сети пользователи, практически не подвергается колебаниям. Интернет в большей степени является атрибутом активного времяпрепровождения: им пользуются не только дома, но и на улице, в общественных местах. Заметна зависимость интернетизации от повышения интереса к общению по мобильным средствам связи, ростом посещаемости культурно-зрелищных мероприятий, которые традиционно рекламируются через сеть».</span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">И никакой бумаги</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Исследования TNS Central Asia подтверждают ощущение, что люди стали меньше читать газет и журналов в их привычном – бумажном - виде.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<u><img width=\"800\" height=\"466\" class=\"a__center size-large wp-image-1653282\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx75f2o1c2qr5.6bd13746.jpg\" /></u> \r\n	</div>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Выбор большинства - использовать интернет через смартфоны эксперты объясняют тем, что в Казахстане активно развился именно мобильный интернет, в отличие, скажем, от России, которая стремится опутать себя оптоволоконными сетями. В РФ, по информации ресурса «Эксперт-Казахстан», темпы роста сетей FTTH (fiber to the home – оптическое волокно до дома) выше, чем во всех странах Европы вместе взятых.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"782\" height=\"509\" class=\"a__center size-full wp-image-1653283\" alt=\"Привычки казахстанцев: три с половиной часа перед телевизором ежедневно\" src=\"https://i.onthe.io/pogudx1a20v4i2g1o.9deb6dc2.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Из иллюстрации понятно, что именно молодежь от 15 до 24 лет – основные потребители интернета. Одновременно радует тенденция повышения возраста пользователей сети. Можно сказать, казахстанцы активно осваивают возможности интернета, но не в ущерб традиционной привычке смотреть ТВ.</span> \r\n</p>\r\n<div id=\"videoadv\">\r\n</div>\r\n<div class=\"revive-holder revive-holder--article cf\">\r\n	<div class=\"revive-zone revive-id-4\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-7\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-19\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-20\">\r\n	</div>\r\n</div>\r\n<div id=\"parimatch-place\">\r\n</div>\r\n<div class=\"ima__container\">\r\n	<a class=\"ima__close adv__close\" href=\"https://finance.nur.kz/1653276-privychki-kazakhstancev-tri-s-polovino.html#\"></a> \r\n	<div class=\"ima__holder\">\r\n	</div>\r\n</div>\r\n<div class=\"source\">\r\n	<span style=\"font-size:12px;\">Источник: </span><a class=\"source__link\" href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\"><span style=\"font-size:12px;\">Nur.kz</span></span></a> \r\n</div>', '2017-10-30 10:49:00', '/media/2017/10/30/pogudx350c2v2gish.r110x75.3ff86c81.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 10:53:38', '2017-11-28 16:18:24', NULL, 'Финансы, экономика и бизнес', 29, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Финансы, экономика и бизнес', 'Финансы, экономика и бизнес', 'Администратор', 'Администратор', 'Администратор', '0', 'Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno', '<p class=\"h2\">\r\n	<span style=\"font-size:12px;\">Nesmotrya na ne tak davno pri\'obretenny\'yu pri\'vyc\'ky\' si\'det v sotssetyah, obsy\'jdaya nasy\'s\'nye voprosy byti\'ya, kazahstantsy hranyat vernost televi\'deni\'yu, tak c\'to televi\'zor – v s\'i\'rokom smysle: i\' kak lcd-panel, i\' kak ekran plans\'eta – ni\'ky\'da i\'z nas\'i\'h domov i\' dosy\'ga i\'sc\'ezat ne sobi\'raetsya.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Ne gy\'rmany i\' ne sportsmeny my</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Etot vyvod mojno sdelat i\'z dannyh proekta MMI kompani\'i\' TNS Central Asia, ejegodno provodyas\'ei\' zamery, vli\'yayus\'i\'e na znac\'eni\'ya medi\'amarketi\'ngovyh i\'ndeksov, kotorye otrajayut potrebi\'telskoe povedeni\'e i\' medi\'apredpoc\'teni\'ya kazahstantsev. V 2016 gody\' grajdane v srednem ejednevno provodi\'li\' pered televi\'zorom na 13 mi\'ny\'t bols\'e, c\'em v 2015 (213 mi\'ny\'t proti\'v 200). Stoi\'t otmeti\'t, c\'to v 2014 gody\' eto vremya sostavlyalo 208 mi\'ny\'t.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"800\" height=\"365\" class=\"a__center size-large wp-image-1653281\" alt=\"Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno\" src=\"https://i.onthe.io/pogudx5lesh808ckf.f4b5c718.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Lyubopytno, c\'to za tri\' goda vremennoi\' pokazatel potrebleni\'ya i\'nterneta poc\'ti\' ni\'kak ne i\'zmeni\'lsya: v srednem, c\'y\'t bolee dvy\'h s polovi\'noi\' c\'asov v sy\'tki\'.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<u><img width=\"769\" height=\"600\" class=\"a__center size-large wp-image-1653280\" alt=\"Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno\" src=\"https://i.onthe.io/pogudx23pc4sagl33g.54b70b51.jpg\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Po mneni\'yu </span><b><span style=\"font-size:12px;\">Olega Borody\'li\'na</span></b><span style=\"font-size:12px;\">, zamesti\'telya di\'rektora TV MEDIA Advertising Agency i\' odnogo i\'z vedy\'s\'i\'h ekspertov v oblasti\' medi\'a, TV kak medi\'i\'nyi\' resy\'rs po-prejnemy\' akty\'alen.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">I\' rezy\'ltaty razli\'c\'nyh i\'ssledovani\'i\', kak kazahstanski\'h, tak i\' mejdy\'narodnyh, podtverjdayut eto. Bolee togo, v peri\'ody ekonomi\'c\'eskogo spada y\'roven telesmotreni\'ya vozrastaet za sc\'et sokras\'eni\'ya vremeni\' na akti\'vnyi\' dosy\'g «za predelami\' doma» - sport, progy\'lki\', podvi\'jnye i\'gry, poses\'eni\'e kafe i\' restoranov. Verno takje i\' obratnoe: c\'em bols\'e vremeni\' my otdyhaem vne doma, tem ni\'je telesmotreni\'e.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Po nablyudeni\'yam eksperta, y\'klad ji\'zni\' v nas\'i\'h megapoli\'sah vse je ne takoi\', kak v regi\'onah, gde proji\'vaet znac\'i\'telnaya – c\'y\'t bolee vosmi\'desyati\' protsentov – c\'ast kazahstantsev: «Podobnye konteksty harakterny, navernoe, dlya vseh stran i\', govorya o predpoc\'teni\'yah grajdan v plane dosy\'ga, neobhodi\'mo y\'c\'i\'tyvat povedenc\'eski\'e razli\'c\'i\'ya».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">Rezyumi\'ry\'ya, Oleg otmec\'aet, c\'to «po sy\'ti\', i\'ssledovani\'e MMI govori\'t nam o tom, c\'to potrebleni\'e TV ni\'kaki\'m obrazom ne svyazano s potrebleni\'em dry\'gi\'h medi\'akanalov. Ny\' i\' nam kak y\'c\'astni\'kam reklamnogo rynka vajno, c\'to televi\'zor byl i\' ostaetsya samym effekti\'vnym sposobom maksi\'malnogo dosti\'jeni\'ya kontaktov s ay\'di\'tori\'ei\'».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"601\" height=\"600\" class=\"a__center size-full wp-image-1653284\" alt=\"Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno\" src=\"https://i.onthe.io/pogudxll9a48ujk8o.d5294801.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">Tatyana Startseva</span></b><span style=\"font-size:12px;\">, generalnyi\' di\'rektor y\'pomyany\'toi\' i\'ssledovatelskoi\' kompani\'i\' TNS Central Asia, vyvody kotoroi\' y\'c\'i\'tyvaet ves kazahstanski\'i\' medi\'arynok, opi\'syvaet teleprosmotr kak «harakternyi\' atri\'by\'t spokoi\'nogo domas\'nego vremyapreprovojdeni\'ya». Obemy prosmotra TV, sc\'i\'taet Tatyana, podverjeny neznac\'i\'telnym kolebani\'yam: «Ya by hotela obrati\'t vni\'mani\'e na poloji\'telny\'yu korrelyatsi\'yu telesmotreni\'ya so spokoi\'nym otdyhom, v tom c\'i\'sle, posvyas\'ennym y\'hody\' za soboi\' i\' obs\'eni\'yu s dry\'zyami\'. (V 2014 - 2016 gg., kazahstantsy, v srednem, za «spokoi\'nym otdyhom doma» provodi\'li\' okolo 222 mi\'ny\'t ejednevno. – Pri\'m. avt.). Prosmotr teleperedac\' sni\'jaetsya, kogda my nac\'i\'naem bols\'e vremeni\' provodi\'t vne doma, napri\'mer, ezdi\'t ky\'da-to, razvlekatsya s detmi\'».</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">«Esli\' govori\'t ob i\'nternete, - prodoljaet ekspert, - to oc\'evi\'dno, c\'to pri\' roste ejednevnogo ohvata, na vsem promejy\'tke i\'ssledovani\'ya srednesy\'toc\'noe vremya, kotoroe provodyat v seti\' polzovateli\', prakti\'c\'eski\' ne podvergaetsya kolebani\'yam. I\'nternet v bols\'ei\' stepeni\' yavlyaetsya atri\'by\'tom akti\'vnogo vremyapreprovojdeni\'ya: i\'m polzy\'yutsya ne tolko doma, no i\' na y\'li\'tse, v obs\'estvennyh mestah. Zametna zavi\'si\'most i\'nterneti\'zatsi\'i\' ot povys\'eni\'ya i\'nteresa k obs\'eni\'yu po mobi\'lnym sredstvam svyazi\', rostom poses\'aemosti\' ky\'lty\'rno-zreli\'s\'nyh meropri\'yati\'i\', kotorye tradi\'tsi\'onno reklami\'ry\'yutsya c\'erez set».</span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:12px;\">I\' ni\'kakoi\' by\'magi\'</span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\">I\'ssledovani\'ya TNS Central Asia podtverjdayut os\'y\'s\'eni\'e, c\'to lyudi\' stali\' mens\'e c\'i\'tat gazet i\' jy\'rnalov v i\'h pri\'vyc\'nom – by\'majnom - vi\'de.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12px;\"><br />\r\n</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<u><img width=\"800\" height=\"466\" class=\"a__center size-large wp-image-1653282\" alt=\"Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno\" src=\"https://i.onthe.io/pogudx75f2o1c2qr5.6bd13746.jpg\" /></u> \r\n	</div>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">Vybor bols\'i\'nstva - i\'spolzovat i\'nternet c\'erez smartfony eksperty obyasnyayut tem, c\'to v Kazahstane akti\'vno razvi\'lsya i\'menno mobi\'lnyi\' i\'nternet, v otli\'c\'i\'e, skajem, ot Rossi\'i\', kotoraya stremi\'tsya opy\'tat sebya optovolokonnymi\' setyami\'. V RF, po i\'nformatsi\'i\' resy\'rsa «Ekspert-Kazahstan», tempy rosta setei\' FTTH (fiber to the home – opti\'c\'eskoe volokno do doma) vys\'e, c\'em vo vseh stranah Evropy vmeste vzyatyh.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img width=\"782\" height=\"509\" class=\"a__center size-full wp-image-1653283\" alt=\"Pri\'vyc\'ki\' kazahstantsev: tri\' s polovi\'noi\' c\'asa pered televi\'zorom ejednevno\" src=\"https://i.onthe.io/pogudx1a20v4i2g1o.9deb6dc2.jpg\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:12px;\">I\'z i\'llyustratsi\'i\' ponyatno, c\'to i\'menno molodej ot 15 do 24 let – osnovnye potrebi\'teli\' i\'nterneta. Odnovremenno rady\'et tendentsi\'ya povys\'eni\'ya vozrasta polzovatelei\' seti\'. Mojno skazat, kazahstantsy akti\'vno osvai\'vayut vozmojnosti\' i\'nterneta, no ne v y\'s\'erb tradi\'tsi\'onnoi\' pri\'vyc\'ke smotret TV.</span> \r\n</p>\r\n<div id=\"videoadv\">\r\n</div>\r\n<div class=\"revive-holder revive-holder--article cf\">\r\n	<div class=\"revive-zone revive-id-4\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-7\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-19\">\r\n	</div>\r\n	<div class=\"revive-zone revive-id-20\">\r\n	</div>\r\n</div>\r\n<div id=\"parimatch-place\">\r\n</div>\r\n<div class=\"ima__container\">\r\n	<a class=\"ima__close adv__close\" href=\"https://finance.nur.kz/1653276-privychki-kazakhstancev-tri-s-polovino.html#\"></a> \r\n	<div class=\"ima__holder\">\r\n	</div>\r\n</div>\r\n<div class=\"source\">\r\n	<span style=\"font-size:12px;\">I\'stoc\'ni\'k: </span><a class=\"source__link\" href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\"><span style=\"font-size:12px;\">Nur.kz</span></span></a> \r\n</div>', '', 'Fi\'nansy, ekonomi\'ka i\' bi\'znes', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0);
INSERT INTO `news` (`news_id`, `news_name_ru`, `news_text_ru`, `news_name_kz`, `news_text_kz`, `news_name_en`, `news_text_en`, `news_date`, `news_image`, `user_id`, `news_icon`, `is_show`, `news_desc_ru`, `news_desc_en`, `news_desc_kz`, `created_at`, `updated_at`, `deleted_at`, `tag_ru`, `view_count`, `news_meta_description_kz`, `news_meta_description_ru`, `news_meta_description_en`, `news_meta_keywords_kz`, `news_meta_keywords_ru`, `news_meta_keywords_en`, `tag_kz`, `tag_en`, `author_kz`, `author_ru`, `author_en`, `is_audio`, `news_name_qz`, `news_text_qz`, `news_desc_qz`, `tag_qz`, `author_qz`, `news_meta_description_qz`, `news_meta_keywords_qz`, `is_watermark`) VALUES
(199, 'Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал', '<p>\r\n	В преддверии 25-летия своей коммерческой деятельности Акционерное общество «Tengri Bank» организовало в г. Кокшетау торжественное открытие нового филиала, расположившегося по адресу ул. Габдуллина, 40Б,&nbsp; с участием заместителя Акима Акмолинской области Асхата Кайнарбекова, который оказал честь провести церемонию торжественного разрезания ленты совместно с председателем Правления банка Ержаном Шайкеновым.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"share-image\">\r\n	<div class=\"fb-quote fb_iframe_widget\">\r\n		<br />\r\n	</div>\r\n</div>\r\n<u><img class=\"a__center size-large wp-image-1650890\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx52no5ijq5ts.8b6d3a03.jpg\" width=\"800\" height=\"534\" /></u> \r\n<p>\r\n	На церемонию открытия были приглашены клиенты и партнеры банка. Потенциальные вкладчики, руководители предприятий и ряд СМИ города Кокшетау.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651083\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx4skelg02qei.373dcaf1.jpg\" width=\"733\" height=\"600\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Стоит отметить, что за 2017 год банк открывает уже пятый филиал разных городах страны. Ранее банк заявил о себе в Алматы, Астана, Шымкент, Актау. Также филиалы работают в Караганде, Темиртау и Павлодаре.\r\n</p>\r\n<p>\r\n	Банк входит в число лидеров среди БВУ по развитию, но держит умеренный темп согласно собственной стратегии.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651084\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx1dhpvj5mpn6.b86b73e1.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Присутствие на рынке Акмолинского региона обусловлено задачей в финансировании и предоставлении различных финансовых инструментов для предприятий, чья деятельность связана с производством и переработкой сельхозпродукции, товаров народного потребления и внешнеэкономической деятельностью.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1650892\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx141q3clpoi7g.15f51d10.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	За 9 месяцев текущего года только в Акмолинской области Тengri Bank&nbsp;профинансировал субъекты малого и среднего бизнеса на сумму около 5 млрд тенге.\r\n</p>\r\n<p>\r\n	В ближайшее время Tengri Bank продолжит работу по развитию филиальной сети в регионах республики, совершенствованию продуктовой линейки и повышению качества сервиса.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651085\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx1qoio6vlkkn8.aa05587c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	АО «Tengri Bank»&nbsp;был основан в&nbsp;октябре 1992 года как ЧБ&nbsp;«Данабанк». В 2010 году Punjab National Bank (второй крупнейший банк Индии) приобрел контрольный пакет акций «Данабанк».\r\n</p>\r\n<p>\r\n	А уже в 2016 году, в&nbsp;рамках новой стратегии развития банка&nbsp;АО «PNB Казахстан Банк»&nbsp;изменил свое наименование на&nbsp;АО «Tengri Bank».\r\n</p>\r\n<p>\r\n	Среди банков второго уровня Республики Казахстан всего несколько банков имеют рейтинг выше или равный рейтингу АО «Tengri Bank» на уровне «B+», который подтвержден международным рейтинговым агентством S&amp;P Global Ratings и отражает стабильное финансовое состояние, обеспеченное, в том числе, за счет высокого качества кредитного портфеля и высокого уровня достаточности капитала.\r\n</p>\r\n<p>\r\n	<em>*На правах PR.&nbsp;</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 'Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал', '<p>\r\n	В преддверии 25-летия своей коммерческой деятельности Акционерное общество «Tengri Bank» организовало в г. Кокшетау торжественное открытие нового филиала, расположившегося по адресу ул. Габдуллина, 40Б,&nbsp; с участием заместителя Акима Акмолинской области Асхата Кайнарбекова, который оказал честь провести церемонию торжественного разрезания ленты совместно с председателем Правления банка Ержаном Шайкеновым.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"share-image\">\r\n	<div class=\"fb-quote fb_iframe_widget\">\r\n		<br />\r\n	</div>\r\n</div>\r\n<u><img class=\"a__center size-large wp-image-1650890\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx52no5ijq5ts.8b6d3a03.jpg\" width=\"800\" height=\"534\" /></u> \r\n<p>\r\n	На церемонию открытия были приглашены клиенты и партнеры банка. Потенциальные вкладчики, руководители предприятий и ряд СМИ города Кокшетау.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651083\" alt=\"Кокшетау стал ближе к вершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx4skelg02qei.373dcaf1.jpg\" width=\"733\" height=\"600\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Стоит отметить, что за 2017 год банк открывает уже пятый филиал разных городах страны. Ранее банк заявил о себе в Алматы, Астана, Шымкент, Актау. Также филиалы работают в Караганде, Темиртау и Павлодаре.\r\n</p>\r\n<p>\