ершинам: Tengri Bank открыл свой новый филиал\" src=\"https://i.onthe.io/pogudx1qoio6vlkkn8.aa05587c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	АО «Tengri Bank»&nbsp;был основан в&nbsp;октябре 1992 года как ЧБ&nbsp;«Данабанк». В 2010 году Punjab National Bank (второй крупнейший банк Индии) приобрел контрольный пакет акций «Данабанк».\r\n</p>\r\n<p>\r\n	А уже в 2016 году, в&nbsp;рамках новой стратегии развития банка&nbsp;АО «PNB Казахстан Банк»&nbsp;изменил свое наименование на&nbsp;АО «Tengri Bank».\r\n</p>\r\n<p>\r\n	Среди банков второго уровня Республики Казахстан всего несколько банков имеют рейтинг выше или равный рейтингу АО «Tengri Bank» на уровне «B+», который подтвержден международным рейтинговым агентством S&amp;P Global Ratings и отражает стабильное финансовое состояние, обеспеченное, в том числе, за счет высокого качества кредитного портфеля и высокого уровня достаточности капитала.\r\n</p>\r\n<p>\r\n	<em>*На правах PR.&nbsp;</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-10-30 10:55:00', '/media/2017/10/30/075851575800.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-10-30 10:58:59', '2017-11-29 08:53:38', NULL, 'Банки, Кокшетау, экономика', 42, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Банки, Кокшетау, экономика', 'Банки, Кокшетау, экономика', 'Администратор', 'Администратор', 'Администратор', '0', 'Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al', '<p>\r\n	V preddveri\'i\' 25-leti\'ya svoei\' kommerc\'eskoi\' deyatelnosti\' Aktsi\'onernoe obs\'estvo «Tengri Bank» organi\'zovalo v g. Koks\'etay\' torjestvennoe otkryti\'e novogo fi\'li\'ala, raspoloji\'vs\'egosya po adresy\' y\'l. Gabdy\'lli\'na, 40B,&nbsp; s y\'c\'asti\'em zamesti\'telya Aki\'ma Akmoli\'nskoi\' oblasti\' Ashata Kai\'narbekova, kotoryi\' okazal c\'est provesti\' tseremoni\'yu torjestvennogo razrezani\'ya lenty sovmestno s predsedatelem Pravleni\'ya banka Erjanom S\'ai\'kenovym.\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"share-image\">\r\n	<div class=\"fb-quote fb_iframe_widget\">\r\n		<br />\r\n	</div>\r\n</div>\r\n<u><img class=\"a__center size-large wp-image-1650890\" alt=\"Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al\" src=\"https://i.onthe.io/pogudx52no5ijq5ts.8b6d3a03.jpg\" width=\"800\" height=\"534\" /></u> \r\n<p>\r\n	Na tseremoni\'yu otkryti\'ya byli\' pri\'glas\'eny kli\'enty i\' partnery banka. Potentsi\'alnye vkladc\'i\'ki\', ry\'kovodi\'teli\' predpri\'yati\'i\' i\' ryad SMI\' goroda Koks\'etay\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651083\" alt=\"Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al\" src=\"https://i.onthe.io/pogudx4skelg02qei.373dcaf1.jpg\" width=\"733\" height=\"600\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	Stoi\'t otmeti\'t, c\'to za 2017 god bank otkryvaet y\'je pyatyi\' fi\'li\'al raznyh gorodah strany. Ranee bank zayavi\'l o sebe v Almaty, Astana, S\'ymkent, Aktay\'. Takje fi\'li\'aly rabotayut v Karagande, Temi\'rtay\' i\' Pavlodare.\r\n</p>\r\n<p>\r\n	Bank vhodi\'t v c\'i\'slo li\'derov sredi\' BVY\' po razvi\'ti\'yu, no derji\'t y\'merennyi\' temp soglasno sobstvennoi\' strategi\'i\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651084\" alt=\"Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al\" src=\"https://i.onthe.io/pogudx1dhpvj5mpn6.b86b73e1.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Pri\'sy\'tstvi\'e na rynke Akmoli\'nskogo regi\'ona oby\'slovleno zadac\'ei\' v fi\'nansi\'rovani\'i\' i\' predostavleni\'i\' razli\'c\'nyh fi\'nansovyh i\'nstry\'mentov dlya predpri\'yati\'i\', c\'ya deyatelnost svyazana s proi\'zvodstvom i\' pererabotkoi\' selhozprody\'ktsi\'i\', tovarov narodnogo potrebleni\'ya i\' vnes\'neekonomi\'c\'eskoi\' deyatelnostyu.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1650892\" alt=\"Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al\" src=\"https://i.onthe.io/pogudx141q3clpoi7g.15f51d10.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Za 9 mesyatsev teky\'s\'ego goda tolko v Akmoli\'nskoi\' oblasti\' Tengri Bank&nbsp;profi\'nansi\'roval sy\'bekty malogo i\' srednego bi\'znesa na sy\'mmy\' okolo 5 mlrd tenge.\r\n</p>\r\n<p>\r\n	V bli\'jai\'s\'ee vremya Tengri Bank prodolji\'t raboty\' po razvi\'ti\'yu fi\'li\'alnoi\' seti\' v regi\'onah respy\'bli\'ki\', sovers\'enstvovani\'yu prody\'ktovoi\' li\'nei\'ki\' i\' povys\'eni\'yu kac\'estva servi\'sa.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"a__center size-large wp-image-1651085\" alt=\"Koks\'etay\' stal bli\'je k vers\'i\'nam: Tengri Bank otkryl svoi\' novyi\' fi\'li\'al\" src=\"https://i.onthe.io/pogudx1qoio6vlkkn8.aa05587c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	AO «Tengri Bank»&nbsp;byl osnovan v&nbsp;oktyabre 1992 goda kak C\'B&nbsp;«Danabank». V 2010 gody\' Punjab National Bank (vtoroi\' kry\'pnei\'s\'i\'i\' bank I\'ndi\'i\') pri\'obrel kontrolnyi\' paket aktsi\'i\' «Danabank».\r\n</p>\r\n<p>\r\n	A y\'je v 2016 gody\', v&nbsp;ramkah novoi\' strategi\'i\' razvi\'ti\'ya banka&nbsp;AO «PNB Kazahstan Bank»&nbsp;i\'zmeni\'l svoe nai\'menovani\'e na&nbsp;AO «Tengri Bank».\r\n</p>\r\n<p>\r\n	Sredi\' bankov vtorogo y\'rovnya Respy\'bli\'ki\' Kazahstan vsego neskolko bankov i\'meyut rei\'ti\'ng vys\'e i\'li\' ravnyi\' rei\'ti\'ngy\' AO «Tengri Bank» na y\'rovne «B+», kotoryi\' podtverjden mejdy\'narodnym rei\'ti\'ngovym agentstvom S&amp;P Global Ratings i\' otrajaet stabi\'lnoe fi\'nansovoe sostoyani\'e, obespec\'ennoe, v tom c\'i\'sle, za sc\'et vysokogo kac\'estva kredi\'tnogo portfelya i\' vysokogo y\'rovnya dostatoc\'nosti\' kapi\'tala.\r\n</p>\r\n<p>\r\n	<em>*Na pravah PR.&nbsp;</em> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '', 'Banki\', Koks\'etay\', ekonomi\'ka', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 1);
INSERT INTO `news` (`news_id`, `news_name_ru`, `news_text_ru`, `news_name_kz`, `news_text_kz`, `news_name_en`, `news_text_en`, `news_date`, `news_image`, `user_id`, `news_icon`, `is_show`, `news_desc_ru`, `news_desc_en`, `news_desc_kz`, `created_at`, `updated_at`, `deleted_at`, `tag_ru`, `view_count`, `news_meta_description_kz`, `news_meta_description_ru`, `news_meta_description_en`, `news_meta_keywords_kz`, `news_meta_keywords_ru`, `news_meta_keywords_en`, `tag_kz`, `tag_en`, `author_kz`, `author_ru`, `author_en`, `is_audio`, `news_name_qz`, `news_text_qz`, `news_desc_qz`, `tag_qz`, `author_qz`, `news_meta_description_qz`, `news_meta_keywords_qz`, `is_watermark`) VALUES
(200, 'Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)', '<p class=\"h2\">\r\n	<span style=\"font-size:14px;\">Жители Рабочего поселка Карагандинской области переживают не лучшие времена. Местность стала утопать в мусоре из-за отсутствия машин для сбора и вывоза бытовых отходов, по дорогам все сложнее ходить, а в некоторых домах люди вынуждены мерзнуть без угля. Корреспонденты </span><a href=\"https://www.nur.kz/\"><span style=\"font-size:14px;\">NUR.KZ</span></a><span style=\"font-size:14px;\"> посмотрели, в каких условиях живут люди в пригороде Караганды.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<div class=\"article__image article__none\">\r\n	<u><img class=\"alignnone size-large wp-image-1660174\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7i67v7u31ts.ca878a40.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Поселок&nbsp;находится в 20&nbsp;километрах&nbsp;от города. Транспорт тут ходит регулярно, однако жители жалуются, что в час пик в общественный транспорт невозможно пробиться.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660176\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7ocdgafop4u.79a09b3e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Всего здесь живут почти 15 тысяч человек, в Рабочем поселке - больше 5 тысяч.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660181\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1naqehr5eung.262875cf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Многим приходится каждый день ездить в город на заработки.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660182\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1ssg939rva0g.ab3356f0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">В Рабочем поселке всего одна детская площадка, и путь к ней проложен через мост.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660184\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3hi2d5afo5u.c317f1d4.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Поэтому многие дети вынуждены играть на грязных дорогах и даже среди мусора.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660185\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxd907vfskddg.b5c0c064.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">По словам местных жителей, с&nbsp;углем у них в этом году большие проблемы.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660188 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx569sma59pra.b3bf3464.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		<span style=\"font-size:14px;\">ЖАНАТ</span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Жанат переехал в этот поселок 15 лет назад из Майкудука. Говорит, что захотелось жить в своем доме. По словам мужчины, его семья до сих пор вынуждена использовать прошлогодние запасы угля, которые уже на исходе.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660190\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6uaolbrho26.03c737c8.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">«</span><em><strong><span style=\"font-size:14px;\">Хорошо, что с прошлой зимы хоть немного угля осталось, а то бы вообще не знали, что делать. Я сделал заказ на уголь неделю назад, и мне до сих пор его не привезли. Говорят, что просто нет угля. Я пробовал сам ездить на места, где обычно продают уголь, и увидел огромные очереди. А еще говорят, что проблем нет с углем. Как нет, если цена стала в два-три раза выше. В прошлом году мы покупали тонну угля за 6-7 тысяч тенге, а в этом году продают за 12-15 тысяч угля. Где это видано вообще? Мы вроде бы живем в шахтерской столице, а угля нет. Смеяться или плакать?</span></strong></em><span style=\"font-size:14px;\">».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660192 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6f8kdla6567.cb7c43bd.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		<span style=\"font-size:14px;\">НАСЫП</span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Насып - одна из счастливиц, которым удалось купить уголь по старой цене. Однако качеством женщина недовольна.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660221\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21mc5tm4p9p.2ecd740e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">«</span><em><strong><span style=\"font-size:14px;\">Я успела купить уголь в сентябре за 7 тысяч тенге за тонну, только треть этого угля либо просто пыль, либо шлак. Все равно придется покупать еще</span></strong></em><span style=\"font-size:14px;\">».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660193 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx22d578gua5o.94d5cee6.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		<span style=\"font-size:14px;\">АЛМА</span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Сельчанка Алма также жалуется на уголь. Говорит, он слишком поднялся в цене.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660195\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxkaobuaqqeco.3f5cec59.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">«</span><em><strong><span style=\"font-size:14px;\">В зависимости от размера дома, людям нужно от 10 до 20 тонн угля за отопительный сезон. Зима у нас долгая, длится почти полгода. Сами понимаете, что люди у нас все простые, богатые тут не живут. Все живем от зарплаты до зарплаты, и в этом году уголь сильно ударил по нашим карманам</span></strong></em><span style=\"font-size:14px;\">».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660196\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6vb9rispaj6.7ce1c9b7.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Если проблемы с углем возникли только в этом году, то ужасные дороги и мусор - больное место жителей поселка.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660197\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3qm1k32c7mv.012bf74c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Прямо возле дома Насып три года назад «Караганды Су» проводили трубу, а после ремонтных работ дорогу в порядок так и не привели. Впрочем, в поселке все дороги в плачевном состоянии.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660198\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4kcf6bmu40a.d69f6acf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Из-за этих дорог скорая помощь и такси просто отказываются ехать сюда.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660199 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx5dbom9vmr6k.fdf00eb2.jpg\" width=\"401\" height=\"600\" /></u> \r\n	<p>\r\n		<span style=\"font-size:14px;\">АЙТБАЙ</span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Местный житель Айтбай признается, что помощи уже не ждет и что власти города начнут ремонтировать дороги он не верит.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660200\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6la4bg00nju.436ce98e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">«</span><em><strong><span style=\"font-size:14px;\">Постоянно нам говорят: \"Идите, жалуйтесь, поднимайте шум, говорите о своей проблеме\". Почему в нашей стране все только так решается? Почему народ всегда что-то должен делать, истерить и бить в грудь, чтобы его услышали? Я плачу налоги, я законопослушный гражданин, я такой же житель этой страны, как и чиновники. Из года в год проблема с этими дорогами и мусором. Неужели это невозможно решить?</span></strong></em><span style=\"font-size:14px;\">»</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660202\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4ukjus1kfcu.91fef275.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Жители поселка сетуют, что постоянно вынуждены ходить в резиновых сапогах, а о дорогой обуви они&nbsp; вообще перестали думать.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660203\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx47fq42dhmtq.9b5734be.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Асфальтированная дорога и свет есть только на главной улице поселка.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660206\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2fhnh3uifv3g.ba88291d.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Также в поселке повсеместно на глаза попадаются отходы \"жизнедеятельности\" местных жителей, вынужденных жить рядом с этими помойками.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660207\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2amrpfvrkubg.766e4c14.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Чего здесь только нет: бутылки из-под спиртного, консервные банки, рваные калоши и даже трупы домашнего скота.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660209\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx54bro059jio.98ed7ec0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Жители и рады бы не мусорить и даже готовы платить за его вывоз, только вот акимат почему-то уже много лет эту проблему игнорирует.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660211 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx59j881d5gpp.b3fd919c.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		<span style=\"font-size:14px;\">БИКЕШ</span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">По словам Бикеш, которая живет здесь с самого рождения, жители не раз обращались с просьбой установить мусорные баки.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\">«</span><em><strong><span style=\"font-size:14px;\">Сплошь и рядом горы мусора, по дорогам невозможно ходить. Летом тут стоит такая вонь, что просто нет сил. В поселке просто некуда выбрасывать мусор. Кто-то сжигает мусор в печках, кто-то закапывает, а многие просто выбрасывают на улицу. Мы просили поставить мусорные баки возле домов, мы готовы платить сколько угодно. Так же нельзя жить. Мы получается сами утопаем в своем же мусоре от безысходности</span></strong></em><span style=\"font-size:14px;\">».</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660214\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1njp0jh0r5fg.f51c2fbc.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Мусором питается даже местный скот. Страшно представить, какое молоко дают потом эти коровы.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660216\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21gen4rsevrg.b97b63b0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	<span style=\"font-size:14px;\">Депрессивный поселок пугает своей чернотой и погрязшими в мусоре улицами.</span> \r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone size-large wp-image-1660217\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2qdq11i72h5g.1f52e5eb.jpg\" width=\"800\" height=\"533\" /> \r\n</div>', 'Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)', '<p class=\"h2\">\r\n	Жители Рабочего поселка Карагандинской области переживают не лучшие времена. Местность стала утопать в мусоре из-за отсутствия машин для сбора и вывоза бытовых отходов, по дорогам все сложнее ходить, а в некоторых домах люди вынуждены мерзнуть без угля. Корреспонденты <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> посмотрели, в каких условиях живут люди в пригороде Караганды.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<div class=\"article__image article__none\">\r\n	<u><img class=\"alignnone size-large wp-image-1660174\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7i67v7u31ts.ca878a40.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Поселок&nbsp;находится в 20&nbsp;километрах&nbsp;от города. Транспорт тут ходит регулярно, однако жители жалуются, что в час пик в общественный транспорт невозможно пробиться.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660176\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7ocdgafop4u.79a09b3e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Всего здесь живут почти 15 тысяч человек, в Рабочем поселке - больше 5 тысяч.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660181\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1naqehr5eung.262875cf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Многим приходится каждый день ездить в город на заработки.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660182\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1ssg939rva0g.ab3356f0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	В Рабочем поселке всего одна детская площадка, и путь к ней проложен через мост.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660184\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3hi2d5afo5u.c317f1d4.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Поэтому многие дети вынуждены играть на грязных дорогах и даже среди мусора.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660185\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxd907vfskddg.b5c0c064.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	По словам местных жителей, с&nbsp;углем у них в этом году большие проблемы.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660188 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx569sma59pra.b3bf3464.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		ЖАНАТ\r\n	</p>\r\n</div>\r\n<p>\r\n	Жанат переехал в этот поселок 15 лет назад из Майкудука. Говорит, что захотелось жить в своем доме. По словам мужчины, его семья до сих пор вынуждена использовать прошлогодние запасы угля, которые уже на исходе.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660190\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6uaolbrho26.03c737c8.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em><strong>Хорошо, что с прошлой зимы хоть немного угля осталось, а то бы вообще не знали, что делать. Я сделал заказ на уголь неделю назад, и мне до сих пор его не привезли. Говорят, что просто нет угля. Я пробовал сам ездить на места, где обычно продают уголь, и увидел огромные очереди. А еще говорят, что проблем нет с углем. Как нет, если цена стала в два-три раза выше. В прошлом году мы покупали тонну угля за 6-7 тысяч тенге, а в этом году продают за 12-15 тысяч угля. Где это видано вообще? Мы вроде бы живем в шахтерской столице, а угля нет. Смеяться или плакать?</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660192 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6f8kdla6567.cb7c43bd.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		НАСЫП\r\n	</p>\r\n</div>\r\n<p>\r\n	Насып - одна из счастливиц, которым удалось купить уголь по старой цене. Однако качеством женщина недовольна.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660221\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21mc5tm4p9p.2ecd740e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Я успела купить уголь в сентябре за 7 тысяч тенге за тонну, только треть этого угля либо просто пыль, либо шлак. Все равно придется покупать еще</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660193 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx22d578gua5o.94d5cee6.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		АЛМА\r\n	</p>\r\n</div>\r\n<p>\r\n	Сельчанка Алма также жалуется на уголь. Говорит, он слишком поднялся в цене.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660195\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxkaobuaqqeco.3f5cec59.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>В зависимости от размера дома, людям нужно от 10 до 20 тонн угля за отопительный сезон. Зима у нас долгая, длится почти полгода. Сами понимаете, что люди у нас все простые, богатые тут не живут. Все живем от зарплаты до зарплаты, и в этом году уголь сильно ударил по нашим карманам</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660196\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6vb9rispaj6.7ce1c9b7.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Если проблемы с углем возникли только в этом году, то ужасные дороги и мусор - больное место жителей поселка.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660197\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3qm1k32c7mv.012bf74c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Прямо возле дома Насып три года назад «Караганды Су» проводили трубу, а после ремонтных работ дорогу в порядок так и не привели. Впрочем, в поселке все дороги в плачевном состоянии.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660198\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4kcf6bmu40a.d69f6acf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Из-за этих дорог скорая помощь и такси просто отказываются ехать сюда.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660199 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx5dbom9vmr6k.fdf00eb2.jpg\" width=\"401\" height=\"600\" /></u> \r\n	<p>\r\n		АЙТБАЙ\r\n	</p>\r\n</div>\r\n<p>\r\n	Местный житель Айтбай признается, что помощи уже не ждет и что власти города начнут ремонтировать дороги он не верит.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660200\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6la4bg00nju.436ce98e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Постоянно нам говорят: \"Идите, жалуйтесь, поднимайте шум, говорите о своей проблеме\". Почему в нашей стране все только так решается? Почему народ всегда что-то должен делать, истерить и бить в грудь, чтобы его услышали? Я плачу налоги, я законопослушный гражданин, я такой же житель этой страны, как и чиновники. Из года в год проблема с этими дорогами и мусором. Неужели это невозможно решить?</strong></em>»\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660202\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4ukjus1kfcu.91fef275.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Жители поселка сетуют, что постоянно вынуждены ходить в резиновых сапогах, а о дорогой обуви они&nbsp; вообще перестали думать.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660203\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx47fq42dhmtq.9b5734be.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Асфальтированная дорога и свет есть только на главной улице поселка.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660206\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2fhnh3uifv3g.ba88291d.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Также в поселке повсеместно на глаза попадаются отходы \"жизнедеятельности\" местных жителей, вынужденных жить рядом с этими помойками.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660207\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2amrpfvrkubg.766e4c14.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Чего здесь только нет: бутылки из-под спиртного, консервные банки, рваные калоши и даже трупы домашнего скота.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660209\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx54bro059jio.98ed7ec0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Жители и рады бы не мусорить и даже готовы платить за его вывоз, только вот акимат почему-то уже много лет эту проблему игнорирует.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660211 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx59j881d5gpp.b3fd919c.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		БИКЕШ\r\n	</p>\r\n</div>\r\n<p>\r\n	По словам Бикеш, которая живет здесь с самого рождения, жители не раз обращались с просьбой установить мусорные баки.\r\n</p>\r\n<p>\r\n	«<em><strong>Сплошь и рядом горы мусора, по дорогам невозможно ходить. Летом тут стоит такая вонь, что просто нет сил. В поселке просто некуда выбрасывать мусор. Кто-то сжигает мусор в печках, кто-то закапывает, а многие просто выбрасывают на улицу. Мы просили поставить мусорные баки возле домов, мы готовы платить сколько угодно. Так же нельзя жить. Мы получается сами утопаем в своем же мусоре от безысходности</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660214\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1njp0jh0r5fg.f51c2fbc.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Мусором питается даже местный скот. Страшно представить, какое молоко дают потом эти коровы.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660216\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21gen4rsevrg.b97b63b0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Депрессивный поселок пугает своей чернотой и погрязшими в мусоре улицами.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone size-large wp-image-1660217\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2qdq11i72h5g.1f52e5eb.jpg\" width=\"800\" height=\"533\" /> \r\n</div>', 'Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)', '<p class=\"h2\">\r\n	Жители Рабочего поселка Карагандинской области переживают не лучшие времена. Местность стала утопать в мусоре из-за отсутствия машин для сбора и вывоза бытовых отходов, по дорогам все сложнее ходить, а в некоторых домах люди вынуждены мерзнуть без угля. Корреспонденты <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> посмотрели, в каких условиях живут люди в пригороде Караганды.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<div class=\"article__image article__none\">\r\n	<u><img class=\"alignnone size-large wp-image-1660174\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7i67v7u31ts.ca878a40.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Поселок&nbsp;находится в 20&nbsp;километрах&nbsp;от города. Транспорт тут ходит регулярно, однако жители жалуются, что в час пик в общественный транспорт невозможно пробиться.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660176\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx7ocdgafop4u.79a09b3e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Всего здесь живут почти 15 тысяч человек, в Рабочем поселке - больше 5 тысяч.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660181\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1naqehr5eung.262875cf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Многим приходится каждый день ездить в город на заработки.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660182\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1ssg939rva0g.ab3356f0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	В Рабочем поселке всего одна детская площадка, и путь к ней проложен через мост.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660184\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3hi2d5afo5u.c317f1d4.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Поэтому многие дети вынуждены играть на грязных дорогах и даже среди мусора.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660185\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxd907vfskddg.b5c0c064.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	По словам местных жителей, с&nbsp;углем у них в этом году большие проблемы.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660188 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx569sma59pra.b3bf3464.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		ЖАНАТ\r\n	</p>\r\n</div>\r\n<p>\r\n	Жанат переехал в этот поселок 15 лет назад из Майкудука. Говорит, что захотелось жить в своем доме. По словам мужчины, его семья до сих пор вынуждена использовать прошлогодние запасы угля, которые уже на исходе.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660190\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6uaolbrho26.03c737c8.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em><strong>Хорошо, что с прошлой зимы хоть немного угля осталось, а то бы вообще не знали, что делать. Я сделал заказ на уголь неделю назад, и мне до сих пор его не привезли. Говорят, что просто нет угля. Я пробовал сам ездить на места, где обычно продают уголь, и увидел огромные очереди. А еще говорят, что проблем нет с углем. Как нет, если цена стала в два-три раза выше. В прошлом году мы покупали тонну угля за 6-7 тысяч тенге, а в этом году продают за 12-15 тысяч угля. Где это видано вообще? Мы вроде бы живем в шахтерской столице, а угля нет. Смеяться или плакать?</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660192 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6f8kdla6567.cb7c43bd.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		НАСЫП\r\n	</p>\r\n</div>\r\n<p>\r\n	Насып - одна из счастливиц, которым удалось купить уголь по старой цене. Однако качеством женщина недовольна.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660221\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21mc5tm4p9p.2ecd740e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Я успела купить уголь в сентябре за 7 тысяч тенге за тонну, только треть этого угля либо просто пыль, либо шлак. Все равно придется покупать еще</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660193 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx22d578gua5o.94d5cee6.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		АЛМА\r\n	</p>\r\n</div>\r\n<p>\r\n	Сельчанка Алма также жалуется на уголь. Говорит, он слишком поднялся в цене.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660195\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudxkaobuaqqeco.3f5cec59.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>В зависимости от размера дома, людям нужно от 10 до 20 тонн угля за отопительный сезон. Зима у нас долгая, длится почти полгода. Сами понимаете, что люди у нас все простые, богатые тут не живут. Все живем от зарплаты до зарплаты, и в этом году уголь сильно ударил по нашим карманам</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660196\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6vb9rispaj6.7ce1c9b7.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Если проблемы с углем возникли только в этом году, то ужасные дороги и мусор - больное место жителей поселка.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660197\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx3qm1k32c7mv.012bf74c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Прямо возле дома Насып три года назад «Караганды Су» проводили трубу, а после ремонтных работ дорогу в порядок так и не привели. Впрочем, в поселке все дороги в плачевном состоянии.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660198\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4kcf6bmu40a.d69f6acf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Из-за этих дорог скорая помощь и такси просто отказываются ехать сюда.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660199 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx5dbom9vmr6k.fdf00eb2.jpg\" width=\"401\" height=\"600\" /></u> \r\n	<p>\r\n		АЙТБАЙ\r\n	</p>\r\n</div>\r\n<p>\r\n	Местный житель Айтбай признается, что помощи уже не ждет и что власти города начнут ремонтировать дороги он не верит.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660200\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx6la4bg00nju.436ce98e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Постоянно нам говорят: \"Идите, жалуйтесь, поднимайте шум, говорите о своей проблеме\". Почему в нашей стране все только так решается? Почему народ всегда что-то должен делать, истерить и бить в грудь, чтобы его услышали? Я плачу налоги, я законопослушный гражданин, я такой же житель этой страны, как и чиновники. Из года в год проблема с этими дорогами и мусором. Неужели это невозможно решить?</strong></em>»\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660202\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx4ukjus1kfcu.91fef275.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Жители поселка сетуют, что постоянно вынуждены ходить в резиновых сапогах, а о дорогой обуви они&nbsp; вообще перестали думать.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660203\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx47fq42dhmtq.9b5734be.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Асфальтированная дорога и свет есть только на главной улице поселка.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660206\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2fhnh3uifv3g.ba88291d.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Также в поселке повсеместно на глаза попадаются отходы \"жизнедеятельности\" местных жителей, вынужденных жить рядом с этими помойками.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660207\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2amrpfvrkubg.766e4c14.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Чего здесь только нет: бутылки из-под спиртного, консервные банки, рваные калоши и даже трупы домашнего скота.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660209\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx54bro059jio.98ed7ec0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Жители и рады бы не мусорить и даже готовы платить за его вывоз, только вот акимат почему-то уже много лет эту проблему игнорирует.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660211 size-large\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx59j881d5gpp.b3fd919c.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		БИКЕШ\r\n	</p>\r\n</div>\r\n<p>\r\n	По словам Бикеш, которая живет здесь с самого рождения, жители не раз обращались с просьбой установить мусорные баки.\r\n</p>\r\n<p>\r\n	«<em><strong>Сплошь и рядом горы мусора, по дорогам невозможно ходить. Летом тут стоит такая вонь, что просто нет сил. В поселке просто некуда выбрасывать мусор. Кто-то сжигает мусор в печках, кто-то закапывает, а многие просто выбрасывают на улицу. Мы просили поставить мусорные баки возле домов, мы готовы платить сколько угодно. Так же нельзя жить. Мы получается сами утопаем в своем же мусоре от безысходности</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660214\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx1njp0jh0r5fg.f51c2fbc.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Мусором питается даже местный скот. Страшно представить, какое молоко дают потом эти коровы.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660216\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx21gen4rsevrg.b97b63b0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Депрессивный поселок пугает своей чернотой и погрязшими в мусоре улицами.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone size-large wp-image-1660217\" alt=\"Жители Рабочего поселка: Живем в шахтерской столице, а угля нет. Смеяться или плакать? (фото)\" src=\"https://i.onthe.io/pogudx2qdq11i72h5g.1f52e5eb.jpg\" width=\"800\" height=\"533\" /> \r\n</div>', '2017-10-30 11:04:00', '/media/2017/11/15/132674_original.jpg', 1, '1', '1', NULL, NULL, NULL, '2017-10-30 11:08:42', '2017-11-29 19:17:43', NULL, 'Карагандинская Область, депрессия', 58, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Карагандинская Область, депрессия', 'Карагандинская Область, депрессия', 'Администратор', 'Администратор', 'Администратор', '0', 'Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)', '<p class=\"h2\">\r\n	Ji\'teli\' Raboc\'ego poselka Karagandi\'nskoi\' oblasti\' pereji\'vayut ne ly\'c\'s\'i\'e vremena. Mestnost stala y\'topat v my\'sore i\'z-za otsy\'tstvi\'ya mas\'i\'n dlya sbora i\' vyvoza bytovyh othodov, po dorogam vse slojnee hodi\'t, a v nekotoryh domah lyudi\' vyny\'jdeny merzny\'t bez y\'glya. Korrespondenty <a href=\"https://www.nur.kz/\"><span>NUR.KZ</span></a> posmotreli\', v kaki\'h y\'slovi\'yah ji\'vy\'t lyudi\' v pri\'gorode Karagandy.\r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<div class=\"article__image article__none\">\r\n	<u><img class=\"alignnone size-large wp-image-1660174\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx7i67v7u31ts.ca878a40.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Poselok&nbsp;nahodi\'tsya v 20&nbsp;ki\'lometrah&nbsp;ot goroda. Transport ty\'t hodi\'t regy\'lyarno, odnako ji\'teli\' jaly\'yutsya, c\'to v c\'as pi\'k v obs\'estvennyi\' transport nevozmojno probi\'tsya.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660176\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx7ocdgafop4u.79a09b3e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Vsego zdes ji\'vy\'t poc\'ti\' 15 tysyac\' c\'elovek, v Raboc\'em poselke - bols\'e 5 tysyac\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660181\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx1naqehr5eung.262875cf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Mnogi\'m pri\'hodi\'tsya kajdyi\' den ezdi\'t v gorod na zarabotki\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660182\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx1ssg939rva0g.ab3356f0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	V Raboc\'em poselke vsego odna detskaya plos\'adka, i\' py\'t k nei\' prolojen c\'erez most.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660184\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx3hi2d5afo5u.c317f1d4.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Poetomy\' mnogi\'e deti\' vyny\'jdeny i\'grat na gryaznyh dorogah i\' daje sredi\' my\'sora.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660185\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudxd907vfskddg.b5c0c064.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Po slovam mestnyh ji\'telei\', s&nbsp;y\'glem y\' ni\'h v etom gody\' bols\'i\'e problemy.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660188 size-large\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx569sma59pra.b3bf3464.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		JANAT\r\n	</p>\r\n</div>\r\n<p>\r\n	Janat pereehal v etot poselok 15 let nazad i\'z Mai\'ky\'dy\'ka. Govori\'t, c\'to zahotelos ji\'t v svoem dome. Po slovam my\'jc\'i\'ny, ego semya do si\'h por vyny\'jdena i\'spolzovat pros\'logodni\'e zapasy y\'glya, kotorye y\'je na i\'shode.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660190\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx6uaolbrho26.03c737c8.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\">\r\n</div>\r\n<p>\r\n	«<em><strong>Horos\'o, c\'to s pros\'loi\' zi\'my hot nemnogo y\'glya ostalos, a to by voobs\'e ne znali\', c\'to delat. Ya sdelal zakaz na y\'gol nedelyu nazad, i\' mne do si\'h por ego ne pri\'vezli\'. Govoryat, c\'to prosto net y\'glya. Ya proboval sam ezdi\'t na mesta, gde obyc\'no prodayut y\'gol, i\' y\'vi\'del ogromnye oc\'eredi\'. A es\'e govoryat, c\'to problem net s y\'glem. Kak net, esli\' tsena stala v dva-tri\' raza vys\'e. V pros\'lom gody\' my poky\'pali\' tonny\' y\'glya za 6-7 tysyac\' tenge, a v etom gody\' prodayut za 12-15 tysyac\' y\'glya. Gde eto vi\'dano voobs\'e? My vrode by ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat?</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660192 size-large\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx6f8kdla6567.cb7c43bd.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		NASYP\r\n	</p>\r\n</div>\r\n<p>\r\n	Nasyp - odna i\'z sc\'astli\'vi\'ts, kotorym y\'dalos ky\'pi\'t y\'gol po staroi\' tsene. Odnako kac\'estvom jens\'i\'na nedovolna.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660221\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx21mc5tm4p9p.2ecd740e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Ya y\'spela ky\'pi\'t y\'gol v sentyabre za 7 tysyac\' tenge za tonny\', tolko tret etogo y\'glya li\'bo prosto pyl, li\'bo s\'lak. Vse ravno pri\'detsya poky\'pat es\'e</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660193 size-large\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx22d578gua5o.94d5cee6.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		ALMA\r\n	</p>\r\n</div>\r\n<p>\r\n	Selc\'anka Alma takje jaly\'etsya na y\'gol. Govori\'t, on sli\'s\'kom podnyalsya v tsene.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660195\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudxkaobuaqqeco.3f5cec59.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>V zavi\'si\'mosti\' ot razmera doma, lyudyam ny\'jno ot 10 do 20 tonn y\'glya za otopi\'telnyi\' sezon. Zi\'ma y\' nas dolgaya, dli\'tsya poc\'ti\' polgoda. Sami\' poni\'maete, c\'to lyudi\' y\' nas vse prostye, bogatye ty\'t ne ji\'vy\'t. Vse ji\'vem ot zarplaty do zarplaty, i\' v etom gody\' y\'gol si\'lno y\'dari\'l po nas\'i\'m karmanam</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660196\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx6vb9rispaj6.7ce1c9b7.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Esli\' problemy s y\'glem vozni\'kli\' tolko v etom gody\', to y\'jasnye dorogi\' i\' my\'sor - bolnoe mesto ji\'telei\' poselka.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660197\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx3qm1k32c7mv.012bf74c.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Pryamo vozle doma Nasyp tri\' goda nazad «Karagandy Sy\'» provodi\'li\' try\'by\', a posle remontnyh rabot dorogy\' v poryadok tak i\' ne pri\'veli\'. Vproc\'em, v poselke vse dorogi\' v plac\'evnom sostoyani\'i\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660198\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx4kcf6bmu40a.d69f6acf.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	I\'z-za eti\'h dorog skoraya pomos\' i\' taksi\' prosto otkazyvayutsya ehat syuda.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660199 size-large\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx5dbom9vmr6k.fdf00eb2.jpg\" width=\"401\" height=\"600\" /></u> \r\n	<p>\r\n		AI\'TBAI\'\r\n	</p>\r\n</div>\r\n<p>\r\n	Mestnyi\' ji\'tel Ai\'tbai\' pri\'znaetsya, c\'to pomos\'i\' y\'je ne jdet i\' c\'to vlasti\' goroda nac\'ny\'t remonti\'rovat dorogi\' on ne veri\'t.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660200\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx6la4bg00nju.436ce98e.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	«<em><strong>Postoyanno nam govoryat: \"I\'di\'te, jaly\'i\'tes, podni\'mai\'te s\'y\'m, govori\'te o svoei\' probleme\". Poc\'emy\' v nas\'ei\' strane vse tolko tak res\'aetsya? Poc\'emy\' narod vsegda c\'to-to doljen delat, i\'steri\'t i\' bi\'t v gry\'d, c\'toby ego y\'slys\'ali\'? Ya plac\'y\' nalogi\', ya zakonoposly\'s\'nyi\' grajdani\'n, ya takoi\' je ji\'tel etoi\' strany, kak i\' c\'i\'novni\'ki\'. I\'z goda v god problema s eti\'mi\' dorogami\' i\' my\'sorom. Ney\'jeli\' eto nevozmojno res\'i\'t?</strong></em>»\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660202\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx4ukjus1kfcu.91fef275.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Ji\'teli\' poselka sety\'yut, c\'to postoyanno vyny\'jdeny hodi\'t v rezi\'novyh sapogah, a o dorogoi\' oby\'vi\' oni\'&nbsp; voobs\'e perestali\' dy\'mat.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660203\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx47fq42dhmtq.9b5734be.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Asfalti\'rovannaya doroga i\' svet est tolko na glavnoi\' y\'li\'tse poselka.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660206\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx2fhnh3uifv3g.ba88291d.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Takje v poselke povsemestno na glaza popadayutsya othody \"ji\'znedeyatelnosti\'\" mestnyh ji\'telei\', vyny\'jdennyh ji\'t ryadom s eti\'mi\' pomoi\'kami\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660207\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx2amrpfvrkubg.766e4c14.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	C\'ego zdes tolko net: by\'tylki\' i\'z-pod spi\'rtnogo, konservnye banki\', rvanye kalos\'i\' i\' daje try\'py domas\'nego skota.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660209\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx54bro059jio.98ed7ec0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Ji\'teli\' i\' rady by ne my\'sori\'t i\' daje gotovy plati\'t za ego vyvoz, tolko vot aki\'mat poc\'emy\'-to y\'je mnogo let ety\' problemy\' i\'gnori\'ry\'et.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"wp-image-1660211 size-large\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx59j881d5gpp.b3fd919c.jpg\" width=\"800\" height=\"533\" /></u> \r\n	<p>\r\n		BI\'KES\'\r\n	</p>\r\n</div>\r\n<p>\r\n	Po slovam Bi\'kes\', kotoraya ji\'vet zdes s samogo rojdeni\'ya, ji\'teli\' ne raz obras\'ali\'s s prosboi\' y\'stanovi\'t my\'sornye baki\'.\r\n</p>\r\n<p>\r\n	«<em><strong>Splos\' i\' ryadom gory my\'sora, po dorogam nevozmojno hodi\'t. Letom ty\'t stoi\'t takaya von, c\'to prosto net si\'l. V poselke prosto neky\'da vybrasyvat my\'sor. Kto-to sji\'gaet my\'sor v pec\'kah, kto-to zakapyvaet, a mnogi\'e prosto vybrasyvayut na y\'li\'tsy\'. My prosi\'li\' postavi\'t my\'sornye baki\' vozle domov, my gotovy plati\'t skolko y\'godno. Tak je nelzya ji\'t. My poly\'c\'aetsya sami\' y\'topaem v svoem je my\'sore ot bezyshodnosti\'</strong></em>».\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660214\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx1njp0jh0r5fg.f51c2fbc.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	My\'sorom pi\'taetsya daje mestnyi\' skot. Stras\'no predstavi\'t, kakoe moloko dayut potom eti\' korovy.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<u><img class=\"alignnone size-large wp-image-1660216\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx21gen4rsevrg.b97b63b0.jpg\" width=\"800\" height=\"533\" /></u> \r\n</div>\r\n<p>\r\n	Depressi\'vnyi\' poselok py\'gaet svoei\' c\'ernotoi\' i\' pogryazs\'i\'mi\' v my\'sore y\'li\'tsami\'.\r\n</p>\r\n<div class=\"article__image article__none\">\r\n	<div class=\"share-image\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone size-large wp-image-1660217\" alt=\"Ji\'teli\' Raboc\'ego poselka: Ji\'vem v s\'ahterskoi\' stoli\'tse, a y\'glya net. Smeyatsya i\'li\' plakat? (foto)\" src=\"https://i.onthe.io/pogudx2qdq11i72h5g.1f52e5eb.jpg\" width=\"800\" height=\"533\" /> \r\n</div>', '', 'Karagandi\'nskaya Oblast, depressi\'ya', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 1);
INSERT INTO `news` (`news_id`, `news_name_ru`, `news_text_ru`, `news_name_kz`, `news_text_kz`, `news_name_en`, `news_text_en`, `news_date`, `news_image`, `user_id`, `news_icon`, `is_show`, `news_desc_ru`, `news_desc_en`, `news_desc_kz`, `created_at`, `updated_at`, `deleted_at`, `tag_ru`, `view_count`, `news_meta_description_kz`, `news_meta_description_ru`, `news_meta_description_en`, `news_meta_keywords_kz`, `news_meta_keywords_ru`, `news_meta_keywords_en`, `tag_kz`, `tag_en`, `author_kz`, `author_ru`, `author_en`, `is_audio`, `news_name_qz`, `news_text_qz`, `news_desc_qz`, `tag_qz`, `author_qz`, `news_meta_description_qz`, `news_meta_keywords_qz`, `is_watermark`) VALUES
(201, '\"Апострофы могут измениться\". Что будет происходить с латиницей дальше', '<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">\"Мы со стороны фонда сейчас разрабатываем мобильное приложение с новым алфавитом для смартфонов. В скором времени уже откроем, приступим. (..) Например, вы на кириллице будете набирать, а там на новом алфавите на латинице будет выходить. Мы не правительственная организация, не НПО, мы к государственному отношения не имеем. Мы помогаем государственным органам и народу сотрудничать\", - заключил он.</span>', '\"Апострофтар өзгеруі мүмкін\" - Cарапшы латын әліпбиі жайында', '<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">\"Білім және ғылым министрі айтып өткендей, еліміздегі білім беру мекемелерінің барлығында апробация жүргізіледі. Оның қорытындысы бойынша біздің&nbsp;<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">желерді құрастыратын болады. Апострофтар өзгеруі мүмкін. Бұл әліпби бекітілді болды деген сөз емес. Апробация қорытындысы бойынша біздегі тоғыз әріпті қолдануға ыңғайлы болатындай етіп өзгерте аламыз\", - деді&nbsp;Азат Шәуеев.</span></span><br />', '\"Апострофы могут измениться\". Что будет происходить с латиницей дальше', '<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">\"Мы со стороны фонда сейчас разрабатываем мобильное приложение с новым алфавитом для смартфонов. В скором времени уже откроем, приступим. (..) Например, вы на кириллице будете набирать, а там на новом алфавите на латинице будет выходить. Мы не правительственная организация, не НПО, мы к государственному отношения не имеем. Мы помогаем государственным органам и народу сотрудничать\", - заключил он.</span>', '2017-11-07 11:21:00', '/media/2017/11/07/photo_231360.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-11-07 11:30:55', '2017-11-29 08:34:30', NULL, 'Латиница, Казахстан, Апостроф', 60, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Латиница, Казахстан, Апостроф', 'Латиница, Казахстан, Апостроф', 'Администратор', 'Администратор', 'Администратор', '0', '\"Apostroftar o\'zgery\'i mu\'mkin\" - Caraps\'y latyn a\'lipbi\'i jai\'ynda', '<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">\"Bilim ja\'ne g\'ylym mi\'ni\'stri ai\'typ o\'tkendei\', elimizdegi bilim bery\' mekemelerinin\' barlyg\'ynda aprobatsi\'ya ju\'rgiziledi. Onyn\' qorytyndysy boi\'yns\'a bizdin\'&nbsp;<span style=\"color:#222222;font-family:Consolas, &quot;background-color:#FFFFFF;\">jelerdi qurastyratyn bolady. Apostroftar o\'zgery\'i mu\'mkin. Bul a\'lipbi\' bekitildi boldy degen so\'z emes. Aprobatsi\'ya qorytyndysy boi\'yns\'a bizdegi tog\'yz a\'ripti qoldany\'g\'a yn\'g\'ai\'ly bolatyndai\' etip o\'zgerte alamyz\", - dedi&nbsp;Azat S\'a\'y\'eev.</span></span><br />', '', '', '', '', 0, 0),
(202, 'Как выглядят сын и дочь Турсенгали Алагузова', '<p class=\"h2\" style=\"text-align:justify;font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Имя бизнесмена Турсенгали Алагузова приобрело популярность среди казахстанцев после того, как его роман с продюсером и актрисой Баян Есентаевой стал достоянием общественности. В августе 2017 года предприниматель развелся с первой супругой Ляйсирой. В этом браке супруги воспитали двух детей - Амину и Арсена, передает&nbsp;</span><a href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\">NUR.KZ</span></a><span style=\"font-size:12px;\">.</span> \r\n</p>\r\n<p class=\"h2\" style=\"text-align:justify;font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669055 size-large\" src=\"https://i.onthe.io/pogudx3tak1cqpakl.d15d6595.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"462\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"background-color:#FFFFFF;font-family:Tinos, Georgia, Times, serif;font-size:12px;\">Дети уже взрослые - Амине 27 лет, а Арсену 21 год.</span> \r\n	</p>\r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669049 size-large\" src=\"https://i.onthe.io/pogudx7gksbfe6bjn.ad9c9e0a.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"648\" height=\"600\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">ТУРСЕНГАЛИ АЛАГУЗОВ С ОТЦОМ И СЫНОМ. ФОТО: HOMMES.KZ</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Как известно, наследники Алагузова получили образование за рубежом. Оба отучились в учебных заведениях Великобритании.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669056 size-large\" src=\"https://i.onthe.io/pogudx6s47balfarm.b8b7877d.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">АРСЕН АЛАГУЗОВ. ФОТО: FACEBOOK.COM/ARSEN.ALAGUZOV</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Арсен учился в Уорикширкском международном колледже (Warwickshire College), который закончил, судя по информации на его странице в Facebook, в 2015 году.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone wp-image-1669059 size-large\" src=\"https://i.onthe.io/pogudx69v5odi42p7.f6b81df0.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">К слову, Арсен не особо активен в соцсетях, большинство фотографий опубликованы в 2014-2015 годах.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone wp-image-1669057 size-large\" src=\"https://i.onthe.io/pogudx3nd73sgli3q.6e925a90.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone wp-image-1669050 size-large\" src=\"https://i.onthe.io/pogudx1nomj56mb8a8.7a50ebc8.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"450\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1669032-kak-vyglyadyat-syn-doch-tursengali-ala.html%3Fimage%3D7\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\"><span style=\"font-size:12px;\">Поделиться в Facebook</span></a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1669032-kak-vyglyadyat-syn-doch-tursengali-ala.html%3Fimage%3D7\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\"><span style=\"font-size:12px;\">Рассказать Вконтакте</span></a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1669058 size-large\" src=\"https://i.onthe.io/pogudxum7t1umgddk.1a1201b4.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"wp-image-1669048 size-full\" src=\"https://i.onthe.io/pogudx1ovsv8bue9do.009f0e51.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"600\" height=\"827\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">ФОТО HOMMES.KZ</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Амина закончила университет Манчестера (University of Manchester).</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"wp-image-1669053 size-large\" src=\"https://i.onthe.io/pogudx3oa4sju6itrg.ef3ccb8b.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"600\" height=\"600\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">ФОТО СО СТРАНИЦЫ АМИНЫ АЛАГУЗОВОЙ В VK.COM</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">По ее странице в соцсети \"ВКонтакте\" можно понять, что Амина - человек творческий, она любит художественные фото.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone wp-image-1669054 size-large\" src=\"https://i.onthe.io/pogudx3d6dlrmd1co.b53cbb32.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"479\" styl