n> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone wp-image-1669054 size-large\" src=\"https://i.onthe.io/pogudx3d6dlrmd1co.b53cbb32.jpg\" alt=\"Как выглядят сын и дочь Турсенгали Алагузова\" width=\"800\" height=\"479\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\"></span> \r\n</p>', '2017-11-08 11:34:00', '/media/2017/11/08/рухани жангыру.jpg', 1, '1', '1', NULL, NULL, NULL, '2017-11-08 11:38:08', '2017-11-29 19:15:39', NULL, 'Турсенгали Алагузов, Турсен Алагузов', 71, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Турсенгали Алагузов, Турсен Алагузов', 'Турсенгали Алагузов, Турсен Алагузов', 'Администратор', 'Администратор', 'Администратор', '0', 'Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova', '<p class=\"h2\" style=\"text-align:justify;font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">I\'mya bi\'znesmena Ty\'rsengali\' Alagy\'zova pri\'obrelo popy\'lyarnost sredi\' kazahstantsev posle togo, kak ego roman s prodyuserom i\' aktri\'soi\' Bayan Esentaevoi\' stal dostoyani\'em obs\'estvennosti\'. V avgy\'ste 2017 goda predpri\'ni\'matel razvelsya s pervoi\' sy\'pry\'goi\' Lyai\'si\'roi\'. V etom brake sy\'pry\'gi\' vospi\'tali\' dvy\'h detei\' - Ami\'ny\' i\' Arsena, peredaet&nbsp;</span><a href=\"http://www.nur.kz/\"><span style=\"font-size:12px;\">NUR.KZ</span></a><span style=\"font-size:12px;\">.</span> \r\n</p>\r\n<p class=\"h2\" style=\"text-align:justify;font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669055 size-large\" src=\"https://i.onthe.io/pogudx3tak1cqpakl.d15d6595.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"462\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"background-color:#FFFFFF;font-family:Tinos, Georgia, Times, serif;font-size:12px;\">Deti\' y\'je vzroslye - Ami\'ne 27 let, a Arseny\' 21 god.</span> \r\n	</p>\r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669049 size-large\" src=\"https://i.onthe.io/pogudx7gksbfe6bjn.ad9c9e0a.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"648\" height=\"600\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">TY\'RSENGALI\' ALAGY\'ZOV S OTTsOM I\' SYNOM. FOTO: HOMMES.KZ</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Kak i\'zvestno, nasledni\'ki\' Alagy\'zova poly\'c\'i\'li\' obrazovani\'e za ry\'bejom. Oba oty\'c\'i\'li\'s v y\'c\'ebnyh zavedeni\'yah Veli\'kobri\'tani\'i\'.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"wp-image-1669056 size-large\" src=\"https://i.onthe.io/pogudx6s47balfarm.b8b7877d.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">ARSEN ALAGY\'ZOV. FOTO: FACEBOOK.COM/ARSEN.ALAGUZOV</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Arsen y\'c\'i\'lsya v Y\'ori\'ks\'i\'rkskom mejdy\'narodnom kolledje (Warwickshire College), kotoryi\' zakonc\'i\'l, sy\'dya po i\'nformatsi\'i\' na ego strani\'tse v Facebook, v 2015 gody\'.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone wp-image-1669059 size-large\" src=\"https://i.onthe.io/pogudx69v5odi42p7.f6b81df0.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">K slovy\', Arsen ne osobo akti\'ven v sotssetyah, bols\'i\'nstvo fotografi\'i\' opy\'bli\'kovany v 2014-2015 godah.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone wp-image-1669057 size-large\" src=\"https://i.onthe.io/pogudx3nd73sgli3q.6e925a90.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone wp-image-1669050 size-large\" src=\"https://i.onthe.io/pogudx1nomj56mb8a8.7a50ebc8.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"450\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<a href=\"https://www.facebook.com/sharer/sharer.php?u=https%3A%2F%2Fwww.nur.kz%2F1669032-kak-vyglyadyat-syn-doch-tursengali-ala.html%3Fimage%3D7\" target=\"_blank\" class=\"js-share share-image__button share-image__button--fb\"><span style=\"font-size:12px;\">Podeli\'tsya v Facebook</span></a><a href=\"https://vk.com/share.php?url=https%3A%2F%2Fwww.nur.kz%2F1669032-kak-vyglyadyat-syn-doch-tursengali-ala.html%3Fimage%3D7\" target=\"_blank\" class=\"js-share share-image__button share-image__button--vk\"><span style=\"font-size:12px;\">Rasskazat Vkontakte</span></a> \r\n	</div>\r\n<img class=\"alignnone wp-image-1669058 size-large\" src=\"https://i.onthe.io/pogudxum7t1umgddk.1a1201b4.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"400\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"wp-image-1669048 size-full\" src=\"https://i.onthe.io/pogudx1ovsv8bue9do.009f0e51.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"600\" height=\"827\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">FOTO HOMMES.KZ</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Ami\'na zakonc\'i\'la y\'ni\'versi\'tet Manc\'estera (University of Manchester).</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"wp-image-1669053 size-large\" src=\"https://i.onthe.io/pogudx3oa4sju6itrg.ef3ccb8b.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"600\" height=\"600\" style=\"width:692.5px;height:auto;\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:12px;\">FOTO SO STRANI\'TsY AMI\'NY ALAGY\'ZOVOI\' V VK.COM</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\">Po ee strani\'tse v sotsseti\' \"VKontakte\" mojno ponyat, c\'to Ami\'na - c\'elovek tvorc\'eski\'i\', ona lyubi\'t hy\'dojestvennye foto.</span> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<div class=\"share-image\" style=\"padding:1.25em;font-size:0.8em;\">\r\n		<br />\r\n	</div>\r\n<img class=\"alignnone wp-image-1669054 size-large\" src=\"https://i.onthe.io/pogudx3d6dlrmd1co.b53cbb32.jpg\" alt=\"Kak vyglyadyat syn i\' doc\' Ty\'rsengali\' Alagy\'zova\" width=\"800\" height=\"479\" style=\"width:692.5px;height:auto;\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:12px;\"></span> \r\n</p>', '', 'Ty\'rsengali\' Alagy\'zov, Ty\'rsen Alagy\'zov', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0);
INSERT INTO `news` (`news_id`, `news_name_ru`, `news_text_ru`, `news_name_kz`, `news_text_kz`, `news_name_en`, `news_text_en`, `news_date`, `news_image`, `user_id`, `news_icon`, `is_show`, `news_desc_ru`, `news_desc_en`, `news_desc_kz`, `created_at`, `updated_at`, `deleted_at`, `tag_ru`, `view_count`, `news_meta_description_kz`, `news_meta_description_ru`, `news_meta_description_en`, `news_meta_keywords_kz`, `news_meta_keywords_ru`, `news_meta_keywords_en`, `tag_kz`, `tag_en`, `author_kz`, `author_ru`, `author_en`, `is_audio`, `news_name_qz`, `news_text_qz`, `news_desc_qz`, `tag_qz`, `author_qz`, `news_meta_description_qz`, `news_meta_keywords_qz`, `is_watermark`) VALUES
(203, 'Десять захватывающих мест', '<p class=\"h2\" style=\"font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Каждый человек хоть раз в жизни мечтает покинуть насиженное место и улететь, а то и уплыть на далекий остров, чтобы до конца жизни наслаждаться теплым песком и ласковым солнцем. Некоторым больше по душе зеленые джунгли или заснеженные вершины гор, но суть одна – далекие заморские места манят нас своей романтичной неизведанностью.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"http://bigpicture.ru/\" target=\"_blank\"><span style=\"font-size:14px;\">Bigpicture.ru</span></a><span style=\"font-size:14px;\">&nbsp;представляет десять захватывающих мест, где можно начать новую жизнь, не тратя на это миллионы «зеленых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">1. Аваруа, острова Кука</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\"><img src=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\" alt=\"\" /></a><br />\r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:14px;\">ФОТО BIGPICTURE.RU</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Являются частью Новой Зеландии, хоть и расположены более чем в двух тысячах километров от нее. Аренда жилья обойдется за 130 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Переехав сюда, вы сможете любоваться китами и великолепными пейзажами, ходить в походы.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Единственная проблема – покупка недвижимости иностранцами запрещена, можно только арендовать ее на 60 лет.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">2. Чески Крумлов, Чешская Республика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668531\" src=\"https://i.onthe.io/pogudx6llnfubfirs.e8d8ea64.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"531\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Городок в чешской провинции Богемия напоминает один огромный средневековый замок. Славится неповторимым Фестивалем роз и ярмарками в стиле Ренессанса.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Обед из трех блюд на двоих стоит 20 долларов, а аренда квартиры – 400 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Река Влтава станет постоянным местом обитания для любителей рафтинга.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">3. Ко Тонсай, Камбоджа</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668532\" src=\"https://i.onthe.io/pogudx20eh4mkbgasg.e9931a5c.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"429\" /> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\" style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Просто рай из джунглей и пляжей, в котором живут лишь немногочисленные рыбацкие семьи. Бунгало для обитания стоит смешных денег.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Желающие здесь поселиться смогут отдыхать на пляже или исследовать местную пещеру в джунглях. Свежий вкусный ужин из краба обойдется в 5 долларов. Из любых других морепродуктов – в 1-2 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Идеальное место для тех, кто хочет сбежать от цивилизации.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">4. Гуанахуато, Мексика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668533\" src=\"https://i.onthe.io/pogudx1acv2rqd7epg.c423df4f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"450\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Культурно развитый город, хорошую квартиру в котором можно снять за 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь проходит известный фестиваль искусств Cervantino, названный в честь автора романа о Дон Кихоте.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">5. Жемчужные острова, Панама</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668534\" src=\"https://i.onthe.io/pogudx841va121q4a.ef1f5bf5.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"448\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Удивительный архипелаг в Тихом океане, где когда-то здесь добывали жемчуг, а пираты прятались от властей. Здесь же снимали три сезона сериала «Остаться в живых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Домик на берегу моря обойдется вам всего за 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">6. Пляжи Агонда, Гоа, Индия</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668535\" src=\"https://i.onthe.io/pogudx7h16f8ju4iv.2723f8fc.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"425\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно покататься на слонах прямо на территории пляжа. Бутылка вина стоит полдоллара, а жилье на берегу моря – 120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Кроме того, в этом месте очень много храмов и мест для занятия йогой.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">7. Велико Тырново, Болгария</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668536\" src=\"https://i.onthe.io/pogudx7udpl7f5mio.60f03543.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"434\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Один из самых уютных городков на Болгарской Ривьере. По красоте место не уступает Франции. Население состоит из 200 тысяч человек.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Квартиру арендуют за 200 долларов в месяц. Бутылка пива стоит 0,80 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">8. Хо Кок-Бич, Вьетнам</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668537\" src=\"https://i.onthe.io/pogudx4i933lfnkp2.2fbb4201.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"431\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">На юго-востоке страны расположены 11 тысяч гектаров тропического леса. Идеальное место для дайвинга и подводной охоты, где есть гигантский барьерный риф.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Аренда недвижимости стоит 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">9. Ксамил Бич, Албания</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668538\" src=\"https://i.onthe.io/pogudx15l07rp2bb78.fbce5a47.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"488\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Место подходит для любителей спокойной и размеренной жизни в средиземноморском климате. Жилье обойдется вам в 100-120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно купить 30 видов рыбы, средняя цена блюд в кафе — 6 долларов.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">10. Лас Транкас, Чили</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668539\" src=\"https://i.onthe.io/pogudx32pteiq9ps8.2325508f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"458\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">В этом прекрасном месте расположены одни из лучших горных склонов Южной Америки. Кататься на лыжах можно весь год, а снять жилье стоит всего 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Приезжие столкнутся только с одной проблемой – здесь почти всегда зима.</span> \r\n</p>', 'Десять захватывающих мест', '<p class=\"h2\" style=\"font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Каждый человек хоть раз в жизни мечтает покинуть насиженное место и улететь, а то и уплыть на далекий остров, чтобы до конца жизни наслаждаться теплым песком и ласковым солнцем. Некоторым больше по душе зеленые джунгли или заснеженные вершины гор, но суть одна – далекие заморские места манят нас своей романтичной неизведанностью.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"http://bigpicture.ru/\" target=\"_blank\"><span style=\"font-size:14px;\">Bigpicture.ru</span></a><span style=\"font-size:14px;\">&nbsp;представляет десять захватывающих мест, где можно начать новую жизнь, не тратя на это миллионы «зеленых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">1. Аваруа, острова Кука</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\"><img src=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\" alt=\"\" /></a><br />\r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:14px;\">ФОТО BIGPICTURE.RU</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Являются частью Новой Зеландии, хоть и расположены более чем в двух тысячах километров от нее. Аренда жилья обойдется за 130 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Переехав сюда, вы сможете любоваться китами и великолепными пейзажами, ходить в походы.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Единственная проблема – покупка недвижимости иностранцами запрещена, можно только арендовать ее на 60 лет.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">2. Чески Крумлов, Чешская Республика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668531\" src=\"https://i.onthe.io/pogudx6llnfubfirs.e8d8ea64.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"531\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Городок в чешской провинции Богемия напоминает один огромный средневековый замок. Славится неповторимым Фестивалем роз и ярмарками в стиле Ренессанса.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Обед из трех блюд на двоих стоит 20 долларов, а аренда квартиры – 400 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Река Влтава станет постоянным местом обитания для любителей рафтинга.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">3. Ко Тонсай, Камбоджа</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668532\" src=\"https://i.onthe.io/pogudx20eh4mkbgasg.e9931a5c.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"429\" /> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\" style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Просто рай из джунглей и пляжей, в котором живут лишь немногочисленные рыбацкие семьи. Бунгало для обитания стоит смешных денег.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Желающие здесь поселиться смогут отдыхать на пляже или исследовать местную пещеру в джунглях. Свежий вкусный ужин из краба обойдется в 5 долларов. Из любых других морепродуктов – в 1-2 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Идеальное место для тех, кто хочет сбежать от цивилизации.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">4. Гуанахуато, Мексика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668533\" src=\"https://i.onthe.io/pogudx1acv2rqd7epg.c423df4f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"450\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Культурно развитый город, хорошую квартиру в котором можно снять за 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь проходит известный фестиваль искусств Cervantino, названный в честь автора романа о Дон Кихоте.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">5. Жемчужные острова, Панама</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668534\" src=\"https://i.onthe.io/pogudx841va121q4a.ef1f5bf5.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"448\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Удивительный архипелаг в Тихом океане, где когда-то здесь добывали жемчуг, а пираты прятались от властей. Здесь же снимали три сезона сериала «Остаться в живых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Домик на берегу моря обойдется вам всего за 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">6. Пляжи Агонда, Гоа, Индия</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668535\" src=\"https://i.onthe.io/pogudx7h16f8ju4iv.2723f8fc.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"425\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно покататься на слонах прямо на территории пляжа. Бутылка вина стоит полдоллара, а жилье на берегу моря – 120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Кроме того, в этом месте очень много храмов и мест для занятия йогой.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">7. Велико Тырново, Болгария</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668536\" src=\"https://i.onthe.io/pogudx7udpl7f5mio.60f03543.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"434\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Один из самых уютных городков на Болгарской Ривьере. По красоте место не уступает Франции. Население состоит из 200 тысяч человек.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Квартиру арендуют за 200 долларов в месяц. Бутылка пива стоит 0,80 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">8. Хо Кок-Бич, Вьетнам</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668537\" src=\"https://i.onthe.io/pogudx4i933lfnkp2.2fbb4201.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"431\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">На юго-востоке страны расположены 11 тысяч гектаров тропического леса. Идеальное место для дайвинга и подводной охоты, где есть гигантский барьерный риф.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Аренда недвижимости стоит 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">9. Ксамил Бич, Албания</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668538\" src=\"https://i.onthe.io/pogudx15l07rp2bb78.fbce5a47.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"488\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Место подходит для любителей спокойной и размеренной жизни в средиземноморском климате. Жилье обойдется вам в 100-120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно купить 30 видов рыбы, средняя цена блюд в кафе — 6 долларов.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">10. Лас Транкас, Чили</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668539\" src=\"https://i.onthe.io/pogudx32pteiq9ps8.2325508f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"458\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">В этом прекрасном месте расположены одни из лучших горных склонов Южной Америки. Кататься на лыжах можно весь год, а снять жилье стоит всего 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Приезжие столкнутся только с одной проблемой – здесь почти всегда зима.</span> \r\n</p>', 'Десять захватывающих мест', '<p class=\"h2\" style=\"font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Каждый человек хоть раз в жизни мечтает покинуть насиженное место и улететь, а то и уплыть на далекий остров, чтобы до конца жизни наслаждаться теплым песком и ласковым солнцем. Некоторым больше по душе зеленые джунгли или заснеженные вершины гор, но суть одна – далекие заморские места манят нас своей романтичной неизведанностью.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"http://bigpicture.ru/\" target=\"_blank\"><span style=\"font-size:14px;\">Bigpicture.ru</span></a><span style=\"font-size:14px;\">&nbsp;представляет десять захватывающих мест, где можно начать новую жизнь, не тратя на это миллионы «зеленых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">1. Аваруа, острова Кука</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<img class=\"size-large wp-image-1668529\" src=\"https://i.onthe.io/pogudx7evmqegp42k.e2e43be7.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"438\" /> \r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:14px;\">ФОТО BIGPICTURE.RU</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Являются частью Новой Зеландии, хоть и расположены более чем в двух тысячах километров от нее. Аренда жилья обойдется за 130 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Переехав сюда, вы сможете любоваться китами и великолепными пейзажами, ходить в походы.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Единственная проблема – покупка недвижимости иностранцами запрещена, можно только арендовать ее на 60 лет.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">2. Чески Крумлов, Чешская Республика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668531\" src=\"https://i.onthe.io/pogudx6llnfubfirs.e8d8ea64.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"531\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Городок в чешской провинции Богемия напоминает один огромный средневековый замок. Славится неповторимым Фестивалем роз и ярмарками в стиле Ренессанса.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Обед из трех блюд на двоих стоит 20 долларов, а аренда квартиры – 400 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Река Влтава станет постоянным местом обитания для любителей рафтинга.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">3. Ко Тонсай, Камбоджа</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668532\" src=\"https://i.onthe.io/pogudx20eh4mkbgasg.e9931a5c.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"429\" /> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\" style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Просто рай из джунглей и пляжей, в котором живут лишь немногочисленные рыбацкие семьи. Бунгало для обитания стоит смешных денег.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Желающие здесь поселиться смогут отдыхать на пляже или исследовать местную пещеру в джунглях. Свежий вкусный ужин из краба обойдется в 5 долларов. Из любых других морепродуктов – в 1-2 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Идеальное место для тех, кто хочет сбежать от цивилизации.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">4. Гуанахуато, Мексика</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668533\" src=\"https://i.onthe.io/pogudx1acv2rqd7epg.c423df4f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"450\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Культурно развитый город, хорошую квартиру в котором можно снять за 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь проходит известный фестиваль искусств Cervantino, названный в честь автора романа о Дон Кихоте.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">5. Жемчужные острова, Панама</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668534\" src=\"https://i.onthe.io/pogudx841va121q4a.ef1f5bf5.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"448\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Удивительный архипелаг в Тихом океане, где когда-то здесь добывали жемчуг, а пираты прятались от властей. Здесь же снимали три сезона сериала «Остаться в живых».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Домик на берегу моря обойдется вам всего за 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">6. Пляжи Агонда, Гоа, Индия</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668535\" src=\"https://i.onthe.io/pogudx7h16f8ju4iv.2723f8fc.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"425\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно покататься на слонах прямо на территории пляжа. Бутылка вина стоит полдоллара, а жилье на берегу моря – 120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Кроме того, в этом месте очень много храмов и мест для занятия йогой.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">7. Велико Тырново, Болгария</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668536\" src=\"https://i.onthe.io/pogudx7udpl7f5mio.60f03543.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"434\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Один из самых уютных городков на Болгарской Ривьере. По красоте место не уступает Франции. Население состоит из 200 тысяч человек.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Квартиру арендуют за 200 долларов в месяц. Бутылка пива стоит 0,80 доллара.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">8. Хо Кок-Бич, Вьетнам</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668537\" src=\"https://i.onthe.io/pogudx4i933lfnkp2.2fbb4201.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"431\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">На юго-востоке страны расположены 11 тысяч гектаров тропического леса. Идеальное место для дайвинга и подводной охоты, где есть гигантский барьерный риф.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Аренда недвижимости стоит 150-200 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">9. Ксамил Бич, Албания</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668538\" src=\"https://i.onthe.io/pogudx15l07rp2bb78.fbce5a47.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"488\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Место подходит для любителей спокойной и размеренной жизни в средиземноморском климате. Жилье обойдется вам в 100-120 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Здесь можно купить 30 видов рыбы, средняя цена блюд в кафе — 6 долларов.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">10. Лас Транкас, Чили</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668539\" src=\"https://i.onthe.io/pogudx32pteiq9ps8.2325508f.jpg\" alt=\"10 райских мест, где просто и совсем недорого начать новую жизнь\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"458\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">В этом прекрасном месте расположены одни из лучших горных склонов Южной Америки. Кататься на лыжах можно весь год, а снять жилье стоит всего 300 долларов в месяц.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Приезжие столкнутся только с одной проблемой – здесь почти всегда зима.</span> \r\n</p>', '2017-11-08 11:43:00', '/media/2017/11/08/084624249200.jpg', 1, '1', '1', NULL, NULL, NULL, '2017-11-08 11:46:30', '2017-11-29 13:59:34', NULL, 'Туристы, острова', 106, 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Туристы, острова', 'Туристы, острова', 'Администратор', 'Администратор', 'Администратор', '0', 'Desyat zahvatyvayus\'i\'h mest', '<p class=\"h2\" style=\"font-size:0.9em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Kajdyi\' c\'elovek hot raz v ji\'zni\' mec\'taet poki\'ny\'t nasi\'jennoe mesto i\' y\'letet, a to i\' y\'plyt na daleki\'i\' ostrov, c\'toby do kontsa ji\'zni\' naslajdatsya teplym peskom i\' laskovym solntsem. Nekotorym bols\'e po dy\'s\'e zelenye djy\'ngli\' i\'li\' zasnejennye vers\'i\'ny gor, no sy\'t odna – daleki\'e zamorski\'e mesta manyat nas svoei\' romanti\'c\'noi\' nei\'zvedannostyu.</span> \r\n</p>\r\n<div class=\"fb-quote fb_iframe_widget\">\r\n	<br />\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"http://bigpicture.ru/\" target=\"_blank\"><span style=\"font-size:14px;\">Bigpicture.ru</span></a><span style=\"font-size:14px;\">&nbsp;predstavlyaet desyat zahvatyvayus\'i\'h mest, gde mojno nac\'at novy\'yu ji\'zn, ne tratya na eto mi\'lli\'ony «zelenyh».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">1. Avary\'a, ostrova Ky\'ka</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<a href=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\"><img src=\"/public/custom/wysiwyg/image/image/20171123/20171123161506_86654.jpg\" alt=\"\" /></a><br />\r\n	<p style=\"background:#F0F0F0;font-size:0.625em;font-family:Roboto, Helvetica, Ubuntu, Arial, sans-serif;color:#A8ACAC;\">\r\n		<span style=\"font-size:14px;\">FOTO BIGPICTURE.RU</span> \r\n	</p>\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Yavlyayutsya c\'astyu Novoi\' Zelandi\'i\', hot i\' raspolojeny bolee c\'em v dvy\'h tysyac\'ah ki\'lometrov ot nee. Arenda ji\'lya oboi\'detsya za 130 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Pereehav syuda, vy smojete lyubovatsya ki\'tami\' i\' veli\'kolepnymi\' pei\'zajami\', hodi\'t v pohody.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Edi\'nstvennaya problema – poky\'pka nedvi\'ji\'mosti\' i\'nostrantsami\' zapres\'ena, mojno tolko arendovat ee na 60 let.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">2. C\'eski\' Kry\'mlov, C\'es\'skaya Respy\'bli\'ka</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668531\" src=\"https://i.onthe.io/pogudx6llnfubfirs.e8d8ea64.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"531\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Gorodok v c\'es\'skoi\' provi\'ntsi\'i\' Bogemi\'ya napomi\'naet odi\'n ogromnyi\' srednevekovyi\' zamok. Slavi\'tsya nepovtori\'mym Festi\'valem roz i\' yarmarkami\' v sti\'le Renessansa.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Obed i\'z treh blyud na dvoi\'h stoi\'t 20 dollarov, a arenda kvarti\'ry – 400 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Reka Vltava stanet postoyannym mestom obi\'tani\'ya dlya lyubi\'telei\' rafti\'nga.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">3. Ko Tonsai\', Kambodja</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668532\" src=\"https://i.onthe.io/pogudx20eh4mkbgasg.e9931a5c.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"429\" /> \r\n</div>\r\n<div id=\"inpage_VI-188418-0-410804834\" style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Prosto rai\' i\'z djy\'nglei\' i\' plyajei\', v kotorom ji\'vy\'t li\'s\' nemnogoc\'i\'slennye rybatski\'e semi\'. By\'ngalo dlya obi\'tani\'ya stoi\'t smes\'nyh deneg.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Jelayus\'i\'e zdes poseli\'tsya smogy\'t otdyhat na plyaje i\'li\' i\'ssledovat mestny\'yu pes\'ery\' v djy\'nglyah. Sveji\'i\' vky\'snyi\' y\'ji\'n i\'z kraba oboi\'detsya v 5 dollarov. I\'z lyubyh dry\'gi\'h moreprody\'ktov – v 1-2 dollara.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">I\'dealnoe mesto dlya teh, kto hoc\'et sbejat ot tsi\'vi\'li\'zatsi\'i\'.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">4. Gy\'anahy\'ato, Meksi\'ka</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668533\" src=\"https://i.onthe.io/pogudx1acv2rqd7epg.c423df4f.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"450\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Ky\'lty\'rno razvi\'tyi\' gorod, horos\'y\'yu kvarti\'ry\' v kotorom mojno snyat za 150-200 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Zdes prohodi\'t i\'zvestnyi\' festi\'val i\'sky\'sstv Cervantino, nazvannyi\' v c\'est avtora romana o Don Ki\'hote.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">5. Jemc\'y\'jnye ostrova, Panama</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668534\" src=\"https://i.onthe.io/pogudx841va121q4a.ef1f5bf5.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"448\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Y\'di\'vi\'telnyi\' arhi\'pelag v Ti\'hom okeane, gde kogda-to zdes dobyvali\' jemc\'y\'g, a pi\'raty pryatali\'s ot vlastei\'. Zdes je sni\'mali\' tri\' sezona seri\'ala «Ostatsya v ji\'vyh».</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Domi\'k na beregy\' morya oboi\'detsya vam vsego za 300 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">6. Plyaji\' Agonda, Goa, I\'ndi\'ya</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668535\" src=\"https://i.onthe.io/pogudx7h16f8ju4iv.2723f8fc.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"425\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Zdes mojno pokatatsya na slonah pryamo na terri\'tori\'i\' plyaja. By\'tylka vi\'na stoi\'t poldollara, a ji\'le na beregy\' morya – 120 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Krome togo, v etom meste oc\'en mnogo hramov i\' mest dlya zanyati\'ya i\'ogoi\'.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">7. Veli\'ko Tyrnovo, Bolgari\'ya</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668536\" src=\"https://i.onthe.io/pogudx7udpl7f5mio.60f03543.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"434\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Odi\'n i\'z samyh y\'yutnyh gorodkov na Bolgarskoi\' Ri\'vere. Po krasote mesto ne y\'sty\'paet Frantsi\'i\'. Naseleni\'e sostoi\'t i\'z 200 tysyac\' c\'elovek.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Kvarti\'ry\' arendy\'yut za 200 dollarov v mesyats. By\'tylka pi\'va stoi\'t 0,80 dollara.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">8. Ho Kok-Bi\'c\', Vetnam</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668537\" src=\"https://i.onthe.io/pogudx4i933lfnkp2.2fbb4201.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"431\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Na yugo-vostoke strany raspolojeny 11 tysyac\' gektarov tropi\'c\'eskogo lesa. I\'dealnoe mesto dlya dai\'vi\'nga i\' podvodnoi\' ohoty, gde est gi\'gantski\'i\' barernyi\' ri\'f.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Arenda nedvi\'ji\'mosti\' stoi\'t 150-200 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">9. Ksami\'l Bi\'c\', Albani\'ya</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668538\" src=\"https://i.onthe.io/pogudx15l07rp2bb78.fbce5a47.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"488\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Mesto podhodi\'t dlya lyubi\'telei\' spokoi\'noi\' i\' razmerennoi\' ji\'zni\' v sredi\'zemnomorskom kli\'mate. Ji\'le oboi\'detsya vam v 100-120 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Zdes mojno ky\'pi\'t 30 vi\'dov ryby, srednyaya tsena blyud v kafe — 6 dollarov.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<strong><span style=\"font-size:14px;\">10. Las Trankas, C\'i\'li\'</span></strong> \r\n</p>\r\n<div class=\"article__image article__none\" style=\"margin:0px 0px 1.25em;\">\r\n	<img class=\"alignnone size-large wp-image-1668539\" src=\"https://i.onthe.io/pogudx32pteiq9ps8.2325508f.jpg\" alt=\"10 rai\'ski\'h mest, gde prosto i\' sovsem nedorogo nac\'at novy\'yu ji\'zn\" style=\"width:692.5px;height:auto;\" width=\"800\" height=\"458\" /> \r\n</div>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">V etom prekrasnom meste raspolojeny odni\' i\'z ly\'c\'s\'i\'h gornyh sklonov Yujnoi\' Ameri\'ki\'. Katatsya na lyjah mojno ves god, a snyat ji\'le stoi\'t vsego 300 dollarov v mesyats.</span> \r\n</p>\r\n<p style=\"font-family:Tinos, Georgia, Times, serif;font-size:20px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;\">Pri\'ezji\'e stolkny\'tsya tolko s odnoi\' problemoi\' – zdes poc\'ti\' vsegda zi\'ma.</span> \r\n</p>', '', 'Ty\'ri\'sty, ostrova', 'Admi\'ni\'strator', 'Taima.kz, novostnoi\' portal, novosti\' Kazahstana', 0, 0);
