(208, 'Русский', 'Русский', 'Қазақстан тумасы АҚШ-та сотта өз кінәсін мойындады', '<p>\r\n	<span style=\"font-size:16px;\">Yahoo компаниясына қарсы кибершабуылдар жасады деп айыпталған Қазақстан тумасы&nbsp;Карим Баратов&nbsp;Сан-Франциско сотында өз кінәсін мойындады. Бұл туралы АҚШ Әділет министрлігінің сайтында жарияланған мәлімдемеде айтылады, - деп хабарлайды РИА Новости. Басылымның мәліметінше, Баратовқа қатысты сот үкімі 20 ақпанға белгіленген сот отырысында шығады. Айта кетейік, тамыз айында ол өзінің кінәлі емес екенін мәлімдемеген болады. Ал кейінірек ол&nbsp;кепілмен босатуға рұқсат бермеген сот шешіміне шағым түсірген болатын. Еске сала кетейік,&nbsp; Қазақстанның 22 жастағы тумасы биыл наурыз айында&nbsp;қамауға алынып, ҚР СІМ өкілдерінің мәлімдеме жасағаны туралы хабарланған болатын.&nbsp;Ведомство өкілдері Баратовтың Қазақстан азаматы емес екенін мәлімдеді. Себебі, кейбір БАҚ-тар оны Қазақстан азаматы деп жатыр екен. Сондай-ақ, Баратовтың әлеуметтік желілердегі парақшаларынан оған тиесілі жоғары класстағы қымбат көліктерді - Mercedes, BMW, Aston Martin, көк түсті Lamborghini мен қара түсті Porsche көлігін көруге болады.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><img class=\"img-responsive\" src=\"https://vlast.kz/media/gallery_images/nb/1511523038ytka2_920x600.jpg\" alt=\"\" style=\"height:auto;\" /><a class=\"link-block\" href=\"https://vlast.kz/media/gallery_images/nb/1511523038ytka2.jpg\"><span class=\"icon icon--img-zoom\" style=\"vertical-align:middle;\"></span></a><i></i></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Test Test<br />\r\n</span><span style=\"font-size:16px;\"><a href=\"https://vlast.kz/media/gallery_images/ky/151152304031j8s_920x600.jpg\"><img src=\"https://vlast.kz/media/gallery_images/ky/151152304031j8s_920x600.jpg\" width=\"920\" height=\"600\" align=\"left\" alt=\"\" /></a> </span> \r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<br />', 'Русский', 'Русский', '2017-11-29 08:34:00', '/media/2017/11/29/1511523038ytka2_920x600.jpg', 1, '0', '1', NULL, NULL, NULL, '2017-11-29 08:36:25', '2017-11-29 18:33:40', NULL, 'Русский', 20, 'Taima.kz, халықаралық ақпараттық портал', 'Русский', 'Русский', 'Taima.kz, халықаралық ақпараттық портал', 'Taima.kz, новостной портал, новости Казахстана', 'Taima.kz, news of Kazakhstan', 'Taima.kz, халықаралық ақпараттық портал', 'Русский', 'Мен', 'Администратор', 'Администратор', '0', 'Qazaqstan ty\'masy AQS\'-ta sotta o\'z kina\'sin moi\'yndady', '<p>\r\n	<span style=\"font-size:16px;\">Yahoo kompani\'yasyna qarsy ki\'bers\'aby\'yldar jasady dep ai\'yptalg\'an Qazaqstan ty\'masy&nbsp;Kari\'m Baratov&nbsp;San-Frantsi\'sko sotynda o\'z kina\'sin moi\'yndady. Bul ty\'raly AQS\' A\'dilet mi\'ni\'strliginin\' sai\'tynda jari\'yalang\'an ma\'limdemede ai\'tylady, - dep habarlai\'dy RI\'A Novosti\'. Basylymnyn\' ma\'limetins\'e, Baratovqa qatysty sot u\'kimi 20 aqpang\'a belgilengen sot otyrysynda s\'yg\'ady. Ai\'ta ketei\'ik, tamyz ai\'ynda ol o\'zinin\' kina\'li emes ekenin ma\'limdemegen bolady. Al kei\'inirek ol&nbsp;kepilmen bosaty\'g\'a ruqsat bermegen sot s\'es\'imine s\'ag\'ym tu\'sirgen bolatyn. Eske sala ketei\'ik,&nbsp; Qazaqstannyn\' 22 jastag\'y ty\'masy bi\'yl nay\'ryz ai\'ynda&nbsp;qamay\'g\'a alynyp, QR SIM o\'kilderinin\' ma\'limdeme jasag\'any ty\'raly habarlang\'an bolatyn.&nbsp;Vedomstvo o\'kilderi Baratovtyn\' Qazaqstan azamaty emes ekenin ma\'limdedi. Sebebi, kei\'bir BAQ-tar ony Qazaqstan azamaty dep jatyr eken. Sondai\'-aq, Baratovtyn\' a\'ley\'mettik jelilerdegi paraqs\'alarynan og\'an ti\'esili jog\'ary klasstag\'y qymbat ko\'likterdi - Mercedes, BMW, Aston Martin, ko\'k tu\'sti Lamborghini men qara tu\'sti Porsche ko\'ligin ko\'ry\'ge bolady.</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><img class=\"img-responsive\" src=\"https://vlast.kz/media/gallery_images/nb/1511523038ytka2_920x600.jpg\" alt=\"\" style=\"height:auto;\" /><a class=\"link-block\" href=\"https://vlast.kz/media/gallery_images/nb/1511523038ytka2.jpg\"><span class=\"icon icon--img-zoom\" style=\"vertical-align:middle;\"></span></a><i></i></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Test Test<br />\r\n</span><span style=\"font-size:16px;\"><a href=\"https://vlast.kz/media/gallery_images/ky/151152304031j8s_920x600.jpg\"><img src=\"https://vlast.kz/media/gallery_images/ky/151152304031j8s_920x600.jpg\" width=\"920\" height=\"600\" align=\"left\" alt=\"\" /></a> </span> \r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<br />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><br />\r\n</span> \r\n</p>\r\n<br />', '', 'Taima.kz, halyqaralyq aqparattyq portal', 'Men', 'Taima.kz, halyqaralyq aqparattyq portal', 0, 1);
