(4, 'О проекте', 'Жоба жайында', 'About project', '<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Ердәулет Әбдімәлікұлы САДЫҚ\r\nбасшылық жасайтын &nbsp;«Ердаулет-Тайма-Баспасөз» жауапкершілігі\r\nшектеулі серіктестігі 2007 жылдың маусым айынан бері мерзімді басылымдарды\r\nжаздыртып, таратумен айналысып келеді. Алғашқы кезде 5 адамды тұрақты жұмыспен\r\nқамтып, жұмысын бастаған серіктестікте бүгінде 21 адам жұмыс жасауда.\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Арыс қаласымен бірге Шымкент,\r\nТүркістан қалалары және Сарыағаш, Ордабасы, Түлкібас, Отырар аудандарының\r\nтұрғындарын&nbsp; мерзімді басылымдармен&nbsp; қамтамасыз етуде.\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Биыл баспасөз саласында жұмыс\r\nістегеніне 10 жыл толып отырған «Ердаулет-Тайма-Баспасөз» ЖШС-і өздерінің\r\nкәсіби мерекесіне&nbsp; айтарлықтай\r\nтабыстармен келіп отыр. Республикалық «Егемен Қазақстан», «Казахстанская\r\nправда», «Айқын», «Қазақстан теміржолшысы» газеттері мен&nbsp; «Жұлдыздар отбасы», «Аңыз адам», «Мәдениет»,\r\n«Қазақстан әйелдері» журналдары, облыс орталығынан шығатын&nbsp; «Оңтүстік Қазақстан», «Южный Казахстан»,\r\n«Алтын босаға», «Замана», «Рейтинг» «Айғақ», «Алтын ұя»,«Қазығұрт КЗ»,\r\n«Мектеп», «Жас ғалым» секілді&nbsp; оқырманы\r\nкөп басылымдармен сенімді әріптес ретінде тығыз байланыс орнатып, аталмыш басылымдарды\r\nарыстықтардың әрбір шаңырағының рухани байлығына айналдырған. Серіктестік\r\nбиылғы жылдан бастап ауқымын кеңейтіп, баспа өнімдерін шығарумен &nbsp;қатар мемлекеттік рәміздерді, мөр және&nbsp; мөртабан&nbsp;\r\nжасаумен &nbsp;айналысуда. Бұрын&nbsp; мекеме, кәсіпорын қызметкерлері &nbsp;баспа өнімдері үшін облыс орталығына шабылатын\r\nболса&nbsp; серіктестіктің баспа қызметі\r\nжұмысқа&nbsp; қосылғалы бері бұл жұмыстардың\r\nбарлығы да&nbsp; жергілікті жерде іске\r\nасырылатын болды.\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Мемлекеттің ақпарат\r\nсаясатының&nbsp; аудан көлемінде орындалуында\r\n«Ердаулет-Тайма-Баспасөз» ЖШС-нің атқарып жатқан жұмысы зор. Аудан көлемінде\r\nсеріктестік арқылы 1500&nbsp; данаға дейін\r\n«Оңтүстік Қазақстан», 1400&nbsp; данаға дейін\r\n«Айқын», 800 данаға дейін «Егемен Қазақстан», 300 данаға дейін «Южный\r\nКазахстан», 200 данадан астам «Казахстанская правда», 2000 данадан астам «Арыс\r\nақиқаты» газеттері&nbsp; таралады. Бұл аудан\r\nкөлемінде таралатын барлық деңгейлі мерзімді басылымдардың 70 пайыздан астамы\r\nдеген сөз. Бұл жұмыста газет таратушы қызметкерлердің еңбектері айтарлықтай. Олар\r\nгазет-журналдарды&nbsp; оқырмандарға дер\r\nкезінде жеткізіп,&nbsp; көпшіліктің сеніміне\r\nие болуда.\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Алдағы кезде де&nbsp; оқырмандардың мерзімді басылымдарға деген\r\nсұраныстары мен арыстықтардың&nbsp; баспа\r\nөнімдеріне деген&nbsp; тапсырыстарын жоғары\r\nжауапкершілікпен орындап, абырой биігінен көріне береміз деген сенімдеміз.\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:35.4pt;\">\r\n	Баспасөз әр шаңырақтың байлығына\r\nайналсын!\r\n</p>', '<div>\r\n	<h3>\r\n		Что такое AdMe?\r\n	</h3>\r\n	<p>\r\n		Каждый человек в&nbsp;чем-то специалист. Мы, например, 10&nbsp;лет делаем сайт о&nbsp;творчестве.\r\n	</p>\r\n	<p>\r\n		О&nbsp;творчестве во&nbsp;всех его вариантах&nbsp;— от&nbsp;высокого искусства до&nbsp;крутых объявлений на&nbsp;подъездах.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;в&nbsp;AdMe хотим, чтобы творчество стало основой жизни. Чтобы оно \r\nжило во&nbsp;всем, что вы&nbsp;делаете. Потому что творчество делает нас лучше, \r\nдобрее и&nbsp;интереснее.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;собираем ценителей прекрасного. Сомневающихся талантов, \r\nготовых повести к&nbsp;новым горизонтам. Людей, которые понимают, что они \r\nничего не&nbsp;понимают.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;вкладываем душу в&nbsp;то, что делаем. Суть AdMe в&nbsp;том, что его \r\nделают люди, для которых вкус и&nbsp;чувство прекрасного стоят на&nbsp;первом \r\nместе.\r\n	</p>\r\n	<p>\r\n		Наша задача&nbsp;— делать в&nbsp;сети произведение искусства. Чтобы все \r\nсамое лучшее и&nbsp;яркое было собрано в&nbsp;одном месте, у&nbsp;нас. Работы \r\nхудожников, дизайнеров, фотографов, рекламистов, просто неравнодушных \r\nталантливых людей.\r\n	</p>\r\n<br />\r\n<br />\r\n<br />\r\n</div>', '<div>\r\n	<h3>\r\n		Что такое AdMe?\r\n	</h3>\r\n	<p>\r\n		Каждый человек в&nbsp;чем-то специалист. Мы, например, 10&nbsp;лет делаем сайт о&nbsp;творчестве.\r\n	</p>\r\n	<p>\r\n		О&nbsp;творчестве во&nbsp;всех его вариантах&nbsp;— от&nbsp;высокого искусства до&nbsp;крутых объявлений на&nbsp;подъездах.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;в&nbsp;AdMe хотим, чтобы творчество стало основой жизни. Чтобы оно \r\nжило во&nbsp;всем, что вы&nbsp;делаете. Потому что творчество делает нас лучше, \r\nдобрее и&nbsp;интереснее.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;собираем ценителей прекрасного. Сомневающихся талантов, \r\nготовых повести к&nbsp;новым горизонтам. Людей, которые понимают, что они \r\nничего не&nbsp;понимают.\r\n	</p>\r\n	<p>\r\n		Мы&nbsp;вкладываем душу в&nbsp;то, что делаем. Суть AdMe в&nbsp;том, что его \r\nделают люди, для которых вкус и&nbsp;чувство прекрасного стоят на&nbsp;первом \r\nместе.\r\n	</p>\r\n	<p>\r\n		Наша задача&nbsp;— делать в&nbsp;сети произведение искусства. Чтобы все \r\nсамое лучшее и&nbsp;яркое было собрано в&nbsp;одном месте, у&nbsp;нас. Работы \r\nхудожников, дизайнеров, фотографов, рекламистов, просто неравнодушных \r\nталантливых людей.\r\n	</p>\r\n<br />\r\n<br />\r\n<br />\r\n</div>', NULL, '1', 'about-project', '2017-05-15 19:36:12', '2017-11-29 08:31:25', NULL, 'О проекте. Taima.kz ', 'О проекте. Taima.kz ', 'О проекте. Taima.kz ', 'О проекте, Taima.kz ', 'О проекте, Taima.kz ', 'О проекте, Taima.kz ', 'o-nas', 'zhoba-zhaily', 'about-us', '1', 1, 'О проекте', 'Жоба жайында', 'About project', 'Joba jai\'ynda', '<div>\r\n	<h3>\r\n		C\'to takoe AdMe?\r\n	</h3>\r\n	<p>\r\n		Kajdyi\' c\'elovek v&nbsp;c\'em-to spetsi\'ali\'st. My, napri\'mer, 10&nbsp;let delaem sai\'t o&nbsp;tvorc\'estve.\r\n	</p>\r\n	<p>\r\n		O&nbsp;tvorc\'estve vo&nbsp;vseh ego vari\'antah&nbsp;— ot&nbsp;vysokogo i\'sky\'sstva do&nbsp;kry\'tyh obyavleni\'i\' na&nbsp;podezdah.\r\n	</p>\r\n	<p>\r\n		My&nbsp;v&nbsp;AdMe hoti\'m, c\'toby tvorc\'estvo stalo osnovoi\' ji\'zni\'. C\'toby ono \r\nji\'lo vo&nbsp;vsem, c\'to vy&nbsp;delaete. Potomy\' c\'to tvorc\'estvo delaet nas ly\'c\'s\'e, \r\ndobree i\'&nbsp;i\'nteresnee.\r\n	</p>\r\n	<p>\r\n		My&nbsp;sobi\'raem tseni\'telei\' prekrasnogo. Somnevayus\'i\'hsya talantov, \r\ngotovyh povesti\' k&nbsp;novym gori\'zontam. Lyudei\', kotorye poni\'mayut, c\'to oni\' \r\nni\'c\'ego ne&nbsp;poni\'mayut.\r\n	</p>\r\n	<p>\r\n		My&nbsp;vkladyvaem dy\'s\'y\' v&nbsp;to, c\'to delaem. Sy\'t AdMe v&nbsp;tom, c\'to ego \r\ndelayut lyudi\', dlya kotoryh vky\'s i\'&nbsp;c\'y\'vstvo prekrasnogo stoyat na&nbsp;pervom \r\nmeste.\r\n	</p>\r\n	<p>\r\n		Nas\'a zadac\'a&nbsp;— delat v&nbsp;seti\' proi\'zvedeni\'e i\'sky\'sstva. C\'toby vse \r\nsamoe ly\'c\'s\'ee i\'&nbsp;yarkoe bylo sobrano v&nbsp;odnom meste, y\'&nbsp;nas. Raboty \r\nhy\'dojni\'kov, di\'zai\'nerov, fotografov, reklami\'stov, prosto neravnody\'s\'nyh \r\ntalantli\'vyh lyudei\'.\r\n	</p>\r\n<br />\r\n<br />\r\n<br />\r\n</div>', 'O proekte. Taima.kz ', 'O proekte, Taima.kz ', 'zhoba-zhaily', 'Joba jai\'ynda'),
